(3035, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/05/wordpress-4-8-beta-2/\'>WordPress 4.8 Beta 2</a> <span class=\"rss-date\">May 23, 2017</span><div class=\"rssSummary\">WordPress 4.8 Beta 2 is now available! This software is still in development, so we don’t recommend you run it on a production site. Consider setting up a test site just to play with the new version. To test WordPress 4.8, try the WordPress Beta Tester plugin (you’ll want “bleeding edge nightlies”). Or you can [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordpress-4-8-increases-maximum-width-of-the-customizer-sidebar-to-600-pixels\'>WPTavern: WordPress 4.8 Increases Maximum Width of the Customizer Sidebar to 600 Pixels</a></li><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/05/wordpress-4-8-beta-2/\'>Dev Blog: WordPress 4.8 Beta 2</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/storefront-2-2-0-released-includes-design-refresh-and-major-improvements-to-new-user-experience\'>WPTavern: Storefront 2.2.0 Released, Includes Design Refresh and Major Improvements to New User Experience</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> WooCommerce&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=woocommerce&amp;_wpnonce=9e1bb3c262&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install WooCommerce\">(Install)</a></li></ul></div>', 'no'),
