"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:14:\"WordPress News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:5:\"HTTPS\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:18:\"WordPress security\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://semperplugins.com/?p=3129/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:449:\"WordPress recently announced that it will require all hosts to have HTTPS and restrict certain WordPress features to sites that have a valid SSL certificate. Don’t panic just yet. If you already have HTTPS, this shouldn’t affect you. But if you’re still<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/wordpress-requires-sites-to-use-https/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:13158:\"<p><img class=\" wp-image-3419 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured.jpg\" alt=\"\" width=\"851\" height=\"266\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured.jpg 5556w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-300x94.jpg 300w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-768x240.jpg 768w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-1024x320.jpg 1024w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-800x250.jpg 800w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-100x31.jpg 100w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-150x47.jpg 150w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-200x63.jpg 200w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-450x141.jpg 450w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-600x188.jpg 600w, https://semperplugins.com/wp-content/uploads/2017/03/wordpress-requires-https-featured-900x281.jpg 900w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p><a href=\"https://wordpress.org/news/2016/12/moving-toward-ssl/\" target=\"_blank\" rel=\"noopener noreferrer\">WordPress recently announced that it will require all hosts to have HTTPS</a> and restrict certain WordPress features to sites that have a valid SSL certificate.</p>\n<p>Don’t panic just yet. If you already have HTTPS, this shouldn’t affect you. <strong>But if you’re still using HTTP, you’ll need to upgrade soon.</strong> The good news is that the transition is not as difficult as you think it is and the benefits outweigh the assumed disadvantages.</p>\n<p>This article will go over what the WordPress HTTPS mandate means for you as a site owner; the advantages; as well as how to upgrade to HTTPS if you haven’t already done so.</p>\n<h2>What is HTTPS?</h2>\n<p>HTTPS adds a security layer to HTTP (Hypertext Transfer Protocol). <strong>HTTPS essentially encrypts data</strong> (using SSL or TSL) that is communicated between servers and clients until it reaches the intended recipient.</p>\n<p>This<strong> prevents cybercriminals from accessing sensitive user information</strong> and also reduces the risk of tapping and modification of sensitive data. Although HTTPS is not completely foolproof, it undoubtedly has major security advantages.</p>\n<p>HTTPS sites can be easily identified, as they have a locked padlock icon located on the link bar in most common browsers.</p>\n<h2>Why is WordPress Pushing HTTPS?</h2>\n<p>There&#8217;s mainly two reasons for this, so let&#8217;s quickly dive into them.</p>\n<h3>Google Prefers It</h3>\n<p>It is no secret that greater encryption and cyber security has made the Internet a safer place for users. As usual, a Google update signaled the necessity of HTTPS for user experience, SEO and internet security.</p>\n<p>In 2014, Google suggested that <strong>enabling HTTPS on your site could result in higher search rankings</strong>. Although it still isn’t the only important factor in raising your site rankings, you shouldn’t underestimate its value. For example, if two sites are equal in all ways, but one site has HTTPS, that site would get a boost in rankings.</p>\n<div id=\"attachment_3342\" style=\"width: 511px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-3342\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock.png\" alt=\"Chrome will display a green padlock in the link bar when a site is using HTTPS, assuring users it\'s using the latest security protocol.\" width=\"501\" height=\"217\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock.png 1138w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-300x130.png 300w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-768x333.png 768w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-1024x444.png 1024w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-577x250.png 577w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-100x43.png 100w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-150x65.png 150w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-200x87.png 200w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-450x195.png 450w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-600x260.png 600w, https://semperplugins.com/wp-content/uploads/2017/03/https-green-padlock-900x390.png 900w\" sizes=\"(max-width: 501px) 100vw, 501px\" /><p class=\"wp-caption-text\">Chrome will display a green padlock in the link bar when a site is using HTTPS, assuring users it&#8217;s using the latest security protocol.</p></div>\n<p>In January of this year, Google released version 56 of Google Chrome. This new release brought about some changes, notably with how Google Chrome treats HTTPS vs. HTTP sites. The browser now clearly identifies sites that are not operating HTTPS on their systems. For example, <strong>a “Not Secure” message now appears on pages without HTTPS that try to collect passwords or sensitive information</strong>. You can expect that, eventually, all pages not using HTTPS will clearly be labeled as having insecure connections.</p>\n<p>We can reasonably assume that Google’s preference for HTTPS has been a contributing factor for the changes implemented by WordPress.</p>\n<h3>Users Prefer HTTPS Too</h3>\n<p>A secure connection can make all the difference from a user&#8217;s perspective. Users see HTTPS as a positive signal that you are taking your site security seriously, for their benefit. So, having <strong>HTTPS could mean more traffic and longer usage times</strong> on your site.</p>\n<p>HTTPS is particularly important if you are operating an e-commerce site. Simply seeing the padlock icon could make users more comfortable in entering their payment details and other personal information. Particularly with the new Chrome update (mentioned earlier) which shows a “Not Secure” label on e-commerce sites or sites that require a user login or credit card information, but don’t have HTTPS.</p>\n<p>Both Google and user preference should be enough reason for you to upgrade your site to HTTPS. It is simply necessary to ensure watertight security for your users and to protect your online business reputation.</p>\n<div id=\"attachment_3343\" style=\"width: 510px\" class=\"wp-caption aligncenter\"><img class=\" wp-image-3343\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure.png\" alt=\"Sites that require users to login or enter credit card information are now displayed as &quot;Not secure&quot; in Chrome when they haven\'t switched to HTTPS yet.\" width=\"500\" height=\"196\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure.png 1600w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-300x118.png 300w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-768x301.png 768w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-1024x401.png 1024w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-638x250.png 638w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-100x39.png 100w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-150x59.png 150w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-200x78.png 200w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-450x176.png 450w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-600x235.png 600w, https://semperplugins.com/wp-content/uploads/2017/03/https-not-secure-900x353.png 900w\" sizes=\"(max-width: 500px) 100vw, 500px\" /><p class=\"wp-caption-text\">Sites that require users to login or enter credit card information are now displayed as &#8220;Not secure&#8221; in Chrome when they haven&#8217;t switched to HTTPS yet.</p></div>\n<p>Remember when JavaScript was first introduced and quickly embraced by users and webmasters? Looking back, we can see now that JavaScript was essential for smoother and better user experience. HTTPS similarly, presents a number of unique advantages for user experience and security that we should all quickly embrace.</p>\n<p>We know that you may be overwhelmed switching from HTTP to HTTPS. After all, change does takes time to get used to, but in this instance, you may need to quickly get on board. At this point, <strong>the advantages of HTTPS have greatly outnumbered the disadvantages</strong>. Plus, upgrading to HTTPS is no longer the costly, time consuming, and difficult process that it once was. In fact, getting an SSL certificate in 2017 is fast, sometimes free, and quite easy to implement.</p>\n<h2>How to Get HTTPS</h2>\n<p><a href=\"https://wordpress.org/hosting/\" target=\"_blank\" rel=\"noopener noreferrer\">WordPress hosting partners</a> should now provide an SSL certificate for all accounts. (It is required that they all do so as early as the first quarter of this year.)</p>\n<p>Your hosting provider may already provide a free SSL certificate, so check with them first before you make any third-party purchase. If they do not offer a free one, you could ask them if they sell third party SSL certificates. Once purchased, you can ask your provider to install the certificate for you on your server.</p>\n<div id=\"attachment_3344\" style=\"width: 510px\" class=\"wp-caption aligncenter\"><img class=\" wp-image-3344\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors.png\" alt=\"Dozens of major companies are already backing Lets Encrypt, including Automattic (known for WooCommerce, Jetpack, Akismet and WordPress.com)\" width=\"500\" height=\"395\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors.png 546w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-300x237.png 300w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-317x250.png 317w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-100x79.png 100w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-150x118.png 150w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-200x158.png 200w, https://semperplugins.com/wp-content/uploads/2017/03/lets-encrypt-sponsors-450x355.png 450w\" sizes=\"(max-width: 500px) 100vw, 500px\" /><p class=\"wp-caption-text\">Dozens of major companies are already backing Lets Encrypt, including Automattic (known for WooCommerce, Akismet and WordPress.com)</p></div>\n<p>Another option is to explore the free alternatives, independent of your hosting provider. There are projects such as “Let’s Encrypt” which have now made it easy and quick to <a href=\"https://letsencrypt.org/\" target=\"_blank\" rel=\"noopener noreferrer\">secure a free HTTPS certificate for your website</a>.</p>\n<p>Let’s Encrypt is an authorized open Certificate Authority with millions of active certificates in place. There are other comparable projects out there that can help by guiding you step-by-step through the installation process or who have been authorized to deliver certificates.</p>\n<p>Remember that SSL certificates upgrade the website, but not the content itself. That means that the content on your page will also need to be updated so as to avoid 404 errors. Google may interpret the error as a mismatch in the security level of your site. The only way to avoid this is by encrypting the content of your website to match your SSL certificate.</p>\n<p>To track and resolve any 404 errors on your site, you may want to use a specialised plugin such as Redirection to do so.</p>\n<h2>What if You Just Don’t Want to Upgrade to HTTPS?</h2>\n<p>You could see a number of things happening to your site over time if you do not upgrade to HTTPS. The first may be facing the consequences set out by Google, i.e: <strong>lower rankings </strong>and having your users staring at a “Not Secure” warning when they try to access your site via Google Chrome.</p>\n<p>The second is that you could <strong>struggle with WordPress updates and lose some or all functionality</strong> on specific WordPress plugins.</p>\n<p>Third, your site may be <strong>an easier target for hacking</strong>.</p>\n<p>Those are three consequences that require you to seriously reconsider if you really want to take the risk of not upgrading to HTTPS.</p>\n<h2>Wrapping Up</h2>\n<p>Let’s put it this way: you will simply have nothing to lose by adopting HTTPS. Yet, if you do not use HTTPS, you could risk leaving your site in the “dark ages” of the Internet.</p>\n<p>But then again, if you’re a WordPress site owner, you have no choice. Take the plunge and let us know how it worked out for you!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://semperplugins.com/wordpress-requires-sites-to-use-https/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"22\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"All in One SEO Pack at WordCamp Raleigh 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://semperplugins.com/all-in-one-seo-pack-at-wordcamp-raleigh-2017/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://semperplugins.com/all-in-one-seo-pack-at-wordcamp-raleigh-2017/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 May 2017 15:42:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:19:\"All in One SEO Pack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:16:\"WordCamp Raleigh\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:13:\"WordPress SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://semperplugins.com/?p=3426/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:417:\"Last month, the team from All in One SEO Pack were in attendance at WordCamp Raleigh 2017.  We were not only there are organizers of the event but also as sponsors and speakers. If you didn&#8217;t get a chance to attend<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/all-in-one-seo-pack-at-wordcamp-raleigh-2017/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Steve Mortiboy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3680:\"<p>Last month, the team from All in One SEO Pack were in attendance at <a href=\"https://2017.raleigh.wordcamp.org/\" target=\"_blank\" rel=\"noopener noreferrer\">WordCamp Raleigh 2017</a>.  We were not only there are organizers of the event but also as sponsors and speakers.</p>\n<p>If you didn&#8217;t get a chance to attend WordCamp Raleigh then here&#8217;s a recap of the event.</p>\n<p>WordCamp Raleigh is a conference all about WordPress.  The event has been held each year since 2010.  This year was the best attended yet, with over 300 attendees.  This year we had four tracks &#8211; Beginner, Business, Power User and Developer. We also added workshops in addition to the tracks.  There were three workshops &#8211; Beginners Guide to WordPress, WordPress REST API and Beginners Guide to WordPress SEO.  All three were extremely popular.</p>\n<h2>Local SEO presentation by Steve Mortiboy</h2>\n<p>I spoke on the topic of Local SEO &#8211; How to get your business listed on Google&#8217;s local search results.  Here are my slides from this presentation:</p>\n<p><iframe src=\"https://www.slideshare.net/slideshow/embed_code/key/4Ssk3Lm2vq2l18\" width=\"427\" height=\"356\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" style=\"border:1px solid #CCC; border-width:1px; margin-bottom:5px; max-width: 100%;\" allowfullscreen> </iframe> </p>\n<div style=\"margin-bottom:5px\"> <strong> <a href=\"https://www.slideshare.net/dismort/local-seo-getting-your-local-business-on-google\" title=\"Local SEO - Getting your local business on google\" target=\"_blank\">Local SEO &#8211; Getting your local business on google</a> </strong> from <strong><a target=\"_blank\" href=\"https://www.slideshare.net/dismort\">Steve Mortiboy</a></strong> </div>\n<p>Here is the video from my presentation on WordPress.tv:</p>\n<p><iframe width=\'605\' height=\'340\' src=\'https://videopress.com/embed/u6Rx29m9?hd=0\' frameborder=\'0\' allowfullscreen></iframe><script src=\'https://v0.wordpress.com/js/next/videopress-iframe.js?m=1435166243\'></script></p>\n<h2>Social Meta Optimization by Tony Zeoli</h2>\n<p>In addition to my session, Tony Zeoli also gave a presentation on Social Meta Optimization where he used All in One SEO Pack to demonstrate how you can improve you social media presence.  You can find more about Tony&#8217;s presentation on his <a href=\"https://tonyzeoli.com/2017/05/28/social-meta-optimization-presentation-at-wordcamp-raleigh-2017/2062/\" target=\"_blank\" rel=\"noopener noreferrer\">website</a>.  The video from his presentation is also on WordPress.tv here:</p>\n<p><iframe width=\'605\' height=\'340\' src=\'https://videopress.com/embed/rG2jN5os?hd=0\' frameborder=\'0\' allowfullscreen></iframe><script src=\'https://v0.wordpress.com/js/next/videopress-iframe.js?m=1435166243\'></script></p>\n<h2>Beginners Guide to SEO by Tony Zeoli</h2>\n<p>Finally, Tony Zeoli also presented the Beginners Guide to WordPress SEO workshop which was held on the Sunday at WordCamp Raleigh.  This workshop was not recorded on video but you can find a write by Tony and links to his slides on his <a href=\"https://tonyzeoli.com/2017/05/20/wordcamp-raleigh-2017-wordpress-seo-for-beginners-workshop/1998/\" target=\"_blank\" rel=\"noopener noreferrer\">website</a>.</p>\n<p>If you didn&#8217;t get a chance to attend WordCamp Raleigh this year, keep a watch on the <a href=\"https://2017.raleigh.wordcamp.org/\" target=\"_blank\" rel=\"noopener noreferrer\">website</a> for announcements regarding WordCamp Raleigh 2018.  Or you can find a WordCamp in your city or country by checking out the central <a href=\"https://central.wordcamp.org/schedule/\" target=\"_blank\" rel=\"noopener noreferrer\">WordCamp schedule</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://semperplugins.com/all-in-one-seo-pack-at-wordcamp-raleigh-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Important Sections of Google Analytics Explained\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://semperplugins.com/important-sections-of-google-analytics-explained/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://semperplugins.com/important-sections-of-google-analytics-explained/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 May 2017 15:00:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"google analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://semperplugins.com/?p=2298\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:443:\"Google Analytics (GA) is one of the most powerful, effective and comprehensive platforms to track and analyze your site traffic and marketing efforts. But a lot of businesses find it intimidating and challenging to use. If you’re one of those<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/important-sections-of-google-analytics-explained/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:13749:\"<p><img class=\"size-full wp-image-3381 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured.jpg\" alt=\"\" width=\"851\" height=\"251\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured.jpg 851w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-768x227.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-848x250.jpg 848w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-450x133.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/08/important-sections-of-google-analytics-featured-600x177.jpg 600w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p>Google Analytics (GA) is <strong>one of the most powerful, effective and comprehensive platforms</strong> to track and analyze your site traffic and marketing efforts. But a lot of businesses find it intimidating and challenging to use. If you’re one of those businesses, this article is for you.</p>\n<p>Although GA can be quite overwhelming, getting useful data to work with is not as difficult as you think it is. Understanding how to get some basic information from the platform can give you pretty good insight into how your website is working for your business.</p>\n<p>This article will give you a basic understanding of the four key sections that contain actionable data:</p>\n<p style=\"padding-left: 30px;\">1. Audience<br />\n2. Behavior<br />\n3. Acquisition<br />\n4. Conversions</p>\n<p>Let’s get started.</p>\n<h2><strong>An Introduction to Google Analytics</strong></h2>\n<p>You probably have a Google Analytics account and most likely have it connected to your website. If you don’t, and you’re thinking of signing up, <a href=\"https://support.google.com/analytics/answer/1008015?hl=en\" target=\"_blank\" rel=\"noopener noreferrer\">use this guide on how to get started</a>. Once you’re up and running, you’ll have to wait a few days to get data to analyze.</p>\n<p>The first thing you’ll notice when you open the platform is GA’s (somewhat confusing) layout and menu system. It uses a top navigation for account level features and information; and a side navigation for combing through your analytics data.</p>\n<p>The Reporting section’s side navigation (which is where you can view your web analytics) is broken down into the following sections:</p>\n<ul>\n<li><strong>Real-Time:</strong> Shows what is happening on your site right now. So you’ll see the current visitor count on your website, what pages they’re browsing and for how long</li>\n<li><strong>Audience:</strong> Gives detailed information about your website visitors</li>\n<li><strong>Acquisition:</strong> Shows how your visitors are arriving to your site. It gives you a breakdown (by channel) of how visitors are getting to your site</li>\n<li><strong>Behavior:</strong> Shows you how visitors are interacting with your site</li>\n<li><strong>Conversions:</strong> Provides conversion data for your various business goals and activities</li>\n</ul>\n<p>As you can see, Audience, Acquisition, Behavior and Conversions tabs contain the <strong>actionable data you can use to optimize your site and grow your business.</strong></p>\n<p>So let’s help you get a basic understanding of those tabs.</p>\n<h2><strong>Audience</strong></h2>\n<p>To view your audience insights, click on Audience &gt; Overview on the left hand menu of the analytics dashboard.</p>\n<p>As you will see from the Audience Overview data, Google Analytics gives you detailed insights into your audience: from location, to page views to device type to language and more.</p>\n<p>This information is invaluable in allowing you to tailor your site<strong> to better suit the needs of your visitors and effectively grant them an easier viewing experience</strong>.</p>\n<p><a href=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section.jpg\"><img class=\"aligncenter wp-image-3405\" src=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section.jpg\" alt=\"\" width=\"600\" height=\"255\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section.jpg 1621w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-300x128.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-768x327.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-1024x436.jpg 1024w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-587x250.jpg 587w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-100x43.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-150x64.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-200x85.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-450x192.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-600x255.jpg 600w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-audience-section-900x383.jpg 900w\" sizes=\"(max-width: 600px) 100vw, 600px\" /></a></p>\n<p>There is however some terminology you first need to understand in order to accurately analyze your Audience data:</p>\n<ul>\n<li>A <strong>Session</strong> refers to a single fixed period of time that a visitor takes action(s) on your site. So if a visitor views 3 pages on your site over a 3-minute period and then exits your site, it’ll be recorded as a single session and three pageviews</li>\n<li>As you may have gleaned from above, a <strong>Pageview</strong> is recorded whenever a visitor views a page on your site</li>\n<li>A <strong>New Visitor</strong> is any user that is visiting your site for the first time. They will be classified as a <strong>Returning Visitor</strong> on their second and subsequent visits</li>\n<li>A <strong>User</strong> is any computer or device that Google classifies as a unique visitor in accessing your site. So let’s say a user views your site on both their computer and tablet. Google will record that as two users. Even if a user accesses your site from two different browsers on the same computer, Google will record it as two users</li>\n<li><strong>Pages/Session</strong> is the average number of pageviews per session</li>\n</ul>\n<p>It is recommended that you spend some time understanding these definitions before you begin analyzing the comprehensive audience data.</p>\n<h2><strong>Behavior</strong></h2>\n<p><a href=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section.jpg\"><img class=\"aligncenter wp-image-3407\" src=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section.jpg\" alt=\"\" width=\"600\" height=\"286\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section.jpg 1621w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-300x143.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-768x367.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-1024x489.jpg 1024w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-524x250.jpg 524w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-100x48.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-150x72.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-200x95.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-450x215.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-600x286.jpg 600w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-behaviour-section-900x430.jpg 900w\" sizes=\"(max-width: 600px) 100vw, 600px\" /></a></p>\n<p>The Behavior section gives you <strong>invaluable data on how your users are interacting with your site.</strong> You can track how long an average user stays on a specific page, the hours and days you receive the most traffic, bounce rates (the percentage of visitors who exit your site after viewing only one page), your site speed, and much more detailed and useful metrics.</p>\n<p>Spend some time exploring and familiarizing yourself with this section. It contains everything you need to know to optimize your site and user experience, and also to manage your blog or content pages.</p>\n<h2><strong>Acquisition</strong></h2>\n<p><a href=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section.jpg\"><img class=\"aligncenter wp-image-3409\" src=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section.jpg\" alt=\"\" width=\"600\" height=\"297\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section.jpg 1609w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-300x149.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-768x380.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-1024x507.jpg 1024w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-505x250.jpg 505w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-100x50.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-150x74.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-200x99.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-450x223.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-600x297.jpg 600w, https://semperplugins.com/wp-content/uploads/2016/08/google-analytics-acquisition-section-900x446.jpg 900w\" sizes=\"(max-width: 600px) 100vw, 600px\" /></a></p>\n<p>The Acquisition section is pretty straightforward: it contains <strong>data on how your site acquires traffic</strong>. It records the following traffic channels: organic (search and direct), paid, referral, email and social. It also gives you important insights into the performance of your marketing campaigns.</p>\n<p>What you should really be looking at within the Acquisition section is Goals. Goals are what you hope visitors accomplish when or after using your site. They are summarized in the Overview of this section but aren’t presented or broken down in detail. That’s where the Conversions section comes in.</p>\n<h2><strong>Conversions</strong></h2>\n<p>Conversion tracking is arguably the most important functionality in Google Analytics. After all, the ultimate goal of any web analytics software/tool is <strong>to help you determine and increase the success of your website and business</strong>.</p>\n<p>To make the most out of Google Analytics, you need to understand and identify your key performance indicators (KPIs) and set them up as Goals. Goals could range from video views, newsletter signups, purchases and more.</p>\n<p>Carefully think about how you measure the success of your business before setting up your Goals in GA. An accurate setup will enable you to more effectively analyze your website traffic data.</p>\n<h2>Using All in One SEO Pack with Google Analytics</h2>\n<p>By now you should have already discovered that Google Analytics is a great tool to track your visitors behaviour. If you are using WordPress for your site and have decided to venture into the statistics, <a href=\"https://semperplugins.com/all-in-one-seo-pack-pro-version/\">we recommend you use our All in One SEO Pack plugin</a>.</p>\n<p>It offers a simple way to integrate Google Analytics on your site without having to risk breaking your site or messing with code. The whole process is very simple and is described <a href=\"https://semperplugins.com/documentation/setting-up-google-analytics/\">here</a>.</p>\n<p>But that&#8217;s not all it has to offer: there are also various other advanced settings such as tracking multiple domains, adding additional domains, enhanced e-commerce, tracking outbound links, excluding WordPress user roles from tracking and many more.</p>\n<h2><strong>Wrapping Up</strong></h2>\n<p>A basic overview of those four actionable sections should ease the challenge of collecting relevant data for your business. However, getting invaluable data from Google Analytics requires work, time and patience. Stay tuned for an article that delves deeper into extracting and accurately analyzing data in Google Analytics.</p>\n<p>For now, you can take a look at some of the tutorials in the <a href=\"https://analyticsacademy.withgoogle.com/\" target=\"_blank\" rel=\"noopener noreferrer\">Google Analytics Academy</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://semperplugins.com/important-sections-of-google-analytics-explained/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n	