 to Friendster, Diaspora, Myspace and onto Facebook. But when we think of social media today, we arguably only have 3 or 4 large<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/how-social-media-impacts-seo/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11760:\"<p><img class=\"size-full wp-image-3275 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured.jpg\" alt=\"\" width=\"851\" height=\"251\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured.jpg 851w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-768x227.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-848x250.jpg 848w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-450x133.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/11/how-social-media-impacts-seo-featured-600x177.jpg 600w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p>Social media has evolved quite rapidly in the years it has been around. From BBS (Bulletin Board) to Friendster, Diaspora, Myspace and onto Facebook. But when we think of social media today, we arguably only have 3 or 4 large networks in mind: Facebook, Twitter, Instagram and LinkedIn.</p>\n<p>Nowadays, those four platforms have become essential to every marketer’s strategy and are used to effectively get your brand in front of your target audience; but do they <em>directly</em> impact your SEO and search ranking? No, they currently do not.</p>\n<p>However, that doesn&#8217;t mean that social media marketing and SEO do not affect each other in a variety of different ways. They are both inbound strategies that aim to attract your audience or customers to your brand. They are also both organic ways to attract your audience with unique quality content.</p>\n<p>Perhaps the best way to describe the relationship between SEO and social media is to say that they are co-dependent. Effective social media campaigns will help improve your site ranking, and good SEO will inevitably boost your social clout. This is what we refer to as social SEO: <strong>the use of social media to boost your search engine rankings</strong>.</p>\n<p>This post will demystify the relationship between social media and SEO; and show you how you can make social SEO work for your WordPress site.</p>\n<h2>How Important is Social SEO?</h2>\n<p>You can certainly rank your website well without focusing much on social SEO. You can’t, however, rank your website by focusing solely on social SEO. But that shouldn’t make you dismiss the whole idea too soon.</p>\n<p>An active and strong social media presence makes it easier and faster to rank your site as search engines attribute <strong>authority</strong> based on tweets, shares, likes and Google +1s. Your social media presence also puts your content in front of a larger audience, some of whom will link your content on their own sites, creating valuable organic <strong>backlinks</strong> which contribute to your PageRank.</p>\n<div id=\"attachment_3276\" style=\"width: 630px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-3276\" src=\"https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph.png\" alt=\"According to a recent study, Social Media Marketing even surpassed the impact of regular SEO in 2016, considering that market is already rather saturated. Time to hop on the bandwagon!\" width=\"620\" height=\"359\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph.png 981w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-300x174.png 300w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-768x445.png 768w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-432x250.png 432w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-100x58.png 100w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-150x87.png 150w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-200x116.png 200w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-450x261.png 450w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-600x347.png 600w, https://semperplugins.com/wp-content/uploads/2016/11/social-media-marketing-graph-900x521.png 900w\" sizes=\"(max-width: 620px) 100vw, 620px\" /><p class=\"wp-caption-text\">According to a recent study, Social Media Marketing even surpassed the impact of regular SEO in 2016, considering that market is already rather saturated. Time to hop on the bandwagon! Source: smartinsights.com/managing-digital-marketing/marketing-innovation/marketing-trends-2016/</p></div>\n<p>That is not to say that social SEO will eventually replace regular SEO, but we cannot ignore the fact that social signals are slowly becoming an integral part of search engine algorithms. Even though they have nothing on backlinks – and probably won’t, at least not in the near future – <strong>social links</strong> are still quite important. But <em>how much</em> effect or weight do they have on your rankings, particularly your ranking for target keywords?</p>\n<p>Well, search engines have not yet made that information public. We just have to work with the definitive information that social signals do (indirectly) impact your site rankings and will continue to do so.</p>\n<h2>When Should I Focus on Social SEO?</h2>\n<p>If you are in an industry where your competitors are heavily focusing on both SEO and social SEO, and you want to rank well for your industry keywords, you have no other option but to do the same. Backlinks coupled with social signals will boost your rankings much more than backlinks alone, so you will lag behind your competition if you are only focused on building the latter. And if they aren’t focused on social SEO, <strong>you should jump on the opportunity to get one step ahead of your competitors</strong>.</p>\n<p>Although social media does not directly impact your site rankings on Google, social networks are dominating the internet and will arguably dictate the future of the internet. You should invest properly in social media as it could soon <em>directly</em> impact your site’s rankings on search engines.</p>\n<h2>How to Effectively Implement Social SEO</h2>\n<p>How can you increase your site rankings with good social SEO? Here are a few summarized tips:</p>\n<ul>\n<li>Create a business page on the “main” social networks: Facebook, Twitter, LinkedIn, Google+, Pinterest, Instagram, etc.</li>\n<li>Be active on those channels and engage your followers and subscribers</li>\n<li>Create shareable, engaging and unique content</li>\n<li>Make it as easy as possible for people to share your content</li>\n<li>Share your content, and that of other influencers in your field on your social channels</li>\n</ul>\n<p><strong>The more active you are on social media, the more awareness you are bringing to your brand</strong>, the more your social following grows, and the higher the chance that your content is being shared across a broader network. It’s a snowball effect: the more followers you have, the more engagement you’ll get and the easier it will become to grow your community.</p>\n<p>A bigger community means that more people are viewing your content and the higher the chance that the content will be shared. This increases the number of backlinks to your site which will impact your search rankings for the better.</p>\n<p>Also, the more engagement you have on your social channels, the higher the chance that people will look for your brand on Google or other search engines via branded searches – which help your site rank for non-branded keywords that are relevant to your brand.</p>\n<p>You do have to consider that <strong>the above scenarios are based on the assumption that you are producing quality and unique content</strong>. If you are creating bad content, you won’t get anywhere. Users will not interact with your brand if you’re not offering them value or good entertainment. If you want your content shared and widely distributed, you need to put in the time to create quality and valuable content your audience will enjoy.</p>\n<p>In summary, the following social signals will increase your search engine rankings for the keywords you’re targeting:</p>\n<ul>\n<li>Your social network followers</li>\n<li>The likes, shares, retweets, Google +1s your website gets</li>\n<li>Mentions by other authority or influencers in your field</li>\n<li>Positive reviews on your business’ Google+ page</li>\n</ul>\n<h2>Using All in One SEO Pack for Social Meta</h2>\n<p><a href=\"https://semperplugins.com/all-in-one-seo-pack-pro-version/?loc=sp_navmenu\">Our All in One SEO Pack plugin comes with a Social Meta module</a> to help you get going with social marketing. This feature allows you to add Open Graph meta tags to enrich your posts by creating a rich snippet. Let’s briefly go over how Open Graph meta tags work and how they specifically help you with social SEO.</p>\n<p>Basically, every web page on any site can be shared on social media channels. However, the way that shared page is displayed on social media may be very different. Websites that aren’t optimized with Open Graph meta tags won’t be as easily interpreted by Facebook, Twitter and the like and will, most of the time, show up as a blank link with a small description underneath.</p>\n<div id=\"attachment_3278\" style=\"width: 516px\" class=\"wp-caption aligncenter\"><img class=\"size-full wp-image-3278\" src=\"https://semperplugins.com/wp-content/uploads/2016/11/rich-social-snippet.png\" alt=\"Would you be more inclined to click on a blank link or on a rich snippet such as this?\" width=\"506\" height=\"495\" /><p class=\"wp-caption-text\">Would you be more inclined to click on a blank link or on a rich snippet such as this?</p></div>\n<p>However, adding Open Graph meta tags to a page on your site enriches the snippet and enables Facebook and other social media networks to display your content in the way you want to present it when it is shared. This is where All in One SEO Pack comes into action. For a full overview of all Open Graph and social meta features, please visit our <a href=\"https://semperplugins.com/documentation/social-meta-module/\">documentation section</a>.</p>\n<p>There is no concrete evidence that Open Graph meta tags are important for search engines, but they do enable you to create presentable good looking posts on social media (instead of a bland-looking post). This significantly increases your organic traffic from social media to your WordPress site. Studies have shown that <strong>traffic increases 100%-200% if a post looks great</strong> vs. a blank link that doesn’t really mean much to social media users.</p>\n<h2>Wrapping It Up</h2>\n<p>Overall, a solid social media strategy, in conjunction with good SEO practices, will increase organic traffic to your site. Solely focusing on SEO may not cut it any longer if you want to be a step ahead of your competition. Revising your strategy to incorporate social SEO will inevitably boost your organic traffic and could very well increase your search engine rankings in the near future.</p>\n<p>Do you currently have a social SEO strategy that’s working for you? Have you been using the social SEO module of our All in One SEO Pack plugin? Let us know in the comments below!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://semperplugins.com/how-social-media-impacts-seo/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"How to Build an Email List in WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://semperplugins.com/how-to-build-an-email-list-in-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://semperplugins.com/how-to-build-an-email-list-in-wordpress/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 01 May 2017 14:00:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:15:\"email marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:14:\"subscribe2html\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://semperplugins.com/?p=2904\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:423:\"How many of you have prioritized pageviews over email marketing? We all have at some point. After all, pageviews equals more ad revenue…right? Well, having a good email list is more valuable and can bring in more pageviews than you<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/how-to-build-an-email-list-in-wordpress/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9578:\"<p><img class=\"size-full wp-image-3258 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured.jpg\" alt=\"\" width=\"851\" height=\"251\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured.jpg 851w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-768x227.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-848x250.jpg 848w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-450x133.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/11/how-to-build-an-email-list-featured-600x177.jpg 600w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p>How many of you have prioritized pageviews over email marketing? We all have at some point. After all, pageviews equals more ad revenue…right? Well, having a good email list is more valuable and can bring in more pageviews than you get using traditional methods.</p>\n<p>So how do you build an email list in WordPress?</p>\n<p>You always hear the same advice: create great content and people will subscribe, or have an opt-in form on your blog. Those methods are tried and tested but there are other more creative and effective ways to implement them and speed up the growth of your email list.</p>\n<p>We’re talking content upgrades, high-value opt-in forms and social proof.</p>\n<p>Let’s first start off with the basics before we dive into those three methods and how to effectively employ them.</p>\n<h2>The Basics</h2>\n<h3>What is an Email List?</h3>\n<p>An email list is a list of email addresses of your existing and prospective customers who have signed up or subscribed via your WordPress site to get updates, newsletters, special offers or announcements.</p>\n<h3>Why You Should Build an Email List</h3>\n<p>Email consistently outperforms social media across the board. It gets a higher view rate than Facebook or Twitter; 50-100 times the click rates of Facebook or Twitter; and is more cost-effective than any other marketing and social channel. Why? Because email is more intimate and private.</p>\n<p>If those stats haven’t convinced you yet, here are three other really good reasons:</p>\n<p><strong>#1.</strong> Your emails are guaranteed to reach the inboxes of each and every one of the active contacts on your email list. The email stays in their inbox until they take an action. Compare that to Facebook or Twitter, where your statuses and posts may not be seen by your followers because of algorithms and the inherent nature of those social networks. Bottom line: people check their emails more thoroughly than they do their social timelines</p>\n<p><strong>#2.</strong> Email is more secure and more flexible. You own your email list. You however, have very limited control and no ownership of your Twitter and Facebook account data. Furthermore, your social accounts could get hacked or suspended for whatever reason; or the platform could cease to exist or become less popular (think Myspace) etc. Whereas you own your email list and can communicate with your customers and prospects on your own terms.</p>\n<p><strong>#3.</strong> Email has more specific targeting. You can send information or announcements on product specific or geo-specific services to specific contacts that match some particular criteria.</p>\n<p>That’s not to say that you should neglect your social networks. Social is great for user engagement so don’t give up on social just yet. Email will just bring you more visitors and conversions.</p>\n<p>So how can you get started today?</p>\n<p>Well, there are quite a few WordPress email marketing plugins at your disposal. Most of them require you to use them in conjunction with email marketing service providers and only help you to create signup forms on your site. They don’t go much further than that. A few however do. <a href=\"https://semperplugins.com/subscribe2-html/\" target=\"_blank\" rel=\"noopener noreferrer\">One of those is Subscribe2 HTML</a>.</p>\n<h2>Subscribe2 HTML</h2>\n<p>Subscribe2HTML plugin is arguably one of the most comprehensive and reliable email marketing plugins for WordPress. It gives you the option of sending emails on a per-post basis or periodically in a newsletter format.</p>\n<p>It manages your email lists in a straightforward way. For example, you don’t need to log in to compose an email every time before sending one. This comes in handy when you need to send out timely post updates – a great feature for high traffic blogs.</p>\n<p>There are two subscription options for Subscribe2 HTML: Registered Subscribers and Public Subscribers. Registered Subscribers are users who have subscribed to your blog and are consequently required to log-in to your site to manage their subscriptions. They can opt to receive either plain text or HTML emails. You can send them post notifications by category; and they can choose whether they want just the excerpt or the full post. (If they don’t make a choice, they will get the full post when they select the plain text option).</p>\n<div id=\"attachment_3261\" style=\"width: 391px\" class=\"wp-caption aligncenter\"><img class=\" wp-image-3261\" src=\"https://semperplugins.com/wp-content/uploads/2016/11/subscribe2.png\" alt=\"Suscribe2HTML is full of features and can be configured in any way you like.\" width=\"381\" height=\"462\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/11/subscribe2.png 610w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-248x300.png 248w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-206x250.png 206w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-100x121.png 100w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-150x182.png 150w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-200x242.png 200w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-300x363.png 300w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-450x545.png 450w, https://semperplugins.com/wp-content/uploads/2016/11/subscribe2-600x727.png 600w\" sizes=\"(max-width: 381px) 100vw, 381px\" /><p class=\"wp-caption-text\">Suscribe2HTML is full of features and can be configured in any way you like.</p></div>\n<p>Public Subscribers can sign up through an online form. However, their subscription only starts when they confirm the subscription request via email. They do not get to choose between an excerpt or plain text version of an email.</p>\n<p>As an admin, you can subscribe or unsubscribe users and send emails to all verified subscribers. You also have a selection of email templates to choose from.</p>\n<p>There are additional options and settings available, like choosing the frequency of your emails and the time of day to send them. The plugin is all about automation to save you valuable time.</p>\n<h2>3 Effective strategies to Grow Your Email List</h2>\n<h3>Content</h3>\n<p>Consistently creating great content is the advice you always hear and read about when looking for ways to increase traffic to your blog and to grow your email list. That’s all good and true, but have you heard of a content upgrade? It’s a simple and highly effective strategy to grow your email list.</p>\n<p>How it works:</p>\n<ol>\n<li>Write an engaging blog post.</li>\n<li>Create a more in-depth version of the post.</li>\n<li>Give readers the option to read the upgraded content in return for their email address.</li>\n</ol>\n<p>This strategy works on the basis that your readers are already interested in the blog post since they clicked on it. So, a content upgrade plays on that interest by offering more. It’s simple, straightforward and highly effective.</p>\n<h3>Opt-In Forms</h3>\n<p>Like you’ve heard over and over again (and seen on many high-traffic sites), opt-in forms are the way to go when growing your email list. It’s worth mentioning again in this post. Whether you’re offering an eBook, white paper or free software, opt-in forms will increase your email subscriptions.</p>\n<p>The key is not to offer as many incentives as you can. The most efficient strategy is to pick a high-value incentive and place it in appropriate areas of your site (the sidebar, pop-ups, blog post, footer, etc.). This strategy is especially great for small businesses that don’t have the time or the manpower to produce upgraded content for every blog post.</p>\n<h3>Social Proof</h3>\n<p>A majority of online users rely on ratings, popularity and reviews in making purchasing decisions. Social proof is very important and shouldn’t be underestimated.</p>\n<p>That being said, you should focus on your numbers. Add up all your followers and subscribers on all channels and put the total out there. The bigger the number, the more impressive.</p>\n<p>In fact, various research studies have shown that social proof has more impact on behavior than financial, environmental and personal incentives.</p>\n<p>Would you also like to be included in our email list? Go to <a href=\"https://semperplugins.com/\">our homepage</a> and enter your email address to subscribe!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://semperplugins.com/how-to-build-an-email-list-in-wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"14\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"9 Steps to Clean Your WordPress Database\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://semperplugins.com/how-to-clean-your-wordpress-database/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://semperplugins.com/how-to-clean-your-wordpress-database/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 06 Apr 2017 13:00:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:18:\"WordPress database\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://semperplugins.com/?p=3225/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:422:\"Is your WordPress database a mess? Have you been complaining about it since time immemorial? Well, then your WordPress site might be as bloated as you were after that marvelous Thanksgiving dinner at your mom’s. If your site has been<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/how-to-clean-your-wordpress-database/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Derek Iwasiuk\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9209:\"<p><img class=\"size-full wp-image-3232 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database.jpg\" alt=\"\" width=\"850\" height=\"250\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database.jpg 850w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-768x226.jpg 768w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-450x132.jpg 450w, https://semperplugins.com/wp-content/uploads/2017/03/clean-up-your-wordpress-database-600x176.jpg 600w\" sizes=\"(max-width: 850px) 100vw, 850px\" /></p>\n<p>Is your WordPress database a mess? Have you been complaining about it since time immemorial? Well, then your WordPress site might be as bloated as you were after that marvelous Thanksgiving dinner at your mom’s. If your site has been live for a while now, <strong>chances are that its database has acquired quite a bit of garbage and is demanding a spring clean</strong>.</p>\n<p>The trick to maintaining a database is to clean it regularly to prevent the accumulation of unnecessary data. However, we are guessing that you have been skimping on the cleaning bit, which is why you are here today. Therefore, without wasting time, we will tell you how to clean up that database in a few easy steps.</p>\n<h2><strong>#1. Basic Ground Rules</strong></h2>\n<p>Before you take on the massive task of spring-cleaning, you must ensure that your valuables are safe and sound. Losing a single system file can mess up your website entirely and can cause you to lose thousands of dollars in revenue.</p>\n<p>So start by creating copies of important files and create a backup of your entire website. You should definitely<a href=\"https://ithemes.com/purchase/backupbuddy/\" target=\"_blank\" rel=\"noopener noreferrer\"> check out Backupbuddy from our friends at iThemes</a>. It&#8217;s a great plugin that allows you to schedule automatic full or database-only backups, and we highly recommend it.</p>\n<h2><strong>#2. Screen Through the Clutter</strong></h2>\n<p>Do you remember how yard sales used to work before Craigslist and eBay came along? Just like separating the valuables from trash, you need to pick out the plugins you use and the ones you don’t.</p>\n<p>You can easily get started by going through your complete list of plugins in your WordPress dashboard. Go to your admin panel and click on Plugins. Next, go to Installed Plugins and click on Inactive at the top of the screen.</p>\n<p>Eliminating unused plugins should easily free up a couple of bytes and is the first step towards cleaning up your WordPress database.</p>\n<h2><strong>#3. Time For a Purge </strong></h2>\n<p>This might sound very ominous (esp. to the ones familiar with the popular movie franchise), but it is the best way to free up space. After deleting all unused plugins you should start cleaning out post data.</p>\n<p>If you have been using WordPress from a while, you might not be as surprised to know that all your post data is being stored in your website database. You can find it all in the wp_postmeta table, and you can run this query to get rid of all superfluous data:</p>\n<blockquote><p>DELETE FROM wp_postmeta WHERE meta_key = &#8216;your-meta-key</p></blockquote>\n<p>Always remember to replace the last part with the value that has to be cleared out.</p>\n<h2>#4. <strong>Take Care of Spam</strong></h2>\n<p>Spam is no longer restricted to your inbox. If you look through your database carefully, you will find tons of spam comments as well. These include promotional features and unscrupulous backlinks that other sites use to eat their way into your SEO. Monitoring comments is an essential practice that is currently underrated.</p>\n<p>The easiest way to manage spam comments on your site is to execute this query:</p>\n<blockquote><p>DELETE FROM wp_comments WHERE comment_approved = &#8216;spam&#8217;;</p></blockquote>\n<p>If you are currently <a href=\"https://semperplugins.com/wordpress-multisite/\" target=\"_blank\" rel=\"noopener noreferrer\">using a multi-site installation of WordPress</a>, you may like to try the following query:</p>\n<blockquote><p>DELETE FROM wp_#_comments WHERE comment_approved = &#8216;spam&#8217;;</p></blockquote>\n<h2>#5. <strong>What About Comments Waiting on Moderation?</strong></h2>\n<p>As a WordPress website/blog admin, you have the power to delete all comments that are awaiting moderation. This eliminates the need of unnecessarily going through each and every spam comment that you haven’t yet moderated.</p>\n<p>Just a word of advice: go through the list once to approve all genuine comments before running this query:</p>\n<blockquote><p>DELETE FROM wp_comments WHERE comment_approved = &#8216;0&#8217;;</p></blockquote>\n<h2><strong>#6. Taking Care of Unused Tags</strong></h2>\n<p>This has happened to almost all of us. When we were new at blogging, we created a few hundred tags thinking we would use them from time to time. And now that we post regularly, we hardly ever change tags. We use the most common ones and stick to those.</p>\n<p>Don’t be surprised if you have completely forgotten about a score of tags that you exist on your website database (thanks to your wild imaginative powers). Fortunately, we have a query that will take care of all unused tags, but be sure to check the ones that you do use before running this query:</p>\n<blockquote><p>DELETE FROM wp_terms wt<br />\nINNER JOIN wp_term taxonomy wtt ON wt.term_id = wtt.term_id WHERE wtt.taxonomy = &#8216;post_tag&#8217; and wtt.count = 0;</p></blockquote>\n<p>Check out some of our earlier posts if you are unsure about <a href=\"https://semperplugins.com/categories-and-tags/\" target=\"_blank\" rel=\"noopener noreferrer\">the differences between categories &amp; tags and how to use them</a>.</p>\n<h2>#7. <strong>Bid Farewell to Pingbacks</strong></h2>\n<p>If you are currently using a setting that has turned off the option of accepting pingbacks, then you may want to use the following code. This will remove every pingback ever made to your website from your database.</p>\n<blockquote><p>DELETE FROM wp_comments WHERE comment_type = &#8216;pingback&#8217;;</p></blockquote>\n<p>Again, if you are currently <a href=\"https://semperplugins.com/wordpress-multisite/\" target=\"_blank\" rel=\"noopener noreferrer\">using a multisite installation</a>, you may try using the next one. just remember to replace # with your current site id.</p>\n<blockquote><p>DELETE FROM wp_#_comments WHERE comment_type = &#8216;pingback&#8217;;</p></blockquote>\n<h2><strong>#8. No more Post Revisions</strong></h2>\n<p>Post revisions are indeed necessary for blogs, but once you see the space they take up on your database, you won’t think twice about bidding them farewell. They grow fast and exponentially. You can clear them out at one go using the next query:</p>\n<blockquote><p>DELETE a, b, c FROM wp_posts a LEFT JOIN wp_term_relationships b ON (a.ID = b.object_id)<br />\nLEFT JOIN wp_postmeta c ON (a.ID = c.post_id) WHERE a.post_type = &#8216;revision&#8217;</p></blockquote>\n<p>You can even chose to disable all post revisions for your website using the following SQL code:</p>\n<blockquote><p>define(&#8216;WP_POST_REVISIONS&#8217;), false);</p></blockquote>\n<h2>#9. Getting Rid of Trackbacks</h2>\n<p>Your final step should be getting rid of all old trackbacks. To make sure that nothing goes wrong, double check so that all your pingbacks and trackbacks have been disabled before trying the next SQL code:</p>\n<blockquote><p>DELETE FROM wp_comments WHERE comment_type = &#8216;trackback&#8217;;</p></blockquote>\n<p>For multisite users, the next query should be more profitable. You can use this one to clean out all your trackbacks at one go. Like previous ones, replace # with your current site ID to remove all of your site&#8217;s trackbacks.</p>\n<blockquote><p>DELETE FROM wp_#_comments WHERE comment_type = &#8216;trackback&#8217;;</p></blockquote>\n<p>Besides these, you can also scrap your old posts once your audience has fallen out of love with them. This might be difficult at first, but many old posts are nothing but unwarranted burden for WordPress databases.</p>\n<p>If you are new and quite lost with the new set of codes, queries and rules we were talking about right here, leave your maintenance <a href=\"https://wordpress.org/plugins/wp-optimize/\" target=\"_blank\" rel=\"noopener noreferrer\">to seasoned plugins like Optimize</a>. They work great with multisite installations as well, and include extensive options for managing and removing unused tables.</p>\n<p>This article has been written by Derek Iwasiuk from <a href=\"https://engagethecrowd.com/minneapolis-seo-services/\" target=\"_blank\" rel=\"noopener noreferrer\">www.engagethecrowd.com</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://semperplugins.com/how-to-clean-your-wordpress-database/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"18\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"A Glance at the Past &amp; Future of Keyword Research\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://semperplugins.com/past-and-future-of-keyword-research/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://semperplugins.com/past-and-future-of-keyword-research/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 07 Mar 2017 11:27:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"keyword research\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:15:\"semantic search\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"user intent\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://semperplugins.com/?p=3155/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:424:\"While getting started on a brand new SEO campaign, often the first thing you would be doing is keyword research. It is supposed to provide the much-needed skeletal framework for your campaign and has proven to be a vital technique for a<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/past-and-future-of-keyword-research/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Walter Moore\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5164:\"<p><img class=\"size-full wp-image-3159 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO.jpg\" alt=\"\" width=\"850\" height=\"250\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO.jpg 850w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-768x226.jpg 768w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-450x132.jpg 450w, https://semperplugins.com/wp-content/uploads/2017/03/850x250-Predicting-the-Future-of-Keyword-Research-its-Relevance-for-SEO-600x176.jpg 600w\" sizes=\"(max-width: 850px) 100vw, 850px\" /></p>\n<p>While getting started on a brand new SEO campaign, often the first thing you would be doing is keyword research. It is supposed to provide the much-needed skeletal framework for your campaign and has proven to be a vital technique for a long time now. However, during the last few years, keyword research has changed dramatically, it has experienced fascinating evolutions and has somewhat become less relevant in more ways than one.</p>\n<h2><strong>Why Is Keyword Research Important?</strong></h2>\n<p>Keyword research is essential to ensure that your content satisfies inbound visitors and that all incoming queries are directly related to your business.</p>\n<p>You can find out which queries offer low competition, allowing you to selectively target vital keywords and phrases to include in your site’s content. Identifying keywords and keeping track of them serves as an important metric that you can utilize to gauge your campaign’s effectiveness, by keeping track of rankings over a period of time.</p>\n<h2><strong>Back In Time</strong></h2>\n<p>In the past, SEO seemed to be really simple. You stuffed your keywords all over your page&#8217;s content, into each and every meta tag, and prayed for the best.</p>\n<p>With the help of Google Analytics, Google offered lots of data about how individuals were searching, and exactly how they came across your site through keywords. Moreover, once you had access to a list of keywords which ensured low competition but high traffic, you could at once start optimizing your content to target those queries.</p>\n<p>Most Google searches would feature one-to-one relationships. During those days, Google would take your words and find near exact matches on the web.</p>\n<h2><strong>What&#8217;s that, Hummingbird?</strong></h2>\n<p>In 2013, Google launched its Hummingbird algorithm update.</p>\n<p>This update presented a whole new concept called &#8216;semantic search&#8217; that revolutionized the way Google handles queries. Instead of taking the user’s words and looking for appropriate matches online, Google evaluates the intention that is behind a user’s query and then determines which content is relevant.</p>\n<p>Even though it looks like an insignificant difference, in reality, it has a great impact on the way we should perceive keywords. The faster that semantic search evolved, the more power that individual keywords lost, giving way to long-tail keywords and topical themes.</p>\n<h2><strong>Forecasting the Future</strong></h2>\n<p><a href=\"https://semperplugins.com/keyword-research-trends-that-matter-in-2017/\">In our recent post on keyword research trends</a>, we discussed how new technologies drastically impact the manner in which searches are conducted. Digital assistants such as Cortana and Siri are motivating users to perform searches through speech and are fundamentally changing the way queries are entered.</p>\n<p>Other innovations such as augmented reality, wearables, and virtual reality could be having the same and complementary effect, by compelling users to alter the manner in which they search. New kinds of interfaces and (even) smaller screens will soon be changing the way we interact with search engines.</p>\n<h2><strong>Conclusion</strong></h2>\n<p>Keyword research is bound to change and will not remain in its present form forever. We will be witnessing an iterative and gradual transition to a whole new search research system that is based specifically on the latest technologies and current search trends. You better prepare yourself mentally for a few drastic changes during the next decade.</p>\n<p>This article has been written by Walter Moore from <a href=\"https://www.gingerdomain.com/\">gingerdomain.com</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://semperplugins.com/past-and-future-of-keyword-research/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Keyword Research Trends That Matter In 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://semperplugins.com/keyword-research-trends-that-matter-in-2017/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://semperplugins.com/keyword-research-trends-that-matter-in-2017/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 03 Mar 2017 19:53:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"keyword research\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:8:\"SEO tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"user intent\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://semperplugins.com/?p=3006/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:448:\"Despite what you’ve been hearing, keyword research isn’t dead. Without keywords, there is no SEO… right? Let’s look at the facts. 93% of online experiences in 2016 started with a search, and search starts with words. Keywords will remain relevant<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/keyword-research-trends-that-matter-in-2017/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9335:\"<p><img class=\"size-full wp-image-3105 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017.jpg\" alt=\"\" width=\"851\" height=\"251\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017.jpg 851w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-768x227.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-848x250.jpg 848w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-450x133.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/12/keyword-analysis-in-2017-600x177.jpg 600w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p>Despite what you’ve been hearing, keyword research isn’t dead. Without keywords, there is no SEO… right? Let’s look at the facts.</p>\n<p>93% of online experiences in 2016 started with a search, and search starts with words. Keywords will remain relevant as long as people use words to interact with search engines. The only thing that has changed are the additional factors that have influenced how we use keywords for SEO.</p>\n<p>The truth is that search engines are no longer looking only at keywords, but also value many other factors. Keywords are now just a miniscule part of the pie. That is not to say that keyword discovery isn’t important. In fact, it is important in the way you go about it: <strong>we need to go levels deeper – to the precise level that users are searching for</strong>;<strong> </strong>and search engines are indexing for.</p>\n<p>This post will focus on the three main focuses of valuable keyword research in 2017:</p>\n<p>(1) user intent<br />\n(2) long-tail keywords<br />\n(3) Google voice search</p>\n<h2>User Intent</h2>\n<p>User intent is critical to keyword research and discovery in 2017. Marketers need to understand how to work together with search engines to provide the content users really want. After all, it’s not about attracting visitors to your site, but the right kind of visitors.</p>\n<p>So what exactly is user intent? User intent refers to &#8220;a user’s ultimate objective or goal&#8221; in making a search query. Every single search query has an intent, a goal, perhaps a problem the user wants to solve.</p>\n<p>For example, a search query of “Chicago to New York” gives me flight schedules. Adding “travel” to make it “Chicago to New York travel” does not only provide me with flight results, but bus and car information as well.</p>\n<p><strong>Adding one word to a search query greatly impacts the results of the search</strong> as Google automatically recognizes the change in intent. In fact, Google refines its algorithms 500-600 times a year to get user intent right. And if Google is focusing on it, so should you.</p>\n<p>You need to make user intent central to your keyword research. It is critical that you understand your user’s goals when they make search queries. This understanding or lack of it could make or break your organic traffic.</p>\n<p>The great thing is that user intent is pretty easy to figure out the longer the search query is. Long queries give us a lot of information on what a user exactly wants so we can give it to them. They also enable us to get targeted organic traffic for long-tail keywords. Speaking of which&#8230;</p>\n<h2>Long-Tail Keywords</h2>\n<p>I’m sure you’ve heard long-tail keywords uttered over and over again by marketers in 2016 (and even before). It looks like it’s set to dominate 2017 as well. I’m sure you’re already familiar with long-tail keywords, being that you’ve been focusing on them, but let’s cover the basics first before we delve into how to successfully incorporate it in your SEO strategy.</p>\n<p>What are long-tail keywords? Long-tail keywords are search terms with four or more words. <strong>In fact, 51% of all search queries in 2016 contained four or more words </strong>(<a href=\"http://www.wordstream.com/blog/ws/2015/10/06/smx-east\" target=\"_blank\" rel=\"noopener noreferrer\">source</a>).</p>\n<p>So where should you start off on finding relevant long-tail keywords for your business? Well, you need to first find actual terms that are being used in your specific industry or field.</p>\n<p>You don’t need to use the expensive keyword research tools to get a good list of long-tail keywords. There are some free keyword research tools that will give you a good list to start with. <a href=\"https://kwfinder.com/\" target=\"_blank\" rel=\"noopener noreferrer\">Keyword Finder</a> (suggests long-tail queries and search volumes but only allows a few daily searches) and <a href=\"http://www.keyword.io/\" target=\"_blank\" rel=\"noopener noreferrer\">Keyword.io</a> (suggest long-tail queries but does not provide search volumes) are free (but limited) tools you can start off with if you’re on a budget. And of course there&#8217;s always <a href=\"https://adwords.google.com/KeywordPlanner\" target=\"_blank\" rel=\"noopener noreferrer\">Google&#8217;s very own Keyword Planner that&#8217;s integrated into Adwords</a>.</p>\n<p>By far the best premium keyword research tool is <a href=\"https://moz.com/products/pro/keyword-explorer\" target=\"_blank\" rel=\"noopener noreferrer\">Moz Pro’s Keyword Explorer</a>. You start by searching your main keyword and it will return a comprehensive list of keywords that you can rank for relevancy and search volume. From there, you can go down the list and pick out the long-tail keyword phrases or search queries. The great thing about the Keyword Explorer is that you can click on any long-tail keyword to generate a new list of queries related to that keyword. The new list features more long-tail queries than the initial list.</p>\n<h2>Google’s Voice Search</h2>\n<p>Perhaps the most interesting development in keyword strategy is Google’s voice search and natural language capabilities. According to Google, 20% of mobile searches are now voice searches! This trend is quickly taking and has prompted Google to create answer boxes and Knowledge Graph panels. <a href=\"https://img.washingtonpost.com/blogs/the-switch/files/2014/10/Googlevoice.jpg\" target=\"_blank\" rel=\"noopener noreferrer\">Here you can also find a fun infograph</a> regarding the matter.</p>\n<p>Let’s take a look at how natural language, both spoken and typed, has changed search. For example, users, like you, used to search for “keyword research”, but now ask, “what is keyword research?” or “what is the most effective keyword research strategy?” You can see the change from keywords to long-tail keywords or queries. Voice search capability is quickening this development in SEO content marketing.</p>\n<div id=\"attachment_3108\" style=\"width: 600px\" class=\"wp-caption aligncenter\"><img class=\"size-full wp-image-3108\" src=\"https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries.png\" alt=\"Google voice queries are rising in popularity and will only continue to do so in 2017.\" width=\"590\" height=\"365\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries.png 590w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-300x186.png 300w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-404x250.png 404w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-100x62.png 100w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-150x93.png 150w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-200x124.png 200w, https://semperplugins.com/wp-content/uploads/2016/12/google-voice-queries-450x278.png 450w\" sizes=\"(max-width: 590px) 100vw, 590px\" /><p class=\"wp-caption-text\">Google voice queries are quickly rising in popularity and will only continue to do so in 2017.</p></div>\n<p>So how can you keep up with this development to plan an effective SEO content marketing strategy?</p>\n<p>(1) Look at the Frequently Asked Questions (FAQ) for your industry or brand and match this to your existing content. Do you have pages or posts that address those questions? If so, make sure that the questions are put forward in a very natural way and are highlighted on the page.</p>\n<p>(2) Create an FAQ page for questions that you can answer in a couple of paragraphs. Answer the questions in clear, concise and natural language.</p>\n<p>(3) Try and come up with long-form content for the questions by breaking them up into &#8220;What, when, why, how, who and where?&#8221; components. Create subheadings for each so that search engines can index them and users can easily find the content.</p>\n<h2>Wrapping Up</h2>\n<p>A good understanding and grasp of user intent, long-tail keywords and Google voice search will help you better refine your keyword, and overall SEO, strategy for 2017. Start to figure out what your audience really wants so you can begin communicating with them in the best way as soon as possible.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://semperplugins.com/keyword-research-trends-that-matter-in-2017/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"28\";s:7:\"attribs\";a:0:{}s:8:\"xml