f All<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/happy-9th-thank-a-plugin-developer-day/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Michael Torbert\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2487:\"<p>Happy 9th Plugin developer Day! Looking back, it&#8217;s been a wild ride. 9 years ago yesterday All in One SEO Pack hit <a href=\"https://semperfiwebdesign.com/blog/all-in-one-seo-pack-hits-one-million-downloads/\">1 million downloads</a>.</p>\n<p>Since then we&#8217;ve blown that away with over 30 million downloads, and the launch of <a href=\"https://semperplugins.com/all-in-one-seo-pack-pro-version/\">All in One SEO Pack Pro</a> here at semperplugins.com, and so much more.</p>\n<p>It&#8217;s amazing to think that when Matt Mullenweg <a href=\"https://wordpress.org/news/2009/01/thank-a-plugin-developer-day/\">first made the declaration</a> in 2009, we only had 4000 plugins in the directory, and an average of five per install.</p>\n<p>In order to celebrate Thank a Plugin Developer Day, please send a donation to or leave a 5 star rating for your favorite plugin. (You can <a href=\"https://wordpress.org/support/view/plugin-reviews/all-in-one-seo-pack?filter=5#postform\" target=\"_blank\">click here</a> to rate All in One SEO Pack 5 stars. [wink])</p>\n<p><a href=\"https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM.png\"><img class=\"alignnone wp-image-3078 size-medium\" src=\"https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-300x100.png\" width=\"300\" height=\"100\" srcset=\"https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-300x100.png 300w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-768x256.png 768w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-1024x341.png 1024w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-750x250.png 750w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-100x33.png 100w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-150x50.png 150w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-200x67.png 200w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-450x150.png 450w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-600x200.png 600w, https://semperplugins.com/wp-content/uploads/2017/01/Screen-Shot-2017-01-28-at-1.49.38-PM-900x300.png 900w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://semperplugins.com/happy-9th-thank-a-plugin-developer-day/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Could WordPress Multisite Be a Game Changer for You?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://semperplugins.com/wordpress-multisite/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://semperplugins.com/wordpress-multisite/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 13 Jan 2017 14:27:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:4:\"Blog\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:19:\"WordPress Multisite\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://semperplugins.com/?p=2359\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:419:\"Are you managing multiple WordPress sites? Yes? Did you know you could manage them all from a single dashboard? No? Well you can with WordPress Multisite. Multisite was introduced in 2010 but a surprising number of site administrators and users are<span class=\"ellipsis\">&#8230;</span><div class=\"read-more\"><a href=\"https://semperplugins.com/wordpress-multisite/\">Read more &#8250;</a></div><!-- end of .read-more -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Arnaud Broes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:15300:\"<p><img class=\"size-full wp-image-2975 aligncenter\" src=\"https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1.jpg\" alt=\"wordpress-multisite\" width=\"851\" height=\"251\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1.jpg 851w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-300x88.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-768x227.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-848x250.jpg 848w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-100x29.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-150x44.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-200x59.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-450x133.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/07/wordpress-multisite-1-600x177.jpg 600w\" sizes=\"(max-width: 851px) 100vw, 851px\" /></p>\n<p>Are you managing multiple WordPress sites? Yes? Did you know you could manage them all from a single dashboard? No? Well you can with WordPress Multisite.</p>\n<p><a href=\"https://codex.wordpress.org/Create_A_Network\" target=\"_blank\" rel=\"noopener noreferrer\">Multisite was introduced in 2010</a> but a surprising number of site administrators and users are still unfamiliar with it. This post will demystify WordPress Multisite to help you evaluate whether it is a good solution for your business; and show you how to install it.</p>\n<p>Let’s begin with the basics.</p>\n<h2>What is WordPress Multisite?</h2>\n<p>Multisite is a feature that enables you to create and manage multiple websites &amp; blogs from a single WordPress installation. That means that you can manage as many sites as you want from one Dashboard. Just one.</p>\n<h3>Important Features</h3>\n<ul>\n<li>It allows for a network of subdomains and directories</li>\n<li>You can enable other users to create accounts and WordPress blogs on your Multisite Network</li>\n<li>Super Admins can install themes and plugins for sites within their Multisite Network. However, site administrators on the network do not have that capability</li>\n<li>Super Admins can also make changes to themes for all websites on their Multisite Network while site administrators cannot</li>\n</ul>\n<p>Installing, managing and updating a Multisite Network is not as difficult as it sounds; in fact, the installation is almost similar to a standard WordPress installation. It also has the same core files, folder structure and code base as a standard WordPress site.</p>\n<p>Another great thing about WordPress Multisite is that all the themes and plugins on your network are stored once, regardless of how many sites are using them. That means that your server space would be smaller than if each site had its own WordPress installation.</p>\n<p>There are, however, a few differences between a Multisite and a standard installation: the admin screens and how they are used, the files, folders and the database tables. Let’s go over them.</p>\n<h3>Files and Folders</h3>\n<p>The wp-config.php file and the wp-uploads folder in a Multisite Network are a bit different from the ones in a standard WordPress installation.</p>\n<p>The <strong>wp-config.php</strong> file contains additional lines that activate Multisite and notify WordPress on how it functions or operates.</p>\n<p>The <strong>wp-uploads</strong> folder has a subfolder for each site on the network and the files of each site are stored in the site’s folder, as you normally would expect to see them in the wp-uploads folder of a standard WordPress installation.</p>\n<p>At the end of the day, these are differences you don’t need to concern yourself with – WordPress takes care of it for you!</p>\n<h3>Database</h3>\n<p>A standard WordPress installation has 11 database tables to store your site’s content and settings. Nine of those 11 tables are duplicated for each site on a Multisite Network. So the more sites you have, the more tables you’ll have.</p>\n<p>This is another difference you do not need to worry about.</p>\n<h2>Who Should Use It?</h2>\n<p>Multisite has quite a lot of benefits to it and can be extremely useful in certain cases while leading to administrative complication in others. So which cases is Multisite best for?</p>\n<p>WordPress Multisite is ideal for building a network of sites with analogous functionality; either via plugins, server settings or custom applications. It is also ideal for networks that use a limited number of themes for the whole network vs. enabling members of the network to use custom themes.</p>\n<p>If your network has a hugely diverse set of WordPress sites using various plugins, themes and other customizations, WordPress Multisite isn&#8217;t the solution you&#8217;re looking for.</p>\n<h3>Popular Sites Using WordPress Multisite</h3>\n<p><a href=\"https://www.wordpress.com/\" target=\"_blank\" rel=\"noopener noreferrer\">WordPress.com from Automattic is the ultimate example</a> of a Multisite Network. It hosts millions of sites and is free to use (premium themes and plugins are an additional cost).</p>\n<p>Universities are another good example of organizations that use Multisite Networks. They typically set up multiple sites on the network for various departments within the institution and for internal blogs.</p>\n<div id=\"attachment_3016\" style=\"width: 672px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-3016\" src=\"https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite.jpg\" alt=\"One of the nation’s largest and most respected newspapers uses WordPress Multisite to host its blogs.\" width=\"662\" height=\"365\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite.jpg 1007w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-300x165.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-768x423.jpg 768w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-454x250.jpg 454w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-100x55.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-150x83.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-200x110.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-450x248.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-600x331.jpg 600w, https://semperplugins.com/wp-content/uploads/2016/07/new-york-times-multisite-900x496.jpg 900w\" sizes=\"(max-width: 662px) 100vw, 662px\" /><p class=\"wp-caption-text\">One of the nation’s largest and most respected newspapers uses WordPress Multisite to host its blogs.</p></div>\n<p><a href=\"http://www.nytimes.com/interactive/blogs/directory.html#main\" target=\"_blank\" rel=\"noopener noreferrer\">The New York Times Blogs</a> is another good example. It’s a network of multiple blogs (about 60) that use a single WordPress Multisite installation.</p>\n<h2>How to Install WordPress Multisite</h2>\n<p>You only need two things to set up a Multisite Network:</p>\n<ul>\n<li>You need be an admin and have access to your server’s files; and</li>\n<li>Have permissions to make changes to the files and to create a directory</li>\n</ul>\n<p><strong>No knowledge of code is required.</strong></p>\n<p>If you&#8217;re looking to activate it on a new installation, you can just delete your data and re-install WordPress.</p>\n<p>Multisite can also be installed on your current WordPress installation. However, it does not use <a href=\"https://codex.wordpress.org/Using_Permalinks\" target=\"_blank\" rel=\"noopener noreferrer\">the default permalink structure</a> as WordPress needs to be able to assign correct names to sub-directories and sub-domains.</p>\n<p>Speaking of which, you need to decide whether you want to create files as sub-domains or sub-directories. This decision cannot be reversed in the future so choose carefully.</p>\n<ul>\n<li>The sub-domain structure is as follows: site1.mydomain.com, site2.mydomain.com, site3.mydomain.com, etc.</li>\n<li>The sub-folder structure is as follows: mydomain.com/site1, mydomain.com/site2, mydomain.com/site3 etc.</li>\n</ul>\n<p>Keep in mind that sub-directories cannot be created on an established site as it could interfere with active or already created URLs.</p>\n<p>You can also use domains like mydomain1.com, mydomain2.com, mydomain3.com, etc., but you need to utilize plugins and have some technical knowledge in order to do so.</p>\n<p>Let’s walk step-by-step through the installation.</p>\n<ol>\n<li><a href=\"https://codex.wordpress.org/Installing_WordPress\" target=\"_blank\" rel=\"noopener noreferrer\">Install WordPress the usual way</a>: download the ZIP file and install it on your server</li>\n<li>Locate the wp-config file (in the folder you installed WordPress)</li>\n<li>Find the phrase “/* That’s all, stop editing! Happy blogging. */” towards the bottom of the file</li>\n<li>Add a new line right above the phrase. Copy and paste the following code on the new line:</li>\n</ol>\n<p>/* Multisite */</p>\n<p>define( &#8216;WP_ALLOW_MULTISITE&#8217;, true );</p>\n<div id=\"attachment_3017\" style=\"width: 679px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-3017 size-full\" src=\"https://semperplugins.com/wp-content/uploads/2016/07/multisite-code.jpg\" alt=\"You can activate WordPress Multisite within a few clicks and adding one single line of code to your wp-config.php file. \" width=\"669\" height=\"327\" srcset=\"https://semperplugins.com/wp-content/uploads/2016/07/multisite-code.jpg 669w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-300x147.jpg 300w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-511x250.jpg 511w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-100x49.jpg 100w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-150x73.jpg 150w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-200x98.jpg 200w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-450x220.jpg 450w, https://semperplugins.com/wp-content/uploads/2016/07/multisite-code-600x293.jpg 600w\" sizes=\"(max-width: 669px) 100vw, 669px\" /><p class=\"wp-caption-text\">You can activate WordPress Multisite within a few clicks and adding a single line of code to your wp-config.php file.</p></div>\n<ol>\n<li>Save your wp-config.php file and reload the website</li>\n<li>Head to the WordPress admin dashboard and go to Tools &gt; Network Setup. You will be asked to choose between sub-domains or sub-directories. (Note: If you choose to use sub-domains, you need to confirm that your web hosting service provider allows sub-domains. They will need to create wild card DNS for your network)</li>\n<li>Update the title of your Multisite Network and the email address of the Network admin. You can leave everything as is if no changes need to be made</li>\n<li>Click the <strong>Install</strong> button. WordPress will generate a code to copy into your wp-config.php and .htaccess files</li>\n<li>You will be automatically directed to the Network Install screen. Paste the code as instructed</li>\n<li>Save the files</li>\n<li>Multisite will be successfully installed. You will need to log in again to access your Network Admin Dashboard</li>\n</ol>\n<p>Et voila! Your Multisite installation should now function like any standard WordPress site. You can start adding new sites, plugins, themes and other functionality onto the Network.</p>\n<p>You can <strong>follow the same steps above to convert your existing site</strong> into a Multisite Network. The only difference will be that you’ll be forced to use sub-domains if your site has been active for more than one month.</p>\n<h3>How to Add Sites on Your Multisite Network</h3>\n<p>Adding a site to your Multisite Network is a two-step process:</p>\n<ol>\n<li>Head to <strong>My Sites &gt; Network Admin &gt; Sites &gt; Add New</strong></li>\n<li>Add a site address, the site title, the email address of the site administrator and click <strong>Add New</strong></li>\n</ol>\n<p>The new site will be created. You can add as many sites as you want and see the list of sites by clicking on <strong>Sites &gt; All Sites</strong>.</p>\n<h3>How to Install and Activate Themes on Your Multisite Network</h3>\n<p>There are two ways to install and activate themes on your Multisite Network:</p>\n<ol>\n<li>You can install themes in the Network Admin to activate for the entire Network; or</li>\n<li>You can install them in Network Admin and activate it within a particular site</li>\n</ol>\n<p>To activate for the entire Network:</p>\n<ol>\n<li>Head to <strong>Themes &gt; Add New</strong></li>\n<li>Install the theme and click <strong>Network Enable</strong></li>\n</ol>\n<p>The theme will now be available to all sites in the Network.</p>\n<p>To activate for a specific site:</p>\n<ol>\n<li>Go to <strong>Sites</strong> and select the site that you want to enable the theme on</li>\n<li>Click <strong>Edit &gt; Themes</strong> and find the theme you want to activate</li>\n<li>Click <strong>Enable</strong></li>\n</ol>\n<p>When you go to the Themes tab in the site admin screen, you will see the new theme you enabled. The site can now choose to activate that theme.</p>\n<h3>How to Install and Activate Plugins on Your Multisite Network</h3>\n<p>To install and activate plugins on your Multisite Network:</p>\n<ol>\n<li>Download and install the plugin in the standard way: <strong>Plugins &gt; Add New</strong> (in the network admin screen)</li>\n<li>To activate the plugin for the entire Network, click <strong>Network Activate</strong> and the plugin will be activated on all sites on the Network</li>\n</ol>\n<p>To install and activate plugins on a specific site:</p>\n<ol>\n<li>Download and install the plugin in the standard way: <strong>Plugins &gt; Add New</strong> (in the network admin screen)</li>\n<li>Click on <strong>Return to Plugin Installer</strong></li>\n<li>Then go to the site admin screen for the site you want to activate the plugin on. Head over to <strong>Plugins</strong></li>\n<li>Locate the plugin you want to activate and click on <strong>Activate</strong></li>\n</ol>\n<p>Note that you cannot delete or update plugins from the site admin screen.</p>\n<p>That’s really all there is to installing WordPress Multisite, enabling features and adding functionality.</p>\n<h2>Conclusion</h2>\n<p>WordPress Multisite is a powerful and game changing tool for many businesses. That being said, it may not be the perfect solution for every business that thinks they need it. You need to carefully evaluate your needs to determine whether it’s the right fit for your business.</p>\n<p>If you do go ahead with installing it, keep in mind that management (beyond adding sites, activating themes and plugins) can get quite complex. Reversing a decision to separate sites and migrating a Multisite can cause major headaches. So again, carefully evaluate your need for it before activating it.</p>\n<p>Are you using WordPress Multisite? Or considering it? Share your experiences with us in the comments section.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://semperplugins.com/wordpress-multisite/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"11\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:31:\"https://semperplugins.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:18:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Fri, 23 Jun 2017 01:53:33 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:14:\"content-length\";s:5:\"28490\";s:7:\"expires\";s:29:\"Thu, 19 Nov 1981 08:52:00 GMT\";s:13:\"cache-control\";s:35:\"no-store, no-cache, must-revalidate\";s:6:\"pragma\";s:8:\"no-cache\";s:3:\"p3p\";s:69:\"CP=\"IDC DSP COR ADM DEVi TAIi PSA PSD IVAi IVDi CONi HIS OUR IND CNT\"\";s:12:\"x-robots-tag\";s:15:\"noindex, follow\";s:4:\"link\";s:62:\"<https://semperplugins.com/wp-json/>; rel=\"https://api.w.org/\"\";s:17:\"x-tec-api-version\";s:2:\"v1\";s:14:\"x-tec-api-root\";s:50:\"https://semperplugins.com/wp-json/tribe/events/v1/\";s:16:\"x-tec-api-origin\";s:25:\"https://semperplugins.com\";s:10:\"set-cookie\";a:5:{i:0;s:44:\"PHPSE