(3693, '_transient_feed_d117b5738fbd35bd8c0391cda1f2b5d9', 'a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: WordPress’ New Gutenberg Editor Now Available as a Plugin for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72098\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://wptavern.com/wordpress-new-gutenberg-editor-now-available-as-a-plugin-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9087:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/gutenberg.png?ssl=1\"><img /></a></p>\n<p>One of the featured sessions at WordCamp Europe 2017 was Om Malik&#8217;s interview with Matt Mullenweg, followed by a 20-minute Q&amp;A from the audience. After showing a preview of the new Gutenberg editor with dynamic blocks replacing widgets, Mullenweg announced that it is now <a href=\"https://wordpress.org/plugins/gutenberg/\" target=\"_blank\">available as a plugin on WordPress.org</a>.</p>\n<p>Gutenberg has been in development for six months and is ready for testing, but its developers do not recommend using it on production sites. Anyone interested in the future of WordPress will want to take it for a test drive, as the new editor will revolutionize the way users think about creating and editing content. The demo video at WordCamp Europe also showed Gutenberg working smoothly in a mobile context.</p>\n<p>At first glance, it may appear that WordPress is trying to copy its more recent competitors (Medium, Wix, and others) to keep pace, but the 14-year-old software has offered many of these content capabilities for years. Mullenweg explained how the new editor simply unifies the UI into blocks that can be placed anywhere. Gutenberg is set to replace widgets, the HTML UI of shortcodes, and blocks previously offered through the TinyMCE toolbar.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/gutenberg-blocks.png?ssl=1\"><img /></a></p>\n<p>&#8220;We&#8217;ve taken stabs at this before, if you imagine our previous efforts with post formats &#8211; to make it easier to do certain types of media or quote posts or things like that,&#8221; Mullenweg said. &#8220;That whole concept can now flatten to just being a block. Working all that in, it&#8217;s bringing things we&#8217;ve been thinking about for a very long time in WordPress.&#8221;</p>\n<p>If you&#8217;ve ever sat down with a new user to introduce them to WordPress, then you probably answered a long list of painful questions regarding the many varied and confusing ways of creating content. Gutenberg has the potential to make WordPress much easier to use.</p>\n<p>&#8220;Right now WordPress makes you learn a lot of concepts &#8211; shortcodes, widgets, the stuff that exists inside TinyMCE as blocks today &#8211; and people rightly wonder why they can&#8217;t use those things everywhere,&#8221; Mullenweg said. &#8220;What we&#8217;re trying to do is shift it so that you only have to learn about blocks once and once you learn about the image block, that can be in a post, in a sidebar, in a page, in a custom post type, and it will work exactly the same way. Whatever is integrated with it, let&#8217;s say a plugin that brings in your Google Photos or your Dropbox, that will now work everywhere, too.&#8221;</p>\n<p>Mullenweg said his previous attempt at replacing TinyMCE lasted approximately two years and they never ended up shipping it. Getting Gutenberg off the ground at this time allows WordPress to take the best of what competitors in both open source and commercial spaces have been doing, and improve upon it.</p>\n<p>&#8220;Medium started five or six years ago,&#8221; Mullenweg said. &#8220;Browser technology, what you can do, has advanced quite a bit. I think this actually allows us to leapfrog past some of the really great visual editors, because we&#8217;re able to build on the shoulders of things like Medium, Wix, Squarespace, and others that have come before us.&#8221;</p>\n<h3>Gutenberg First Impressions and Concerns</h3>\n<p>The Gutenberg plugin is now active on more than 300 sites and first impressions are rolling in. This is the first time the new block editor has been easily accessible to any user who wants to try it. Gutenberg also offers a somewhat unique testing experience in that it creates its own menu inside WordPress, so users don&#8217;t have to choose between the old editor and the new one. Activating Gutenberg doesn&#8217;t make it an either/or experience and users can test at their own convenience.</p>\n<p>From my initial testing, I found that Gutenberg provides a clean and enjoyable experience. Up until this point many of us couldn&#8217;t fully anticipate what Gutenberg would look like, but the interface is very similar to what one might imagine for an improved &#8220;distraction-free writing experience.&#8221; Gutenberg provides a more minimal UI for both the visual and text editors, although inserting blocks seems to be less functional when using the text editor.</p>\n<p>There are still many bugs and rough edges, but this interface appears to be a natural evolution of WordPress&#8217; content editing experience. It <em>feels</em> like WordPress. The editor pulls in many of the elements that have worked well historically and introduces a minimal UI that makes it possible for anyone to build a beautiful, feature-rich post without knowing any HTML. Gutenberg is the most exciting thing to happen to WordPress in a long time.</p>\n<p>&#8220;The default state is likely my favorite &#8216;Distraction Free Writing&#8217; implementation in WordPress yet,&#8221; WordPress core committer Aaron Jorbin said in <a href=\"https://daily.jorb.in/2017/06/random-thoughts-on-gutenberg/\" target=\"_blank\">a post listing his initial observations</a>.  I’m simultaneously able to focus on my content, and yet I have all the tools I need for writing. I don’t have all the tools I need for content creation.&#8221;</p>\n<p>Matt Cromwell, co-author of GiveWP, also wrote up his <a href=\"https://www.mattcromwell.com/gutenberg-first-impressions/\" target=\"_blank\">first impressions of Gutenberg</a> with high compliments for the new writing experience.</p>\n<p>&#8220;In recent years we’ve seen Medium become the de facto elegant writing experience,&#8221; Cromwell said. &#8220;Medium is able to do that though by limiting the formatting and layout options dramatically. Gutenberg has the potential to allow writing to be as elegant as Medium or more so, plus deliver far more flexibility with layouts and content types.&#8221;</p>\n<p>One area of uncertainty for WordPress developers is how Gutenberg will handle support for plugins and maintain a high level of performance with a large number of custom blocks added.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">I\'ll try again when it has support for plugins. I can\'t see this landing in core if it doesn\'t work with plugins.</p>\n<p>&mdash; Josh Pollock (@Josh412) <a href=\"https://twitter.com/Josh412/status/877913290063663109\">June 22, 2017</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">It *should* store the block data as JSON (or serialized object, IDC) into postmeta, but instead it uses regexp to parse HTML and queries DB.</p>\n<p>&mdash; Christian Nikkanen (@k1sul1) <a href=\"https://twitter.com/k1sul1/status/877945432889884672\">June 22, 2017</a></p></blockquote>\n<p></p>\n<p>&#8220;I miss a lot of the meta boxes I’m used to seeing on the screen,&#8221; Aaron Jorbin said. &#8220;Things like Yoast SEO (on some sites) and custom taxonomies are just not shown. If every metabox ever made for WordPress needs to be remade, it sure is going to make developers&#8217; lives a living hell.&#8221;</p>\n<p>Matt Cromwell also detailed a nightmare scenario of having more custom blocks than the current UI can handle.</p>\n<p>&#8220;What happens when you have 25 plugins that all want to load 25 custom blocks into that tiny &#8216;Insert&#8217; dropdown?&#8221; Cromwell said. &#8220;Will there be a search? Or will it just scroll forever?&#8221;</p>\n<p>Mullenweg specifically addressed some of these concerns in his Q&amp;A session at WordCamp Europe.</p>\n<p>&#8220;A lot of people have a lot of things built into the edit screen, so part of the reason we&#8217;re putting it out there as a plugin first and also pushing it so hard to get as many people to install it as possible, is so that everyone who has posting and editing screen adjustments can rethink them to be beautiful within this new framework,&#8221; Mullenweg said.</p>\n<p>Mullenweg anticipates that WordPress will release version 4.9 before merging Gutenberg, because he wants to see it tested on more than 100,000 sites before replacing the edit screen. If all goes well, the new editor could land in WordPress 5.0.</p>\n<p>&#8220;I think that some things that people did, like TinyMCE toolbar things, aren&#8217;t really needed any more,&#8221; Mullenweg said. &#8220;Stuff that people did in the past with custom post types might be better as blocks. It gives us a real opportunity to reimagine a lot of the user interactions and flows that today we&#8217;ve taken for granted on the edit screen for five or six years.&#8221;</p>\n<p>Check out Mullenweg&#8217;s WCEU 2017 interview below to see the live demo of Gutenberg and make sure to take a few minutes to <a href=\"https://wordpress.org/plugins/gutenberg/\" target=\"_blank\">install the plugin</a> to see it in action for yourself.</p>\n<p></p>\n<p></p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jun 2017 22:29:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"Post Status: The future of the WordPress economy, and why I’m not worried\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=37734\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://poststatus.com/future-wordpress-economy-im-not-worried/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13890:\"<p><em><strong>Editor&#8217;s Note</strong>: This is a guest post by Joshua Strebel, the CEO and co-founder of <a href=\"https://pagely.com\">Pagely</a>. Pagely was one of the first managed WordPress hosts and continues to be a market leader. Josh had some thoughts about the WordPress economy, which I asked him if he would share here for the Post Status audience. He&#8217;s been around for a while, and I think he&#8217;s got a pretty good hold on the state of things. I hope you enjoy his commentary. And if you like this post, you&#8217;ll also enjoy <a href=\"https://poststatus.com/publish\">Post Status Publish</a>.</em></p>\n<hr />\n<p>There’s been some <a href=\"http://chrislema.com/wordpress-economy-shrinking/\">recent speculation</a> on whether or not the WordPress economy is beginning to slump. I would answer &#8216;yes&#8217; and &#8216;no&#8217;; it <em>is</em> clearly evolving, and some areas are contracting while others are growing. I believe we are feeling the effects of<strong> </strong><b>market maturity</b>.</p>\n<p>Are downmarket “one stop shop” alternatives and in house teams the best solution for the future of WordPress? No, because hosting providers, developers, and agencies who specialize in this space are where the concentrated real quality resides, and people are always willing to pay for quality. Ultimately WordPress has staying power because of its ecosystem, so let’s take stock of that.</p>\n<h2>The current state of the WordPress economy</h2>\n<p>In 2017 WordPress is used by major publishers, enterprise, <a href=\"https://pagely.com/solutions/universities/\">universities</a> and even custom SaaS applications. In fact the world’s leaders in business and marketing trends use WordPress (and aren’t necessarily leveraging in house teams to do so). To name a few:</p>\n<ul>\n<li><a href=\"https://newsroom.fb.com/\">Facebook Newsroom</a></li>\n<li><a href=\"http://www.gv.com/\">Google Ventures</a></li>\n<li><a href=\"https://www.mercedes-benz.com/en/\">Mercedes Benz</a></li>\n<li><a href=\"https://techcrunch.com/\">TechCrunch</a></li>\n<li><a href=\"https://www.bloomberg.com/professional/\">Bloomberg Professional</a></li>\n</ul>\n<p>WordPress powers an estimated <a href=\"https://wordpress.org/about/features/\">28% of all websites</a> which run the gamut of single contributor blogs and simple websites to applications and complex portals. That’s nearly 75 million websites built by anyone from a very beginner to an extremely advanced level of technical skill. It’s both easy to use and graceful in its complex abilities to do just about anything you would need a website to do.</p>\n<p>There’s also the community behind WordPress, an ecosystem in and of itself of people around the world with this one thing in common. As an <a href=\"https://pagely.com/blog/2017/05/citizen-guide-open-source-community/\">open source community</a>, our entire industry is plugged into every update. We can contribute to testing or code. We have all the power to make sure the WordPress economy stays strong and continues to grow.</p>\n<p>New businesses are constantly being formed around plugins, themes and services built specifically for WordPress, with no signs of stopping. In fact, we’ll continue to find more and more creators of WordPress specific companies, with full time jobs elsewhere, using this as an opportunity to contribute to the community.</p>\n<p class=\"lead txt-danger\">However, the near constant flow of new entries into an already saturated market is outstripping demand. The WordPress pie overall is still growing but not quick enough to absorb the new sellers entering into the lower third of the market. The new players are typically unable to challenge the dominant players for a significant market share, and the demands and needs of the customers are also moving up the value chain. Yes, some newcomers do disrupt the established WP players, but it is happening with less frequency and the barrier is ever higher.</p>\n<h2>Economies ebb &amp; flow: Apple and Airbnb (and WordPress)</h2>\n<p>The companies and brands that have changed the way people live experience low points. Just like the ones we’ve feared will appear in our own industry. But you know these companies well and they, and their economies, have persevered.</p>\n<p>Take the classic example, one of the greatest comeback stories of all time: Apple. Apple defied all odds and went from near bankruptcy to the powerhouse hardware leader it is today with over a billion iPhones currently in use. They lost Steve Jobs and many feared they would lose their focus and tumble downward. Instead they’re the <a href=\"http://appleinsider.com/articles/16/10/05/five-years-after-steve-jobs-an-apple-with-the-courage-to-say-no\">largest and most profitable</a> they’ve ever been. Walk down the streets of New York City or San Francisco and you’ll see brick and mortar shops dedicated to alt-genius-bar services and shattered screen replacement. The Apple economy is strong.</p>\n<p>Just like Apple, Airbnb almost flopped, but came out on top. It has an ecosystem of its own with tons of offshoot companies that support various aspects of the community, just like WordPress. After near failure Airbnb now supports a community of over 100 million and is valued at over $30 billion. They also face <a href=\"https://www.bloomberg.com/news/articles/2016-07-11/airbnb-faces-growing-pains-as-it-passes-100-million-users\">growing pains</a> and &#8212; at times &#8212; volatility, but companies like this that fundamentally change the way the world works aren’t going anywhere.</p>\n<p>WordPress itself isn’t in danger of a near flop, but these are valuable examples of economies that fared far worse, and still made it through.</p>\n<h2>The core strengths of WordPress</h2>\n<p>WordPress possesses fundamental characteristics that so many of today’s great leaders encompass. All leaders like this are built to support a growing economy for a long time to come.</p>\n<h3>Brand</h3>\n<p>In Pagely&#8217;s own recent user survey, the most important factors for choosing a service were <strong>reliability </strong>and <strong>security</strong>. These are cornerstones of the WordPress brand <em>(haters gonna hate – but core has been really solid for many years in both respects)</em> and reasons why such a large percentage of the internet continues to choose it to power their websites. As a brand, WordPress is synonymous with being one of the most reliable and secure CMS options available. Quality service providers that support WordPress, like Pagely, also often encompass these brand characteristics. We often hear of these same characteristics as pain points from customers trying to work in-house or with downmarket alternatives.</p>\n<h3>Ubiquity</h3>\n<p>WordPress users span nearly every industry in the world. Publishers, Fortune 500 Companies, Music, Fashion, Tech, Politics, you name it. Like I mentioned above, ~75 million websites exist with WordPress and they are published in dozens of languages/locales. WordPress is literally a web that has woven itself through the digital and physical world.</p>\n<h3>Community</h3>\n<p>The WordPress community is made up of contributors, coders, engineers, designers, marketing professionals, and every other title necessary to run a business. The community reaches so far that it touches every corner of today’s tech workforce. Not only is the community large, but it cares. We care. The number of blogs and forums dedicated to helping people understand WordPress are impossible to count. Events like WordCamp, LoopConf, Publish, and PressNomics occur all year long and prominent core contributors participate. Don’t hate me for loosely quoting Lincoln. But, it could be said here that “[WordPress] of the people, by the people, for the people shall not perish from the earth.”</p>\n<h2>The WordPress ecosystem rewards quality</h2>\n<p>While the core strengths of WordPress support the service itself, quality is what supports the economy as a whole. And the fact remains that people <em>are</em> willing to pay for quality. To paint the picture, at Pagely a core aspect of our mission is to bring a flexible, friendly, and first-rate experience to all our customers. In staying true to that high standard of quality we’ve seen substantial <a href=\"https://pagely.com/blog/2017/01/pagely-2016-in-review/\">year over year revenue growth since 2014</a>. With an ecosystem that strives for and rewards quality, the larger WordPress economy is in a position to keep growing – continuing to take us along with it.</p>\n<p>Any ‘economy’ will ebb and flow but when a technology powers 28% of something, it has staying power; WordPress and the ecosystem we’ve built around it isn’t going anywhere, <strong>but it is changing</strong>.</p>\n<h2>The ecosystem is maturing — and growing</h2>\n<p>I would argue that after 12+ years the WordPress ecosystem has firmly moved from “<strong>New market</strong>” territory where there were wide open spaces for entrants to dominate. As an example, commercial themes really took off in 2008,  managed WordPress hosting came to prominence in 2010, and commercial plugins rose to fame in 2011. These, and most channels in the ecosystem are now clearly defined “<strong>Existing markets”</strong>.</p>\n<p>Since 2015 or so, the majors players in each category are known, with few exceptions of new entrants claiming significant market share. <strong>Those that are doing so are using <a href=\"https://www.marsdd.com/mars-library/the-four-types-of-market-market-maturity-where-does-your-startups-product-belong/\">strategies</a> common in existing markets: Resegmentation based on price, and resegmentation based on a niche strategy.</strong></p>\n<p>Borrowed from <a href=\"https://www.inc.com/karl-and-bill/6-signs-your-market-is-maturing.html\">this article</a>, we can identify six signs a market is maturing. Not every point applies completely to our ecosystem, but enough do I believe we can safely make this call.</p>\n<ol>\n<li class=\"mb-1\">Customer needs/desires do not appear to be evolving rapidly.<br />\n– <small class=\"txt-danger\">eCommerce and membership sites are the most recent ‘asks’ that come to mind, and that was a few years ago.</small></li>\n<li class=\"mb-1\">Consolidation by leading competitors is reducing competitive intensity.<br />\n– <small class=\"txt-danger\">GoDaddy, EIG, Envato, and Automattic are rapidly consolidating products and services into their domain</small>.</li>\n<li class=\"mb-1\">Disruptive innovations and new entrants are gaining share only gradually and top out at relatively low levels.<br />\n– <small class=\"txt-danger\">Some really innovative things are happening, but around the corners and seem slow to pick up traction.</small></li>\n<li class=\"mb-1\">Market shares of leading competitors have solidified and are changing gradually, if at all.<br />\n– <small class=\"txt-danger\">We pretty much know who the leaders are in every category and at what price points they own.</small></li>\n<li class=\"mb-1\">Price, brand and/or channel strategy has supplanted product innovation as key value drivers.<br />\n– <small class=\"txt-danger\">Refining the value proposition to our customers has greater focus at Pagely vs. shipping the latest tech du jour (which is happening just behind the scenes at measured pace).</small></li>\n<li class=\"mb-1\">Cash flows are increasingly turning positive and being returned to investors rather than invested into the market.<br />\n– <small class=\"txt-danger\">Not in all cases, there is still much energy being focused into market expansion.</small></li>\n</ol>\n<span class=\"pullquote alignright\">The pie is still growing overall, but a higher % of that growth is being concentrated among the established leaders that do more than the basics.</span>\n<p>The massive low-cost hosting providers are enrolling many thousands of new WordPress users a day. Their product offering is good enough for the price point, their marketing spends are huge, and any new customer starting to use WordPress is landing there.</p>\n<p>It is the same with eCommerce on WordPress — there are just two or three plugins and services absorbing new users.</p>\n<p>In the agency space, the buyers willing to spend capital (enough to sustain a high-end WordPress agency) on WordPress solutions are not buying $500 websites, or $5,000 websites as they once were. They are buying $50K-$1M custom-built WordPress backed applications. The resources and talent required to serve these clients is concentrated at a handful of established and well known shops.</p>\n<p>These examples continue into every segment of the ecosystem.</p>\n<p>WordPress is getting easier and easier to use right out of the box. And if the majority of the new WordPress users needs are solved on install (via core, bundled plugins, or the hosting platform) then a wide swath of the current ecosystem is going to shrink.</p>\n<p><strong>In all channels, new market entrants or existing small shops are being out-gunned by the established players, or the buyers needs are being met upon install.</strong></p>\n<h2>Adapt to win</h2>\n<p>So is the WordPress ecosystem shrinking? <strong>Yes, segments of it are and will continue to do so</strong>.</p>\n<p>It’s like in any industry: the car replaced the horse and the robot replaced the factory worker. What was successful in the New Market phase may not work in the more mature, Existing Market phase we are in.</p>\n<p><strong> Other segments, many not even identified yet, will expand.</strong> There are still big challenges that need to be solved in WordPress, the solutions for which will surely prove to be innovative and profitable. <a href=\"https://www.amazon.com/Blue-Ocean-Strategy-Expanded-Uncontested/dp/1625274491\">Go find the next blue ocean</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jun 2017 22:00:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Joshua Strebel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:112:\"WPTavern: WordPress Marketing Team Launches Case Studies and Usage Survey for Agencies, Clients, and Enterprises\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71973\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://wptavern.com/wordpress-marketing-team-launches-case-studies-and-usage-survey-for-agencies-clients-and-enterprises\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5563:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2015/06/survey.jpg?ssl=1\"><img /></a>photo credit: <a href=\"https://stocksnap.io/photo/FI3UYVGNFD\">Lukasz Kowalewski</a>\n<p>WordPress&#8217; Marketing Team has <a href=\"https://make.wordpress.org/marketing/2017/06/15/wordpress-case-studies-and-usage-survey/\" target=\"_blank\">launched a set of surveys</a> to gather case studies and usage data from agencies, clients, and enterprises, with the goal of providing more resources for adoption. The Usage Survey was created to capture feedback on the factors that influenced an organization to select WordPress as well as any barriers to using the software. The team plans to use use the data to provide resources, such as fact sheets, FAQs, case studies, testimonial videos, and other marketing materials.</p>\n<p>During the <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\" target=\"_blank\">State of the Word address in 2016</a>, Matt Mullenweg said the project could no longer get by on &#8220;marketing happenstance&#8221; but needed to form a more coordinated effort to counter the millions of dollars that proprietary systems are spending marketing their products against WordPress. These research surveys are one of the first steps in that direction, along with the <a href=\"https://wptavern.com/matt-mullenweg-proposes-wordpress-growth-council\" target=\"_blank\">WordPress Growth Council</a> that Mullenweg formed to bring together more people with large-scale marketing expertise.</p>\n<p>With the proliferation of user-friendly, DIY commercial website solutions, WordPress has reached a critical time where the project needs to shed its image as a clunky, legacy CMS and demonstrate why it&#8217;s the market leader. This not only requires WordPress to deliver from a technical standpoint, especially in the areas of editing and customization, but also requires the 14-year-old project to step up its marketing efforts.</p>\n<p>WordPress&#8217; Marketing Team exists to &#8220;help people market WordPress as open source software and the WordPress community.&#8221; The need is evident, as even the most experienced WordPress professionals struggle to properly articulate the difference between WordPress.com and the self-hosted software in a way that newcomers can understand. This is an intractable marketing problem for the self-hosted community.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Explain to me in two paragraphs or less the delineation between <a href=\"https://t.co/shm7MBBfUi\">https://t.co/shm7MBBfUi</a>, Jetpack, and <a href=\"https://t.co/w3VOMjx5s9\">https://t.co/w3VOMjx5s9</a>.</p>\n<p>&mdash; Ryan D. Sullivan (@ryandonsullivan) <a href=\"https://twitter.com/ryandonsullivan/status/877350749792903168\">June 21, 2017</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">WordPress(dot)org has lost the branding battle with WordPress(dot)com.</p>\n<p>&mdash; Drew Jaynes (@DrewAPicture) <a href=\"https://twitter.com/DrewAPicture/status/877649047456231424\">June 21, 2017</a></p></blockquote>\n<p></p>\n<p>David Skarjune, a contributor on the Marketing Team who helped put the surveys together, <a href=\"https://wordimage.com/articles/marketing-wordpress-as-free-software/\" target=\"_blank\">describes the problem that WordPress professionals face in marketing the free software</a>:</p>\n<blockquote><p>Here we have the classic WordPress.COM and WordPress.ORG duo that encompasses the nature of the WordPress free software system. This twosome drives the project and sometimes it drives us crazy—only because it instills wide-eyed confusion trying to explain these companion entities to the rest of the world. Simple enough: get a free blog at .COM or get free software and help at .ORG. However, free software makes no sense to the average person, and too many writers, marketers, and designers don’t much care how the InterWebs actually operate.</p></blockquote>\n<p>The confusion between WordPress.com and self-hosted WordPress is just one of the many factors that make the software a unique marketing challenge. <a href=\"http://devwp.eu/\" target=\"_blank\">Mario Peshev</a>, CEO of <a href=\"http://devrix.com\" target=\"_blank\">DevriX</a>, identified many more <a href=\"http://devwp.eu/15-obstacles-enterprises-report-wordpress-development-partners/\" target=\"_blank\">obstacles that enterprises find in using WordPress</a>. Several of these include misconceptions about security, scaling, and limitations for functionality beyond blogging. WordPress&#8217; Marketing Team aims to provide agencies with free resources to combat common misconceptions and show real-world examples of where the software is quietly powering enterprise websites behind the scenes.</p>\n<p>If you have an interesting example of how WordPress solved a client&#8217;s needs, feel free to <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSe9cYQRDtJCcI1nphPTfO_Lb7qAGJP68l0_ceyj0uMNzOwI2g/viewform?usp=sf_link\" target=\"_blank\">submit a case study</a>. If you represent an organization that is using WordPress and can offer feedback on why you selected it and any obstacles you continue to face, please take the <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSf--7zTsKrE7nRSMWoCXnYWJQxDD9GjttKsqoPUJ-kuM9XjkA/viewform?usp=sf_link\" target=\"_blank\">WordPress Usage Survey</a>. Both surveys will be open through July 14, 2017, and the results will be published on WordPress.org.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jun 2017 04:33:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"WPTavern: WPShout Updates and Acquires WPHierarchy.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72233\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wptavern.com/wpshout-updates-and-acquires-wphierarchy-com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1423:\"<p><a href=\"http://wphierarchy.com/\">WPHierarchy.com</a> is a WordPress resource <a href=\"https://wptavern.com/pretty-wordpress-template-hierarchy-diagram\">created</a> by Rami Abraham in 2013. The site is an interactive version of <a href=\"http://wpdaily.co/wp-template-hierarchy-chart/\">Michelle Schulp&#8217;s colorful diagram</a> of WordPress&#8217; template hierarchy. Each template is linked to documentation that explains its function.</p>\n<p>Over the years, WordPress&#8217; template hierarchy has changed. For instance, paged.php no longer comes after archive.php. The site however, hasn&#8217;t kept up with the changes.</p>\n<p>In an effort to keep the site going, updated, and maintained, WPShout has <a href=\"https://wpshout.com/links/wphierarchy-com/\">acquired the domain</a> from Abraham for an undisclosed amount. The team fixed the most of the obvious issues and the site is once again a valuable resource for visualizing the template hierarchy.</p>\n<p><img /></p>\n<p>David Hayes, of WPShout, says they&#8217;re working on collaborating with <a href=\"https://twitter.com/marktimemedia/\">Schulp</a> to visualize and better explain how Custom Templates can be applied to all post types.</p>\n<p>If you&#8217;d like to report an error or want to contribute, you can do so via the <a href=\"https://github.com/pressupinc/wphierarchy\">project&#8217;s Github page</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jun 2017 00:59:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: WPWeekly Episode 278 – Recap of WordCamp Europe 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=72367&preview=true&preview_id=72367\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wptavern.com/wpweekly-episode-278-recap-of-wordcamp-europe-2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2118:\"<p>In this episode, <a href=\"http://jjj.me/\">John James Jacoby</a> and I are joined by <a href=\"http://coachbirgit.de/\">Coach Birgit Olzem</a>, <a href=\"https://twitter.com/caroleolinger\">Carole Olinger</a>, <a href=\"https://arrowrootmedia.com/\">Jaki Levy</a>, and <a href=\"https://twitter.com/mcdwayne?lang=en\">Dwayne McDaniel</a> who attended <a href=\"https://2017.europe.wordcamp.org/\">WordCamp Europe</a> in Paris, France.</p>\n<p>We discuss contributor day and the effects of having it at the beginning of a WordCamp instead of at the end. Each individual shared their experience attending the event and described what their favorite session was.</p>\n<p>Lunch was provided at WordCamp Europe in paper bags with plastic utensils. With 1,900 attendees, this resulted in a lot of trash. We discussed the impact WordCamps can have on the environment and why larger WordPress events should act as a role model for being as sustainable as possible.</p>\n<p>We also talked about <a href=\"https://wordpress.org/plugins/gutenberg/\">Gutenberg</a>, the <a href=\"https://make.wordpress.org/marketing/\">WordPress marketing team&#8217;s efforts</a>, and the differences between WordCamp US and EU.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/woocommerce-drops-50-renewal-discount-on-subscriptions\">WooCommerce Drops 50% Renewal Discount on Subscriptions</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, June 28th 3:00 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #278:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jun 2017 00:12:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"HeroPress: Becoming Known in the WordPress Community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=1927\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:142:\"https://heropress.com/essays/becoming-known-wordpress-community/?utm_source=rss&utm_medium=rss&utm_campaign=becoming-known-wordpress-community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11929:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/06/062117-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: I was helping hundreds of people that were using WordPress for their business. That\'s powerful.\" /><h3>So you make websites, right?</h3>\n<p>My name’s Juan and I make websites. I’ve been doing that since my brother came home with a computer’s magazine that had a CD with a copy of Front Page 98. I learned about HTML. Tables. Marquees. Divs. CSS. Flash. ActionScript. JavaScript. PHP-Nuke. phpBB. Blogger. And, finally, in 2008, I learned about WordPress.</p>\n<p>I loved writing and enjoyed having my own blog after seeing that social networks like MySpace or Fotolog weren’t going too far. I kept learning and found the power of WordPress to create more complex sites. I decided that my hobby could be my job. I became a freelancer. I found clients, I made lots of mistakes, I didn’t make much money. I was alone in my small village in the North of Spain: Santoña, in Cantabria.</p>\n<p>I knew I wasn’t the only one creating websites around, but I never thought about meeting people like me. I didn’t know about the real power of Open Source. I was isolated, planning to move with my girlfriend to another city, Pontevedra, and I didn’t have a clue about what was going to happen soon in my life.</p>\n<h3>The power of WordCamps</h3>\n<p>One day I found out that in November of 2015 there was going to be a WordCamp in Santander, a city 50 km. far from my village. An event for WordPress developers and users. That sounded good. I had no idea that that kind of events were happening all around the world. I had no idea about anything related to the WordPress Community. I didn’t know that the Community was even a thing.</p>\n<p>So I went there a Saturday morning and attended to most of the talks.</p>\n<blockquote><p>I remember sitting in the last rows, as if I were hiding so no one would notice that I was there alone.</p></blockquote>\n<p>I didn’t want to say anything stupid and I was just absorbing all I could from the speakers and their presentations.</p>\n<p>After a great talk about theme development I waited for the speaker and I thanked him for all the info. I was nervous. He was a speaker. He was from another league, right? But he was a really nice guy, ‘if you have any doubt, just ask me’. Cool.</p>\n<p>On Sunday we had the Contributor’s Day. And there I was, randomly in the Community table, learning how to organize a Meetup with some people I had just met, Rocío Valdivia and Ibon Azkoitia. Remember these names. They told me that, as I was moving to another city where there wasn’t any WordPress group, I could start one myself.</p>\n<p>My brain: Wait a second. Me? Starting a WordPress Meetup in Pontevedra?</p>\n<p>I took notes and kept enjoying the day. I met many people and, being not very good remembering names, all I could do was following them on Twitter. And signing in the WP Slack channel.</p>\n<p>At the end of the event, Darío, the main organizer asked me about how was the experience. I had loved it. Will you come back? Yeah, but next year… as a speaker!</p>\n<p>My brain, again: As a speaker? Are you really listening to yourself? You hate speaking in public. You’re the most nervous person ever.</p>\n<h3>My first year in the Spanish WordPress Community</h3>\n<p>The days after the event were weird. I started reading about the people I met and I found out that some of them were incredible developers, some of them had thousands of followers in Twitter, some of them had the most important websites about WordPress in our language… And I didn’t have a clue about all that.</p>\n<p>Did it matter? Not at all. These people don’t care about those things and will help you no matter who you are or where you are coming from.</p>\n<p>Moving to a new place was a slow process, so I didn’t have to worry about the Meetup I promised to organize, but the weeks were running and I had no idea about what to talk about in the next WordCamp as I told Darío.</p>\n<p>I started to become a little more involved in the Community. I helped translating plugins to Spanish. The original translation of WooCommerce was made by a drunk robot or similar, so there were thousands of strings to be revised and translated again. It was fun. And a lot of work that I did with the help of Fernando Tellado, an experienced translator and member of the Community.</p>\n<blockquote><p>And I was helping hundreds of people that were using WordPress for their businesses. That’s powerful. I was helping many people.</p></blockquote>\n<p>By that time I was reading many WordPress related blogs and sites and I decided to curate a weekly post with the ten best links (in Spanish and English) I read every week. That’s how I started Enlace Permanente, which is almost now in its #70 edition with many subscribers to the newsletter and followers.</p>\n<p>I kept talking with Ibon, Darío and others in the Slack channels and on September of 2016 we decided to go to WordCamp Seville. I travelled the country from North to South and spent there a fantastic weekend. I shared an AirBnb apartment with Ibon, Mauricio Gelves and Fernan Díez, who became great friends. I met more new people and strengthened the relationship with ‘older’ mates.</p>\n<p>And, as I was finally moving to a new flat in Pontevedra, I decided it was time to start the local Community of the city. A city where I didn’t know any other developer or WordPress user. But… I was sure someone will be there.</p>\n<p>I had the help of Rocío, who works at Automattic and all her time is donated to the WordPress.org Community team, working at WordCamp Central helping Meetup and WordCamp organizers all around the world.</p>\n<blockquote><p>She was extremely helpful and she’s the reason that today in Spain we have more than 40 different Meetups and 5 WordCamps in 2017.</p></blockquote>\n<p>I planned the first event for the end of November, but before, I had to send an email to Darío as the Call for Speakers of WordCamp Santander 2016 was already open. I decided to talk about my experience the last year. ‘From being no one to being a speaker: a year in the Spanish WordPress Community’. That was the title of my talk.</p>\n<p>And yes, I was nervous. I didn’t sleep well the week before. I talked quickly. But I did it. People laughed, people clapped and people enjoyed my story. This story. And they learned about how they could help an awesome Open Source project like WordPress and meet great people at the same time.</p>\n<h3>Becoming a known member of the Community</h3>\n<p>When you become part of a Community for the first time, you easily find that there are small groups within the big one. People that already know each other of past events, of past projects. And maybe you think that it’s not easy to be part of those groups. Or that they won’t accept a new one.</p>\n<p>Well, that didn’t happen to me in the WordPress Community.</p>\n<p>Everyone was ready to say ‘hi’ to the latest addition. Everyone was ready to help with translation doubts. Everyone was ready to share their experience organizing local groups. Or answering questions in the support forums. Or just ready to chit chat. Or to organize a trip for the next WordCamp.</p>\n<p>So I just started doing the same.</p>\n<blockquote><p>And you don’t do it to become a known member of the Community. That’s just a catchy phrase for the post. You do it because it feels good.</p></blockquote>\n<p>Because you meet great developers, designers, freelancers… Because you can help anyone who knows a little less than you, the same way that the people that know more help you.</p>\n<p>In 2017 I was lucky enough to be part of WordCamp Madrid and WordCamp Bilbao, as a volunteer and as a speaker. I had the chance to talk about something that I’m really passionate in Madrid: the open web. I had the chance to speak up about net neutrality, about our contents, about walled gardens, about what we can do to save the web. I shared an important message with my peers.</p>\n<p>And in Bilbao I had the chance to explain the process of creating a WordPress theme from the moment the designer starts wireframing a project. My day to day job. Best practices, advice, tools, how-tos… I showed how I do my job to become better at it and to help others to become better too.</p>\n<p>Also in Pontevedra, we’re around 20-25 people every month in the local Meetup. And in Galicia, the region where I live, I’ve helped creating two more Meetup groups, in Ourense &amp; Lugo. And I’m sure there will be more soon! There are almost 3 million people here, so many WordPress users still to find!</p>\n<h3>And what now?</h3>\n<p>I want to keep having fun and working to make WordPress a better tool and platform for as many people as possible. I want to find more people in the local communities to show them what we have here. And who knows? Maybe organizing a WordCamp in 2018.</p>\n<p>Also, in the next months I would like to find out if it’s possible also to become a more active member of the Global WordPress Community. As English is not our first language and we’re a little shy, probably not many Spanish speakers are known in the WP world. But I’m sure that the steps I did to become part of our national group can be done exactly the same way to be part of the international one, don’t you think?</p>\n<p>So, who knows? Will I go to a WordCamp in the USA or another country next year… as a speaker?</p>\n<p>And you? Are you ready to become part of your local and national Community? It’s easier than you think, I’m sure of that. Just… say it out loud and start doing stuff.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Becoming Known in the WordPress Community\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Becoming%20Known%20in%20the%20WordPress%20Community&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Fbecoming-known-wordpress-community%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Becoming Known in the WordPress Community\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Fbecoming-known-wordpress-community%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Fbecoming-known-wordpress-community%2F&title=Becoming+Known+in+the+WordPress+Community\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Becoming Known in the WordPress Community\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/becoming-known-wordpress-community/&media=https://heropress.com/wp-content/uploads/2017/06/062117-150x150.jpg&description=Becoming Known in the WordPress Community\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Becoming Known in the WordPress Community\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/becoming-known-wordpress-community/\" title=\"Becoming Known in the WordPress Community\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/becoming-known-wordpress-community/\">Becoming Known in the WordPress Community</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Jun 2017 11:30:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Juan Hernando\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: WordCamp Europe 2018 to be Held in Belgrade, Serbia, June 14-16\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72113\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://wptavern.com/wordcamp-europe-2018-to-be-held-in-belgrade-serbia-june-14-16\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1938:\"<p>Belgrade, Serbia will host the sixth edition of WordCamp Europe, June 14-16, 2018. Prior host cities include Leiden, Sofia, Seville, Vienna, and Paris. Attendees and the massive 221-person volunteer crew gave their enthusiastic approval when organizers announced the event would be returning to Eastern Europe next year.</p>\n<blockquote class=\"instagram-media\">\n<div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BVcncQEhX_g/\" target=\"_blank\">WordCamp Europe 2018 will be in Belgrade, Serbia, June 14-16! &lt;3 #wceu</a></p>\n<p>A post shared by Sarah Gooding (@pollyplummer) on Jun 17, 2017 at 9:18am PDT</p>\n</div>\n</blockquote>\n<p></p>\n<p>The Serbian WordPress community has <a href=\"https://wptavern.com/a-glimpse-into-serbias-rapidly-growing-wordpress-community\" target=\"_blank\">grown exponentially since the first WordPress meetup</a> was held in 2013 at ManageWP&#8217;s offices. Now, Serbia hosts meetups in several cities and many of them are averaging more than 100 attendees. Meetup.com is not very popular in Serbia so the <a href=\"https://www.facebook.com/groups/613503768679500/\" target=\"_blank\">WP Serbia Facebook group</a> is used more frequently to organize community events. The group has grown from 600 members to more than 4,700 during over the past two and a half years.</p>\n<p>At WordCamp Europe I had the opportunity to interview Jenny Beaumont, this year&#8217;s local lead for Paris, along with Milan Ivanović who will lead the local team next year in Serbia. Beaumont shares the challenges of wrangling busy volunteers on the local team and offers Ivanović some advice as he prepares to head up the team in Serbia. Ivanović is eager to acquaint WordPress&#8217; global community with Serbia&#8217;s famous hospitality and sums up why prospective attendees should consider attending in 2018: &#8220;The food!&#8221;</p>\n<div class=\"embed-wrap\"></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Jun 2017 05:22:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: WooCommerce Drops 50% Renewal Discount on Subscriptions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72173\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://wptavern.com/woocommerce-drops-50-renewal-discount-on-subscriptions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2919:\"<p>Customers who purchased extensions from <a href=\"https://woocommerce.com/\">WooCommerce.com</a> are discovering that the renewal discount of 50% has been removed. Instead, they are now paying full-price.</p>\n<p>The <a href=\"https://woocommerce.com/blog/\">WooCommerce blog</a> and the official <a href=\"https://twitter.com/woocommerce\">Twitter account</a> do not mention anything about the price increase.</p>\n<p>We contacted Automattic and asked if the discount was removed and if customers received prior notice of the price increase. Todd Wilkens, head of WooCommerce, provided the Tavern with the following statement:</p>\n<blockquote><p>All customers receive notification of their upcoming renewal 7 or 15 days before a charge. If anyone received an incorrect price, please contact us immediately and we will make it right. As always, we are committed to making sure WooCommerce is affordable to the widest range of people while maintaining our high level of service and support.</p></blockquote>\n<p>A customer upset by the change contacted WooCommerce&#8217;s support desk and inquired about the price increase. The support representative confirmed that the discount was removed and that customers will need to pay full-price to renew.</p>\n<p>The customer service rep also explained that the change is due to WooCommerce moving to a straight renewal process, similar to other SaaS products. The representative concludes the ticket by saying they&#8217;re monitoring and accepting feedback about the change.</p>\n<img />WooCommerce Customer Support Response\n<p>Nathan Hadsall, who makes a living using WooCommerce, is among those upset by the change. &#8220;I have been a huge WooCommerce supporter and most of my work as a developer is spent working with WooCommerce,&#8221; Hadsall said.</p>\n<p>&#8220;However this type of approach to business is very sad. I have no problem paying for a license despite the fact that GPL software is available cheaper and legally/ethically by other means.</p>\n<p>&#8220;I will still stick to WooCommerce since the core is fantastic and is getting better. The biggest change for me will be the plugins and code I use to extend WooCommerce functionality. I will probably start to look elsewhere.</p>\n<p>&#8220;The biggest gripe I have is with the way WooCommerce does business. WooCommerce has never seemed to care about their customers. Slipping this pricing change in was not an honest move.&#8221;</p>\n<p>Raising prices for renewals is a part of business and something I think many customers expect at some point. However, raising prices on subscriptions that existing customers may have set to auto-renew, without explicitly notifying them about the change, can create a negative, lasting experience.</p>\n<p>If you purchased a subscription on WooCommerce.com and have set it to auto-renew, keep a close eye for your renewal notice.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Jun 2017 02:56:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: Disqus 3.0 Beta Improves Comment Syncing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72176\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://wptavern.com/disqus-3-0-beta-improves-comment-syncing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2195:\"<p>When <a href=\"https://wptavern.com/wpweekly-episode-269-interview-with-daniel-ha-ceo-and-co-founder-of-disqus\">we interviewed</a> Daniel Ha, CEO and co-founder of Disqus, earlier this year, he explained why some users were <a href=\"https://wptavern.com/wpweekly-episode-269-interview-with-daniel-ha-ceo-and-co-founder-of-disqus#comment-216978\">reporting problems</a> syncing comments between Disqus and WordPress and that improvements would be coming soon.</p>\n<p>&#8220;We may have taken some services offline to work on them which may have affected those who were trying to sync,&#8221; Ha said.</p>\n<p>Disqus <a href=\"https://blog.disqus.com/disqus-for-wordpress-3.0-plugin-beta-now-available-for-testing\">has released</a> 3.0 Beta 1 that fixes syncing issues and introduces a redesigned settings screen. Disqus 3.0 was rewritten to take advantage of newer APIs in WordPress which will allow for faster iterations of improvements.</p>\n<p>Comments are synced to the WordPress database using a webhook method instead of wp-cron making the process more reliable. This version also supports edited comments and comment states enabling users to see if comments are approved, pending, or deleted.</p>\n<img />Disqus 3.0 Settings Screen\n<p>Disqus 3.0 has a redesigned settings screen that includes shortcuts to frequently visited sections of Disqus&#8217; backend. Disqus replaces the Comments top-level menu item and shortcut links are now available in the WordPress Admin Bar.</p>\n<p>Other improvements to the plugin include:</p>\n<ul>\n<li>Replacing WordPress comments template with Disqus comments</li>\n<li>Replacing WordPress comment count with Disqus comment count</li>\n<li>Automatic closing of WordPress login window when using single sign-on</li>\n</ul>\n<p>The plugin is only available <a href=\"https://github.com/ryanvalentin/disqus-wordpress-plugin/releases/\">via Gitub</a> as the team seeks feedback to identify potential issues before rolling it out to the public. If you discover a bug, you can report it by <a href=\"https://github.com/ryanvalentin/disqus-wordpress-plugin/issues\">opening a new issue</a> on the project&#8217;s Github page.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 20 Jun 2017 07:28:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Matt: Peak Tea Demand\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://ma.tt/2017/06/peak-tea-demand/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://ma.tt/2017/06/peak-tea-demand/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:459:\"<p>I found this funny anecdote from <a href=\"https://www.cnet.com/news/tesla-is-changing-the-electric-grid/\">a CNET article about the future of power</a>: </p>\n<blockquote><p>Power and utility companies must exactly balance supply with what people consume at any given moment. UK grid operators famously must cope with a demand surge after the TV soap opera &#8220;EastEnders&#8221; ends, when thousands of people start boiling water for tea.</p></blockquote>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 18 Jun 2017 15:59:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WordCamp Europe 2017 Draws 1900 Attendees from 79 Countries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72127\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://wptavern.com/wordcamp-europe-2017-draws-1900-attendees-from-79-countries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5654:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/wordcamp-europe-2017-volunteers.jpg?ssl=1\"><img /></a>photo credit: WP Tavern\n<p><a href=\"https://2017.europe.wordcamp.org\" target=\"_blank\">WordCamp Europe</a> was held this weekend in Paris, bringing together 1,900 attendees from 79 countries. Another 1,000 people joined via livestream from 77 countries to make a total audience of 2,900 participants from 92 countries. The number of attendees on the ground was about one third less than original estimates of 3,000, but everyone who wanted a ticket was able to get one. A team of 221 volunteers communicated on Slack behind the scenes to make the event run as smoothly as possible.</p>\n<p>The event&#8217;s 45 organizers made the presentations more accessible to speakers of different languages with live captioning and real-time audio translation.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/live-captioning.jpg?ssl=1\"><img /></a>photo credit: WP Tavern\n<p>WordCamp Europe is the leading WordPress event for catching presentations about the ongoing efforts to bring the software to all the languages of the world. A large percentage of attendees were multi-lingual leaders in WordPress&#8217; translation community, resulting in many presentations and lightning talks focused on topics like communication, internationalization, organizing translation sprints, and using inclusive language for interfaces.</p>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/petya-wceu-2017.png?ssl=1\"><img /></a>photo credit: <a href=\"https://twitter.com/WCEurope/status/875616228714270726\">WordCamp Europe 2017 Photography Team</a>\n<p>Matt Mullenweg and Om Malik joined the event for a casual Q&amp;A session with attendees wherein Mullenweg showed a demo of the new Gutenberg editor and announced its availability as <a href=\"https://wordpress.org/plugins/gutenberg/\" target=\"_blank\">a plugin on WordPress.org</a>. We&#8217;ll cover their comments on the future of the editor and the open web more in-depth in another post.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/wceu-q-and-a-with-matt-and-om.jpg?ssl=1\"><img /></a></p>\n<p>This year&#8217;s WordCamp Europe sponsors had space for large 360° booths and the opportunity to be featured in 30-second advertisements between sessions. Organizers also arranged for sponsor workshops with a dedicated space for those who purchased the highest sponsorship levels. These workshops included topics like Creating a WordPress Theme for the Masses, Intro to WooCommerce, Jetpack tips, and hosting product demos.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/sponsors-wceu.jpg?ssl=1\"><img /></a>photo credit: WP Tavern\n<p>WordCamp Europe had no shortage of swag unique to the event, including a limited edition French plush Wapuu, posters, postcards, socks, stickers for European WordCamps, and other items for sale in the traveling Swag Store. A giant, stuffed French Wapuu made the rounds, appearing in pictures with attendees.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">The fun, family and Wapuu moment  <a href=\"https://twitter.com/WCEurope\">@WCEurope</a>! <a href=\"https://twitter.com/hashtag/getwapuu?src=hash\">#getwapuu</a> <a href=\"https://twitter.com/hashtag/WCEU?src=hash\">#WCEU</a> <a href=\"https://twitter.com/hashtag/wceu2017?src=hash\">#wceu2017</a> <a href=\"https://t.co/eykTMyuiC8\">pic.twitter.com/eykTMyuiC8</a></p>\n<p>&mdash; Anil Gupta (@guptaanilg) <a href=\"https://twitter.com/guptaanilg/status/875969553053962240\">June 17, 2017</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"hi\" dir=\"ltr\">Swag + Wapuu = ❤️ <a href=\"https://t.co/Lg5LGYeHmj\">pic.twitter.com/Lg5LGYeHmj</a></p>\n<p>&mdash; WordCamp Europe (@WCEurope) <a href=\"https://twitter.com/WCEurope/status/875721426753527808\">June 16, 2017</a></p></blockquote>\n<p></p>\n<p><a href=\"https://wptavern.com/wordcamp-europe-2017-kicks-off-with-contributor-day-focused-on-growing-wordpress-through-inclusion\" target=\"_blank\">Contributor Day</a> kicked off the event on Thursday with a strong turnout of 473 attendees. Traditionally, WordCamp contributor days are held on Sunday after the main event, the day following the after party when many who signed up struggle to make it on time &#8211; or at all. WordCamp Europe attendees generally appreciated having the contributor day scheduled before the main conference and the higher attendance numbers demonstrate the success of this arrangement.</p>\n<p>The after party featured a 1930&#8217;s theme at the Pavillon d’Armenonville. Attendees dressed the part and enjoyed a relaxing end to the WordCamp with an evening of dancing and meeting new and old friends.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Maybe the coolest guys at <a href=\"https://twitter.com/hashtag/WCEU?src=hash\">#WCEU</a> After-Party! ❤️<img src=\"https://s.w.org/images/core/emoji/2.3/72x72/1f44c.png\" alt=\"👌\" class=\"wp-smiley\" /><a href=\"https://twitter.com/schlessera\">@schlessera</a> <a href=\"https://twitter.com/glueckpress\">@glueckpress</a> <a href=\"https://t.co/p0xDyjyD9N\">pic.twitter.com/p0xDyjyD9N</a></p>\n<p>&mdash; Carole Olinger 🤘 (@CaroleOlinger) <a href=\"https://twitter.com/CaroleOlinger/status/876180870763294721\">June 17, 2017</a></p></blockquote>\n<p></p>\n<p>Organizers anticipate that videos of the presentations will be available next week. We will also be rolling out video interviews with interesting people from the European and global WordPress community in the coming days.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 18 Jun 2017 13:45:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: 10 Lessons Learned From Five Years of Selling WordPress Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72103\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://wptavern.com/10-lessons-learned-from-five-years-of-selling-wordpress-products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7934:\"<p><img />This post was contributed by <a href=\"https://www.rebeccagill.com/\">Rebecca Gill</a>. Rebecca is the founder of <a href=\"https://www.web-savvy-marketing.com/\">Web Savvy Marketing</a>, a web development, design, maintenance, and SEO consulting company based in Michigan and host of the <a href=\"https://www.seobits.fm/\">SEO Bits podcast</a>.</p>\n<p>Rebecca recently <a href=\"https://wptavern.com/9seeds-acquires-web-savvy-marketings-genesis-theme-store\">sold her Genesis Theme store to 9seeds</a>, a store she managed and maintained for five years. In this post, she shares ten lessons learned from selling WordPress products.</p>\n<hr />\n<p>When <a href=\"https://wanderingjon.com/\">Jon Brown</a> and I started talking about Web Savvy Marketing selling its theme store to 9seeds, it became abundantly clear that I wasn’t just selling him a portfolio of Genesis child themes. Anybody can do that. What I was really selling him was an established process and five long years of making mistakes and creating solutions.</p>\n<p>When I launched our theme store and stepped into the world of developing WordPress products, I was beyond naïve. I had no idea what I was getting myself into and I didn’t know how to run a successful e-commerce business.</p>\n<p>But after a lot of mistakes and course corrections, I found stability, a lot of great customers, and more revenue than I expected.</p>\n<p>Today, I&#8217;m sharing my top 10 lessons learned with you, so I can spare you from falling down the same rabbit holes and pitfalls.</p>\n<h2>My 10 Lessons Learned</h2>\n<h3>Reputation Is Everything</h3>\n<p>I didn’t set up out to create a strong reputation and I honestly didn’t know I was doing it. I was just following the rules given to me by my Grandmother and the basics of business I learned while working for my prior employers.</p>\n<p>What I realized was this – having a strong reputation helps you sell, but it also helps keep you out of hot water when things don’t go as you plan. People are more willing to buy from you, become your brand advocates, and forgive you when you make a mistake.</p>\n<h3>A Strong FAQ Page Is Worth Its Weight in Gold</h3>\n<p>I didn’t see this as a necessary page at first, but once I had the same question asked 100 times, I realized I needed to have an easily accessible page that answered common questions. Our comprehensive FAQ page has saved me time, but it also aided in sales. Visitors receive immediate answers to their questions and they are more inclined to hit the buy button while you still have their attention and interest.</p>\n<h3>Thorough Post-sale Communication Is a Requirement</h3>\n<p>During the first year of our store opening, I was flooded with post-sale emails and inquiries. No one was using our support forum and the option of self-service. I was so annoyed and frustrated it wasn’t even funny. And then something happened.</p>\n<p>I realized it wasn’t the buyers’ fault. I realized it was my fault. I had failed to communicate, provide next steps, and set expectations. Once I took ownership over this issue, I created a follow-up sequence that provided post-purchase instructions on where to go and what to do.</p>\n<p>A magical thing happened – or many things actually. I freed up my time because people stopped emailing me and I had happy customers who actually thanked me for all the great follow-up information. That was a win/win if there ever was one.</p>\n<h3>Email Templates Save Oodles of Time</h3>\n<p>Even with my stellar FAQ page and follow-up emails, I still received inquiries from people who asked similar questions. I learned to create email templates for anything I had to answer more than five times. This reduced my response time from five minutes to thirty seconds. This freed up my time and more importantly, it gave faster responses to my customers, so they were happy.</p>\n<h3>Create Systems to Save Sanity</h3>\n<p>I’m slightly <span class=\"st\">obsessive-compulsive</span> and I used this to our advantage with the theme store. I created project templates for any new theme launch and I mimicked the same type of tight structure I have with large custom website builds.</p>\n<p>We had a template full of to-do items, ownership of tasks, and expected turn around times. This made the design, coding, and launch of a theme very systematic. This in turn translated to faster product launches, fewer mistakes, and a reduction in development costs.</p>\n<h3>Strong SEO Is Your Friend</h3>\n<p>I could not have been successful without search engine optimization. I let SEO lead the way for what we would sell, who we would sell it to, and how we would market the final product. Strong SEO helped me select the right themes to develop, get quick sales, and cover my development costs within a few months of each launch.</p>\n<h3>Social Media Is a Time Suck but Worth Every Minute Invested</h3>\n<p>I have a love/hate relationship with social media. I hate that it takes so much time and it can be so emotionally draining. At the same time, I love that it helps you reach customers around the world and it supports the SEO process. Social media was a life raft in many ways and I don’t think the store or sales would have grown without it.</p>\n<h3>If Things Can Go Wrong, They Will Go Wrong</h3>\n<p>I have felt like this has been the norm for us this last year. Hosting, plugins, payment gateways, and third-party software sites have worn me out. And I’ve had a team to fix everything. You have to expect things to fail and you must have a plan to fix them quickly. It’s the nature of life and business. Learn to deal with issues quickly and to address one thing at a time.</p>\n<h3>Grace Goes a Long Way in Diffusing Bad Situations</h3>\n<p>No matter how hard you try and how hard you work, your customers will have bad days. When that happens you might receive the brunt of their emotions. This is called &#8216;transference&#8217; and in most cases it has nothing to do with you or your product.</p>\n<p>You have to recognize this for what it is and handle it with grace. Close your email, walk away from your desk, or do whatever you have to do to not reply in anger. Instead, you need to let the moment pass so you can reply calmly and with grace. In each situation where I&#8217;ve used this tactic, I’ve had the crazy person reply with an apology, tell me they were having a really bad day, and then thank me for keeping my calm.</p>\n<h3>People Will Steal Your Products, So Try Not to Take It Personally</h3>\n<p>People will steal your work and your products. You’ll find your premium digital products sitting for download on forums and it will break your heart. Don’t let it. Address the situation and move on. Don’t let someone else’s bad juju ruin your mood, day, or momentum. It won’t help the situation and it will drive you crazy if you let it.</p>\n<h2>In Hindsight</h2>\n<p>I loved launching and owning our theme store. I didn’t sell it because I hated it or because it wasn’t profitable. I sold it because it was no longer the best fit for our company and me personally, which meant it wasn’t going to service our customers as it should.</p>\n<p>If I had the opportunity to do things over, I would still launch and I’d follow the same path I did over the last five years.</p>\n<p>The theme store brought me some wonderful employees, great online friends, and it brought me deeper into the WordPress community.</p>\n<p>Selling the store was a hard decision, but the right one. In my heart, I knew I wanted to focus the company more on custom development and I wanted to spend more time with my SEO courses and my <a href=\"https://www.seobits.fm/\">new podcast</a>.</p>\n<p>If you’re new to WordPress products and you’re considering launching a new product offering, I encourage you to jump in. Learn from my mistakes, but hold on, because you’re in for a wild ride.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Jun 2017 22:36:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: 4.8 and What’s Coming\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=47440\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2017/06/4-8-and-whats-coming/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3844:\"<p>Last week <a href=\"https://wordpress.org/news/2017/06/evans/\">we released version 4.8 &#8220;Evans&#8221; of WordPress</a>, as I write this it has had about <a href=\"https://wordpress.org/download/counter/\">4.8 million downloads</a> already. The release was stable and has been received well, and we were able do the merge and beta <a href=\"https://make.wordpress.org/core/4-8/\">a bit faster</a> than we have before.</p>\n<p>When I <a href=\"https://make.wordpress.org/core/2017/01/04/focus-tech-and-design-leads/\">originally wrote about the three focuses for the year</a> (and in <a href=\"https://ma.tt/2016/12/state-of-the-word-2016/\">the State of the Word</a>) I said releases would be driven by improvements in those three areas, and people in particular are anticipating the new Gutenberg editor, so I wanted to talk a bit about what&#8217;s changed and what I&#8217;ve learned in the past few months that caused us to course correct and do an intermediate 4.8 release, and why there will likely be a 4.9 before Gutenberg comes in.</p>\n<p>Right now the vast majority of effort is <a href=\"https://github.com/WordPress/gutenberg\">going into the new editing experience</a>, and the progress has been great, but because we&#8217;re going to use the new editor as the basis for our new customization experience it means that the leads for the customization focus have to wait for Gutenberg to get a bit further along before we can build on that foundation. Mel and Weston took this as an opportunity to think about not just the &#8220;Customizer&#8221;, which is a screen and code base within WP, but really thinking in a user-centric way about what it means to customize a site and they identified a number of low-hanging fruits, areas like widgets where we could have a big user impact with relatively little effort.</p>\n<p>WordPress is littered with little inconsistencies and gaps in the user experience that aren&#8217;t hard to fix, but are hard to notice the 500th time you&#8217;re looking at a screen.</p>\n<p>I didn&#8217;t think we&#8217;d be able to sustain the effort on the editor and still do a meaningful user release in the meantime, but we did, and <a href=\"https://make.wordpress.org/core/2017/06/16/4-9-and-gutenberg/\">I think we can do it again</a>.</p>\n<p>4.8 also brought in a number of developer and accessibility improvements, including <a href=\"https://make.wordpress.org/core/2017/04/23/target-browser-coverage/\">dropping support for old IE versions</a>, but as I mentioned (too harshly) in my <a href=\"https://make.wordpress.org/core/2017/04/13/first-quarter-check-in/\">first quarter check-in</a> there hasn&#8217;t been as much happening on the REST API side of things, but after talking to some folks at WordCamp EU and the community summit before I&#8217;m optimistic about that improving. Something else I didn&#8217;t anticipate was <a href=\"https://make.wordpress.org/core/2016/12/28/supporting-the-future-of-wp-cli/\">wp-cli coming under the wing of WP.org as an official project</a>, which is huge for developers and people building on WP. (It&#8217;s worth mentioning <a href=\"https://github.com/wp-cli/restful\">wp-cli and REST API work great together</a>.)</p>\n<p>To summarize: The main focus of the editor is going great, customization has been getting improvements shipped to users, the wp-cli has become like the third focus, and I&#8217;m optimistic about REST-based development the remainder of the year.</p>\n<p>I&#8217;ll be <a href=\"https://2017.europe.wordcamp.org/session/interview-and-qa/\">on stage at WordCamp Europe in Paris tomorrow afternoon</a> doing a Q&amp;A with <a href=\"https://om.co/\">Om Malik</a> and taking audience questions, will also have a few announcements. You can get to the livestream tomorrow <a href=\"https://2017.europe.wordcamp.org/\">on the WordCamp EU homepage</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Jun 2017 13:33:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"WPTavern: WordCamp Europe 2017 Kicks Off with Contributor Day Focused on Growing WordPress through Inclusion\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72072\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://wptavern.com/wordcamp-europe-2017-kicks-off-with-contributor-day-focused-on-growing-wordpress-through-inclusion\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7321:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/wordcamp-europe-venue.jpg?ssl=1\"><img /></a>photo credit: WP Tavern\n<p>Hundreds of WordPress contributors gathered today with space for each team to have its own dedicated room. The Community Summit was held earlier in the week, lending a strong contingent of veteran contributors to this event, ready to use the short time they had together.</p>\n<p>With a high concentration of WordPress expertise gathered in Paris, WCEU organizers were able to include 13 talks and workshops aimed at enriching contributors. For an event that has always focused on serving diverse communities, it&#8217;s no surprise that many of the contributor projects were focused on growing and improving WordPress through accessibility, internationalization, documentation, and inclusion.</p>\n<h3>WP REST API Team is Writing Docs to Make the API More Approachable to New Users and Contributors</h3>\n<p>WP REST API project co-lead Ryan McCue said their team was concentrated on improving documentation to give developers a better understanding of the REST API infrastructure and how it integrates with the rest of WordPress.</p>\n<p>&#8220;The main thing we&#8217;re trying to work on is documentation for this sort of stuff, because we&#8217;re lacking a lot of documentation around the infrastructure,&#8221; McCue said. &#8220;One of the things we don&#8217;t do well is having a way to go from &#8216;I know nothing&#8217; to &#8216;I know this stuff.&#8217; A lot our documentation describes solutions without describing the problem and how you pick a solution.&#8221; Contributors are working on a new set of user guides, which are currently on <a href=\"https://github.com/WP-API\" target=\"_blank\">GitHub</a>, that will eventually be included in the developer handbook.</p>\n<p>McCue said the next major project is completing work on <a href=\"https://github.com/WP-API/OAuth2\" target=\"_blank\">OAuth 2</a>, the new authentication method that will allow users to authorize applications to access data on their sites. He anticipates the team will have a &#8220;very workable plugin&#8221; that could be ready for testing within the next six months.</p>\n<p>&#8220;We need to get this sorted if any of the mobile apps are going to use the REST API,&#8221; McCue said. These apps currently use the existing XML-RPC and WordPress.com APIs. Although OAuth hasn&#8217;t been a major focus so far this year, McCue said the team is looking at changing that going forward.</p>\n<h3>Documentation Team is Working Towards Making HelpHub the Go-To Resource for WordPress Support</h3>\n<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/wordcamp-europe-docs-team.png?ssl=1\"><img /></a>photo credit: WordCamp Europe 2017 Photography Team\n<p>Jon Ang, who helped lead the Documentation team, said they have been focused on writing documentation for new contributors, as well as ensuring current docs are gender neutral and not overly technical so that content writers can understand them.</p>\n<p>&#8220;Helping with the project has traditionally been tough, because we don&#8217;t explain how you can get started,&#8221; Ang said. &#8220;We realized this across the entire documentation team. We are great at writing end-user documentation but not great at writing contributor documentation.&#8221;</p>\n<p>One of the major documentation projects they have been working on for the past few years is <a href=\"https://make.wordpress.org/docs/tag/helphub/\" target=\"_blank\">HelpHub</a>, a companion resource to DevHub that will eventually hold all end-user documentation for WordPress. Migration from the codex is complete and the goal is to retire the codex once the project launches. Docs contributors are working towards making HelpHub the first place that users search for assistance before taking to the forums, lifting some of the burden from support volunteers. HelpHub is being designed to be easily searchable, possibly powered by elasticsearch, with inter-connected articles that focus on a single topic with bite-sized content.</p>\n<p>Ang estimates HelpHub is 30% complete in terms of content and 50% in terms of development. The backend is mostly finished and contributors are now working on the frontend. They are also bringing in content experts to write articles on critical topics, such as security. Ang hopes the team can deliver an MVP by the end of this year and finish the project within the next year.</p>\n<h3>Community Team is Working on Redesigning Central.WordCamp.org to be More Useful to the Wider WordPress Community</h3>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/wordcamp-europe-2017-community-team-contributors.png?ssl=1\"><img /></a>Community Team Contributors &#8211; photo credit: <a href=\"https://twitter.com/WCEurope/status/875328517000617984\">WordCamp Europe 2017 Photography Team</a>\n<p>A segment of Community Team contributors are working on marketing events better to the wider WordPress community that is not as well-connected with news about the project. As redesign of <a href=\"https://central.wordcamp.org/\" target=\"_blank\">central.wordcamp.org</a> is part of this effort.</p>\n<p>&#8220;Overall, the feeling is that we are not getting in front of the people who need our information the most,&#8221; Global Community Team member <a href=\"https://twitter.com/josephahaden\" target=\"_blank\">Josepha Hayden</a> said. &#8220;Most WordCamps are educational. There is an aspirational aspect to all of them, of course. But the people who could use the information the most are, for example, the people who inherited a WordPress site and don&#8217;t know what to do about that.&#8221;</p>\n<p>After reviewing Google Trends to see what people are actually looking for when they get to a WordCamp site, the Community Team found that most visitors are searching for a WordCamp and the year. The only reason they get to the site is because they already know the event is happening.</p>\n<p>&#8220;The deputies we&#8217;ve spoken to in the last year or so have been echoing this feedback that the problem our WordCamp organizers have is they don&#8217;t have any way to get the information out to attendees better,&#8221; Hayden said. &#8220;If you already know about WordCamps, it&#8217;s easy to find your local WordCamp but if you don&#8217;t, then it&#8217;s not.&#8221;</p>\n<p>The Community Team has begun working on a communication and marketing plan that may include things like automated emails or social media campaigns but their first priority is redesigning central.wordCamp.org.</p>\n<p>&#8220;We realized the first place we need to start is to have a canonical place for them to go,&#8221; Hayden said. &#8220;Central.WordCamp.org was always supposed to be that place but for awhile it had kind of a hybrid audience. We&#8217;re working on identifying the content, who the correct audience is, and what we&#8217;re missing if we want to help somebody who has never heard about any WordPress events.&#8221;</p>\n<p>The discussion around redesigning central.wordcamp.org discussion has been happening for a few years and the team already has a design that was donated. They have the homepage and several other pages complete and hope to have the new site launched by the end of the year.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Jun 2017 00:27:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Lifted, a WordPress Theme and Plugin Shop for the Marijuana Industry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=72027\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"https://wptavern.com/lifted-a-wordpress-theme-and-plugin-shop-for-the-marijuana-industry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4731:\"<p><a href=\"https://liftedthemes.com/\">Lifted</a> is a new WordPress theme and plugin company founded by <a href=\"http://baltimoredrew.com/\">Drew Poland</a> that caters to the marijuana industry. I reached out to Poland to learn more about his company, his pricing model, and get his perspective on this space in the WordPress ecosystem.</p>\n<p><strong>Why did you decide to get into the marijuana industry with WordPress plugins and themes?</strong></p>\n<p>Two primary reasons. The first is that, I truly believe in its medicinal use and there&#8217;s more than enough research out to support its effectiveness.</p>\n<p>Documentaries like <a href=\"http://www.cnn.com/specials/health/medical-marijuana/index.html\">Weed from CNN and Dr.Sanjay Gupta</a> will bring you to tears watching children like Charlotte Figi, who suffer from extreme epilepsy, almost instantly stop the seizures and become functional with the things most of us take for granted like talking and walking.</p>\n<p>It&#8217;s tough to watch at times but there are a lot of cases from the extreme ones like end of life and debilitating issues, to everyday pain, stress, and PTSD management that make it a valuable alternative to harder, more addictive prescription drugs like Opioids, that are most commonly thrown at these as a solution.</p>\n<p>The second reason is less inspiring. It&#8217;s simply a budding industry with massive room for growth. It&#8217;s really just now coming around and I think will accelerate as it matures and the path will become clearer in terms of what clients need and want. An entire new industry has opened.</p>\n<p><strong>What are some of the technologies used to power your themes?</strong></p>\n<p>Everything is built the WordPress way so everyday users can for the most part, activate a theme and go. For the most part, its page templates, widgets, and some custom fields. If a user is comfortable with those than they can easily use a theme from Lifted.</p>\n<p><strong>Are your themes and plugins GPL licensed or GPL compatible?</strong></p>\n<p>Absolutely! Everything is 100% GPL licensed.</p>\n<p><strong>How did you determine the price range for Grape Ape $129.99-$379.99 and can you provide an ETA on when it might be released? (I don&#8217;t think I&#8217;ve ever seen pre-orders for a theme before)</strong></p>\n<img />Front page of the Grape Ape Theme\n<p>I simply wanted to come in with a product priced on the higher end because I&#8217;m a firm believer that most WordPress products are priced entirely too low.</p>\n<p>I value my time on the highest level since I can&#8217;t make more of it, so a sell low and at volume approach just doesn&#8217;t work for me. I don&#8217;t want to support a $50 theme and the reality is that if this were a custom project for a client, the budget needs to be $10k minimum.</p>\n<p>The estimated release date for Grape Ape is the end of July.</p>\n<p>The pre-order was a result of simply wanting to force myself to get the actual Lifted Themes site up. Otherwise, I would have waited until Grape Ape was complete and then spent entirely too much time on the Lifted site.</p>\n<p>So I had to settle in with a good-looking theme I could live with and later work with my designer to develop something more custom. Had I really wanted to push the pre-order more I would have ramped up marketing months in advance to build up the anticipation and desire for it.</p>\n<p><strong>Based on your research, how crowded is this space when it comes to WordPress themes and plugins?</strong></p>\n<p>I would say it&#8217;s a clear lane and you can drive as fast or as slow as you like. I have been slow-moving up until this point and had the first marijuana plugin on WordPress.org, so there&#8217;s a lot of room.</p>\n<p>The marijuana industry is also not what I would call mature and at the end of the day there is still a stigma in professional settings. So if you are someone building products on the side or have a lot of clients in a specific industry that isn&#8217;t so receptive, you might not feel comfortable broadcasting that you are working in this space.</p>\n<p><strong>Are there any legalities customers should be aware of before using your products?</strong></p>\n<p>If used as intended, no. At its core, Grape Ape is fitted for your typical run of the mill business website, that&#8217;s no different from a coffee shop.</p>\n<p>At the moment, plugins are also in a clear zone. In the future, that may become more of a concern as services and tools are opening their APIs to connect dispensary back office systems with their web presence. That&#8217;s where things start to get tricky, more from a potential patient data view than anything else.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 15 Jun 2017 21:14:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: 9seeds Acquires Web Savvy Marketing’s Genesis Theme Store\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71955\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://wptavern.com/9seeds-acquires-web-savvy-marketings-genesis-theme-store\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3761:\"<p><a href=\"https://9seeds.com/\">9seeds</a>, a WordPress development agency <a href=\"https://9seeds.com/the-launch-of-9seeds/\">launched in 2009</a>, has <a href=\"https://9seeds.com/custom-wordpress-development-plugins-genesis-themes/\">acquired</a> Web Savvy Marketing&#8217;s <a href=\"https://www.web-savvy-marketing.com/store/\">theme store</a> for an undisclosed amount. <span class=\"st\">Web Savvy Marketing <a href=\"https://www.web-savvy-marketing.com/2012/03/genesis-child-theme-store/\">launched its theme store</a> in 2012 and currently has a library of 26 themes built on the <a href=\"https://my.studiopress.com/themes/genesis/\">Genesis Framework</a> by StudioPress. </span></p>\n<img />Web Savvy Marketing Theme Store\n<p><span class=\"st\">Chris Cree who helped launch and manage the theme store in 2012 departed from the company in 2016 and moved overseas to <a href=\"https://www.web-savvy-marketing.com/2016/07/saying-goodbye-to-chris-cree/\">create a bible school</a>. As the focus of Web Savvy Marketing shifted towards larger custom development projects and SEO, Rebbecca Gill, founder of Web Savvy Marketing, needed to find a way to <a href=\"https://www.web-savvy-marketing.com/2017/06/investment-strategy-wsm-selling-genesis-theme-store/\">maintain the theme store</a>. </span></p>\n<p>&#8220;I wanted Chris’ vision to live on and I wanted all my babies to continue to flourish and find their way to websites around the world,&#8221; Gill said. &#8220;I was at a crossroads and I didn’t know what to do.</p>\n<p>&#8220;I needed to make sure the company had a solid long-term strategy, but I also needed to protect our loyal theme customers. Five years of sales meant we had a lot of existing buyers who needed ongoing support.&#8221;</p>\n<p>Last year, Gill met Jon Brown, owner of 9seeds, and established a professional relationship.</p>\n<p>&#8220;We have very similar views on business, friendships, and ethics,&#8221; Gill said. &#8220;I liked him right away and I knew I wanted to spend more personal and professional time with him.</p>\n<p>&#8220;And as we grew closer, we started chatting about my struggles with the theme store and his long-term business goals. Before I knew it, he wanted to acquire the theme store and I wanted to give it to him.&#8221;</p>\n<p>9seeds has built a number of custom sites for clients using the Genesis Framework. For those who wanted to leverage existing themes, the company has often referred clients to Web Savvy Marketing&#8217;s theme store.</p>\n<p>&#8220;It took a bit more time of getting to know each other personally before I came to hold the same feelings that others had shared about her,&#8221; Brown said. &#8220;I felt deeply that this was a person I not only wanted to be friends with but wanted to be in business with. It became apparent to both of us that this was a perfect fit.&#8221;</p>\n<p>The acquisition brings the themes in-house and expands 9seeds reach into the WordPress products market.</p>\n<p>&#8220;It’s a win for 9seeds by giving us a springboard into a market we’ve long had our eye on accompanied by the best trail guide in the business showing us the path,&#8221; Brown said.</p>\n<p>&#8220;It’s a win for WSM by freeing Rebecca and her team up to align with where her focus now is on larger custom site builds and SEO consulting.&#8221;</p>\n<p>9seeds is providing support for existing customers and is working on a new theme. The support forums and theme store will migrate to the 9seeds domain later this year.</p>\n<p>To learn more about Brown and his work with 9seeds, <a href=\"https://wptavern.com/wpweekly-episode-276-interview-with-jon-brown-a-traveling-digital-nomad\">listen to episode 276</a> of WordPress Weekly.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 15 Jun 2017 19:18:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"Post Status: An entrepreneurial journey around eCommerce, with Patrick Rauland — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=37565\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://poststatus.com/entrepreneurial-journey-around-ecommerce-patrick-rauland-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2488:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by the creator and editor of Post Status, Brian Krogsgard, and this week&#8217;s guest host, Patrick Rauland.</p>\n<p>In this episode, Brian and Patrick Rauland discuss the state of eCommerce today, both from a product perspective, and for store owners. They also discuss Patrick’s own journeys in the land of eCommerce, as a former product manager for WooCommerce, a course author for Lynda (now LinkedIn Learning), a consultant, and an online eCommerce conference organizer.</p>\n<p><!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.com/72909.mp3\">https://audio.simplecast.com/72909.mp3</a><br />\n<a href=\"https://audio.simplecast.com/72909.mp3\">Direct Download</a></p>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://www.speakinginbytes.com/\">Patrick&#8217;s programming blog</a></li>\n<li><a href=\"https://www.liftoffsummit.com/\">Lift Off Summit</a></li>\n<li><a href=\"https://neversettle.it/projects/apis/ns-fba-for-woocommerce-premium-wordpress-plugins/\">Amazon FBA for WooCommerce</a></li>\n<li><a href=\"http://www.shipstation.com/\">ShipStation</a></li>\n<li><a href=\"https://www.stitchlabs.com/\">Stitch Labs</a></li>\n<li><a href=\"http://www.tropicalmba.com/\">Tropical MBA</a></li>\n<li><a href=\"https://wooconf.com/\">WooConf</a></li>\n<li><a href=\"http://www.ecommercefuel.com/\">eCommerceFuel</a></li>\n<li><a href=\"https://poststatus.com/publish/\">Post Status Publish</a></li>\n</ul>\n<p><a href=\"https://www.flickr.com/photos/46544223@N05/26247563071/in/photostream/\">Photo Credit</a></p>\n<h3>Sponsor: Pagely</h3>\n<p><a href=\"https://pagely.com\"><span>Pagely</span></a><span> offers best in class managed WordPress hosting, powered by the Amazon Cloud, the Internet’s most reliable infrastructure. Post Status is proudly hosted by Pagely. Thank you to </span><a href=\"https://pagely.com\"><span>Pagely</span></a><span> for being a Post Status partner.</span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 15 Jun 2017 01:30:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"WPTavern: WPWeekly Episode 277 – WordPress 4.8, Filing Good Bug Reports, and WP Super Cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=71968&preview=true&preview_id=71968\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wptavern.com/wpweekly-episode-277-wordpress-4-8-filing-good-bug-reports-and-wp-super-cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3427:\"<p>In this episode, <a href=\"https://jjj.blog/\">John James Jacoby</a> and I start off the show by sending Jesse Peterson our thoughts, prayers, and positive energy. Peterson is a longtime member of the WordPress community, founder of<a href=\"https://www.genesisthe.me/\"> Genesis The.me</a>, and is battling <a href=\"http://www.cffatboy.com/what-is-cystic-fibrosis/\">Cystic Fibrosis</a>. He received the call last Friday to receive a double-lung transplant but the surgery was cancelled after doctors determined the lungs were bad after removing them from the patient. We&#8217;re hoping he gets the call again soon!</p>\n<p>We give insight into what&#8217;s new in WordPress 4.8, provide tips for filing a good bug report, and tell you what to expect in the next major version of WP Super Cache. We discuss Imagely acquiring TeslaThemes and near the end of the show, we talk about the WordPress Community Summit at WordCamp Europe.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/wordpress-4-8-evans-released-featuring-nearby-wordpress-events-new-media-widgets-and-link-boundaries\">WordPress 4.8 “Evans” Released Featuring Nearby WordPress Events, New Media Widgets, and Link Boundaries</a><br />\n<a href=\"https://wptavern.com/harare-zimbabwe-to-host-its-2nd-wordcamp-november-4-2017\">Harare, Zimbabwe to Host Its 2nd WordCamp November 4, 2017</a><br />\n<a href=\"https://wptavern.com/major-update-coming-to-wp-super-cache-new-rest-api-user-friendly-settings-page-and-improvements-to-legacy-file-storage\">Major Update Coming to WP Super Cache: New REST API, User-Friendly Settings Page, and Improvements to Legacy File Storage</a><br />\n<a href=\"https://wptavern.com/imagely-acquires-teslathemes-is-seeking-other-acquisition-opportunities\">Imagely Acquires TeslaThemes, Is Seeking Other Acquisition Opportunities</a></p>\n<h2>Picks of the Week:</h2>\n<p><a href=\"https://wptestdrive.com/\">wpTestDrive</a> allows you to try commercial themes and plugins before purchasing them. wpTestDrive creates a new WordPress instance with admin access where you can test plugins, themes, and their add-ons with or without demo content. It’s free, and test drives stay active for 10 days for registered members or 24 hours for guests. The site uses affiliate links to commercial products to offset the cost of running the site.</p>\n<p><a href=\"https://wordpress.org/plugins/camptix/\">CampTix</a> is a free, open source ticketing plugin for WordPress that powers the ticket purchasing experience on WordCamp.org. Some of its features include, multiple ticket and attendee forms, coupon codes, mass emailing of attendees, exporting data into CSV or XML, refunds, and more.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, June 21st 3:00 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #277:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Jun 2017 23:22:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"HeroPress: Trust Yourself\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=1915\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://heropress.com/essays/trust-yourself/?utm_source=rss&utm_medium=rss&utm_campaign=trust-yourself\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8453:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/06/061417-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: Be open minded, trust yourself, and talk about what matters to you.\" /><p><em><strong>Editor&#8217;s Note:</strong> Birgit has been a friend of HeroPress since it&#8217;s very beginning. Through the oddities of life she was never able to do an essay. Recently she told me she would have one soon. This is not that essay. Our contributor this week needed some extra time and Birgit said she had something she wanted to write about, so here it is. Many thanks Birgit.</em></p>\n<p>Something is in the air. Do you feel the WordPress vibrations? It&#8217;s shortly before the fifth WordCamp Europe which will be held in Paris this year. The social channels like Twitter &amp; Co. are flooded with pre-event messages. You can feel the emotions of excitement and sadness in the timeline nearby. People share their excitement about their upcoming attendance and others who can&#8217;t make it. I am a person who belongs to both groups.</p>\n<p>But let me begin some months ago to tell you how this came to be. After WordCamp Europe in Vienna last summer I purchased my ticket for WCEU 2017 in Paris directly after the ticket sale was opened. There was no doubt at all I would participate.</p>\n<blockquote><p>How life&#8217;s play changes, it worked out differently than planned.</p></blockquote>\n<p>I&#8217;ve struggled with some health issues over several years. Mostly caused by stress during and after the divorce, as well as some deaths in the vicinity. Nothing really serious, but not ignorable. I thought&#8230; But at the end of the summer last year I got seriously ill. Not the right place for details here, but I had to quit my day job in a small agency because the fixed-term employment contract ended at the same time. Also, I had to reduce any contributions to the WordPress project. I had to reduce my freelancing contracts, too.</p>\n<p>I ran from one medical specialist to the other to find the cause of my illness. I was so frustrated not to be able to work like I&#8217;ve done before and so upset about the brain-fog and the fatigue. It was so depressing. As a mom of five children, it is not funny to be ill. The three youngest kids are living at home with me and my new partner. My oldest daughter bought her own house. But I couldn&#8217;t help her while moving. Can you imagine, how frustrating this could be?</p>\n<p>But hey &#8211; I am a fighter like a lioness. I put everything on the plate, invested my small savings into healing treatments and so on.</p>\n<blockquote><p>To make a long story short, I am getting healthier every day.</p></blockquote>\n<p>We found the cause and the healing treatments are helping like expected. Two operations went well. It is a process, but it&#8217;s going forward.</p>\n<p>Sitting at home without a job is not my thing, so I searched for a new day job. I found a part-time employment in my hometown as a head of a tutoring institute. It is ok, but nothing WordPress related. It secures my existence. But my saving balance allowed no budget for WordCamp travels. I gave up thoughts of attending WordCamp Europe in Paris this year.</p>\n<p>So I decided to offer my ticket.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">I’v to sell my <a href=\"https://twitter.com/hashtag/wceu?src=hash\">#wceu</a> ticket I bought last year. Unless it happens a miracle and there is a sponsor for stay &amp; travel <a href=\"https://twitter.com/WCEurope\">@WCEurope</a> <a href=\"https://t.co/PFWBTtSmlq\">pic.twitter.com/PFWBTtSmlq</a></p>\n<p>&mdash; Coach Birgit Olzem (@CoachBirgit) <a href=\"https://twitter.com/CoachBirgit/status/867323301399588864\">May 24, 2017</a></p></blockquote>\n<p></p>\n<p>The unexpected miracle happened. I found sponsors for travel &amp; stay without active seeking. My generous sponsors rewarded my past contributions to WordPress and Community over several years with this openhearted support. I am so grateful for this.</p>\n<p>Since 2012 I have been an active member of the WordPress Community. First as the main responsible person for the translations of WordPress into German, then as a part of the international Polyglots team. I am also editor and release manager for local German site and I am a member of some other contribution teams in the WordPress ecosystem. I spent a lot of spare time and money on contributions and WordCamp travels.</p>\n<blockquote><p>Perhaps you can imagine how frustrating it was, that I couldn&#8217;t afford to travel to WordCamp Europe.</p></blockquote>\n<p>An event where I can meet a lot of friends I made over the last years. Even more, I was happy to get the generous sponsoring. I am so grateful!</p>\n<p>In the last two years I had to reduce my contribution time and disappeared from the scene, but I followed the changes and enhancements within the community in the background. Nevertheless I wasn&#8217;t forgotten.</p>\n<p>And it&#8217;s not only me who get help to attend to WCEU:</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Today is a completely different day. Largely thanks to <a href=\"https://twitter.com/jdevalk\">@jdevalk</a> (and team <a href=\"https://twitter.com/yoast\">@yoast</a> ) I WILL be attending. Beyond grateful is what I am.</p>\n<p>&mdash; Remkus de Vries (@DeFries) <a href=\"https://twitter.com/DeFries/status/874595421112414208\">June 13, 2017</a></p></blockquote>\n<p></p>\n<p>Everyone has had some downs and some ups. If you ask, there is always someone who is willing to help you. It is an example of a mindset from an open-source community like the WordPress community and it reflects the philosophy. You can get everything, but you have to ask. Only speaking people can be helped.</p>\n<p>Apropos speaking people can get helped:</p>\n<p>I have a dream over some years to contribute to WordPress in full-time as a WordPress Community Manager. There are so many things I can do even if I am not a full-stack developer. Perhaps this miracle happens, too. But at this moment I am sitting on my suitcases to write about the generosity in the WordPress Community. This essay wasn&#8217;t planned, but it happened to have been written.</p>\n<p>I am so grateful for my heroes who made it happen, that I can go to the WordCamp Europe this year.</p>\n<p>There are so many unseen heroes outside who need to be seen.</p>\n<blockquote><p>Be open minded, trust yourself and talk about what matters to you.</p></blockquote>\n<p>There is a light at the end of the tunnel. Be your own hero.</p>\n<p>Beyond everything else: Care about yourself!</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Trust Yourself\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Trust%20Yourself&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-yourself%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Trust Yourself\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-yourself%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-yourself%2F&title=Trust+Yourself\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Trust Yourself\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/trust-yourself/&media=https://heropress.com/wp-content/uploads/2017/06/061417-150x150.jpg&description=Trust Yourself\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Trust Yourself\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/trust-yourself/\" title=\"Trust Yourself\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/trust-yourself/\">Trust Yourself</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Jun 2017 08:00:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Birgit Olzem\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: Imagely Acquires TeslaThemes, Is Seeking Other Acquisition Opportunities\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71716\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wptavern.com/imagely-acquires-teslathemes-is-seeking-other-acquisition-opportunities\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4432:\"<p>In an effort to diversify and expand into the commercial WordPress theme market, <a href=\"https://www.imagely.com\">Imagely</a>, maintainers of <a href=\"https://www.imagely.com/wordpress-gallery-plugin/\">NextGEN Gallery</a>, <a href=\"https://www.imagely.com/tesla-themes-acquisition/\">have acquired</a> <a href=\"http://teslathemes.com/\">TeslaThemes</a> for an undisclosed amount.</p>\n<p>TeslaThemes <a href=\"https://wptavern.com/interview-with-brand-new-theme-club-teslathemes\">launched in 2013</a> as a theme club and recently celebrated its <a href=\"http://teslathemes.com/blog/teslathemes-anniversary-giveaway-and-redesign-announcement/\">fourth anniversary</a>. The company has 68 themes in its library, including the TeslaThemes framework.</p>\n<p>Eric Danzer, Founder and CEO of Imagely, says no major changes will be happening with TeslaThemes and that their immediate focus will be to provide maintenance and support.</p>\n<p>&#8220;Beyond that, our goal is to do more of what Tesla has already been doing so well &#8211; creating beautiful new themes and continually enhancing the existing themes,&#8221; Danzer said.</p>\n<p>Imagely has been busy this year launching a <a href=\"https://www.imagely.com/websites/\">managed WordPress hosting service</a> for photographers, releasing <a href=\"https://www.imagely.com/wordpress-photography-themes/\">new photography themes</a>, and an <a href=\"https://www.imagely.com/wordpress-lightroom-plugin/\">Adobe Lightroom plugin</a> that allows users to manage NextGEN galleries from within Lightroom.</p>\n<p>Later this year, Imagely plans to release a new version of NextGEN gallery with a redesigned backend interface. The company is also working on a way to add automated print fulfillment to WordPress.</p>\n<p>&#8220;Automated print fulfillment allows photographers to sell prints from their websites, and have those prints automatically delivered via the print lab without any intervention on their part,&#8221; Danzer said.</p>\n<p>&#8220;This functionality drives many large companies in the photo industry &#8211; SmugMug, ShootProof, Pixieset, Zenfolio, Photoshelter, and others. But it&#8217;s not possible yet on WordPress.</p>\n<p>&#8220;Bringing a full print solution to WordPress has the potential to revolutionize the photo industry and make WordPress the default web solution for photographers that it should be.&#8221;</p>\n<p>Marcel Sobieski, co-founder of TeslaThemes, <a href=\"http://teslathemes.com/blog/acquisition/\">thanked customers</a> for their support and confirmed that they exited the company on June 9th.</p>\n<p>&#8220;We built a solid, trusted and valuable business, that is needed on the market and is appreciated both by industry colleagues and clients,&#8221; Sobieski said.</p>\n<p>This is the second exit in the last six months for Sobieski and his team. The sale of TeslaThemes will allow them to focus on a new venture called <a href=\"http://www.wpmatic.io/\">WPMatic.io</a>, a one-on-one WordPress support and development company.</p>\n<p>&#8220;The six years of experience that we have in WordPress is already helping a few hundred clients and tens of companies and agencies in need, right after purchasing a WP Theme from the market,&#8221; Sobieski said.</p>\n<p>&#8220;Soon we will start partnering with some of the best WP Theme Clubs to deliver a unique experience for their clients.&#8221;</p>\n<p>The acquisition of TeslaThemes represents Imagely&#8217;s first major move into the general WordPress products market. The company is also seeking acquisition opportunities for other WordPress plugin and theme companies.</p>\n<p>&#8220;In the coming years, we&#8217;ll be both building and be acquiring a range of other WordPress theme and plugin companies,&#8221; Danzer said.</p>\n<p>&#8220;I&#8217;ll even add a small call here: if you have a solid WordPress product, with a great brand and stable revenue over around $200,000, and you are looking to exit, feel free to reach out to me directly to chat.&#8221;</p>\n<p><strong>Correction: June 14th, 2017</strong> The article incorrectly identifies Imagely as the creators of NextGEN Gallery. Alex Rabe is the creator of NextGEN Gallery and he <a href=\"https://alexrabe.wordpress.com/nextgen-gallery/\">released it in 2007</a>. Photocrati <a href=\"https://www.imagely.com/photocrati-acquires-nextgen-gallery/\">acquired the plugin</a> in February, 2016.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jun 2017 21:33:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"Akismet: Coming Soon to a Jetpack Near You\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1942\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://blog.akismet.com/2017/06/13/coming-soon-to-a-jetpack-near-you/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1007:\"<p>If you haven&#8217;t tried Jetpack yet &#8212; our sister plugin &#8212; there&#8217;s never been a better time to add it to your bucket list.</p>\n<p>In the coming weeks we&#8217;ll be announcing a really exciting new addition to Jetpack&#8217;s services and you can <a href=\"https://jetpack.com/know/\">sign up to get early access right here</a>.</p>\n<div id=\"v-Q1CJRnNs-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1942/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1942/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1942&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"https://blog.akismet.com/2017/06/13/coming-soon-to-a-jetpack-near-you/\"><img alt=\"Coming Soon to Jetpack\" src=\"https://videos.files.wordpress.com/Q1CJRnNs/jetpack_30secondsfinal_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jun 2017 10:00:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Richard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: WordCamp for Publishers Opens Up Ticket Sales, 50% Sold in the First Day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71732\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wptavern.com/wordcamp-for-publishers-opens-up-ticket-sales-50-sold-in-the-first-day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2365:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/wordcamp-for-publishers-2017.png?ssl=1\"><img /></a></p>\n<p>WordCamp for Publishers, the first niche WordCamp to be focused around a specific industry, <a href=\"https://2017-denver.journalist.wordcamp.org/tickets/\" target=\"_blank\">opened up ticket sales</a> today. The event will take place in Denver, Colorado, August 17-19, and organizers have planned for just 230 attendees, due to venue constraints. In less than 24 hours since tickets went on sale, the event is already 50% sold out.</p>\n<p><a href=\"https://2017-denver.journalist.wordcamp.org/speakers/\" target=\"_blank\">Speakers</a> and workshop facilitators have already been selected and published to the event&#8217;s website, featuring publication directors, developers, product managers, and other industry experts.</p>\n<p>The tentative schedule for the WordCamp includes a mixture of presentations, hands-on workshops, and social events to encourage networking and collaboration among publishers.</p>\n<ul>\n<li><strong>Thursday, August 17:</strong> Presentations and workshops, followed by a brewery tour</li>\n<li><strong>Friday, August 18:</strong> Presentations and workshops, followed by an after party</li>\n<li><strong>Saturday, August 19:</strong> Publisher plugin contributor day, followed by a Rockies baseball game</li>\n</ul>\n<p>One of the goals for the event is to encourage those who are maintaining open source tools for publishers to work together towards ensuring a strong future for those projects. Contributing is an important part of the event, as many of the organizers have experience working at or with publishing organizations that heavily rely on open source tools.</p>\n<p>The <a href=\"http://www.denverpost.com/\" target=\"_blank\">Denver Post</a> has donated the venue for the event as an official sponsor and the official hotel is a five-minute walk from there. After purchasing a ticket online, attendees will receive an email with a link to make a reservation at the Sheraton Denver Downtown Hotel, which has a designated block of rooms for WordCampers.</p>\n<p>Organizers expect the event to sell out quickly, so if you&#8217;re thinking of attending, don&#8217;t wait to <a href=\"https://2017-denver.journalist.wordcamp.org/tickets/\" target=\"_blank\">buy your ticket</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jun 2017 22:05:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Unsplash Updates its License, Raises GPL Compatibility Concerns\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71742\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wptavern.com/unsplash-updates-its-license-raises-gpl-compatibility-concerns\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6631:\"<p><a href=\"https://unsplash.com/\">Unsplash.com</a>, a site that provides high-resolution photos for free, updated its license and the change has people in the WordPress community concerned.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">So unsplash images are no longer public domain. No longer gpl compatible. What does it mean for <a href=\"https://twitter.com/hashtag/WordPressThemes?src=hash\">#WordPressThemes</a>  that uses these images?</p>\n<p>&mdash; Carolina Nymark (@carolinapoena) <a href=\"https://twitter.com/carolinapoena/status/872977081067548672\">June 9, 2017</a></p></blockquote>\n<p></p>\n<p>Prior to the change, Unsplash&#8217;s license stated the following:</p>\n<blockquote><p><span>All photos published on Unsplash are licensed under <a href=\"https://web.archive.org/web/20170530053437/http://creativecommons.org/publicdomain/zero/1.0/\">Creative Commons Zero</a> which means you can copy, modify, distribute and use the photos for free, including commercial purposes, without asking permission from or providing attribution to the photographer or Unsplash.</span></p></blockquote>\n<p>According to GNU.org, the CC0 or Creative Commons Zero license <a href=\"https://www.gnu.org/licenses/license-list.en.html\">is compatible</a> with the GPL.</p>\n<blockquote><p>CC0 is a public domain dedication from Creative Commons. A work released under CC0 is dedicated to the public domain to the fullest extent permitted by law. If that is not possible for any reason, CC0 also provides a lax, permissive license as a fallback. Both public domain works and the lax license provided by CC0 are compatible with the GNU GPL.</p>\n<p>If you want to release your work to the public domain, we recommend you use CC0.</p></blockquote>\n<p>Unsplash&#8217;s new license states (emphasis mine):</p>\n<blockquote><p>All photos published on Unsplash can be used for free. You can use them for commercial and noncommercial purposes. You do not need to ask permission from or provide credit to the photographer or Unsplash, although it is appreciated when possible.</p>\n<p>More precisely, Unsplash grants you a nonexclusive copyright license to download, copy, modify, distribute, perform, and use photos from Unsplash for free, including for commercial purposes, without permission from or attributing the photographer or Unsplash. <strong>This license does not include the right to compile photos from Unsplash to replicate a similar or competing service. </strong></p></blockquote>\n<p>The inability to compile photos from Unsplash to replicate a similar or competing service is a restriction on how the photos can be used, calling into question its compatibility with the GPL.</p>\n<p>Luke Chesser, co-founder of Unsplash, <a href=\"https://twitter.com/lukechesser/status/873146783945416704\">explained on</a> Twitter that individual photos have no restrictions.</p>\n<p>&#8220;The Unsplash license doesn&#8217;t violate GPL and can still be used in WordPress themes,&#8221; Chesser said. &#8220;There are no restrictions on the individual photos.</p>\n<p>&#8220;There is only a restriction on the collection of photos, which doesn&#8217;t even apply unless your intent is to create a similar service.&#8221;</p>\n<p>For example, it&#8217;s ok if someone creates a site that displays the best photos of bridges from Unsplash. But if the site makes those photos available for download, it would <a href=\"https://community.unsplash.com/help-section/do-i-have-to-give-credit-to-a-photographer-when-i-use-their-photo\">violate the license</a>.</p>\n<p>On its FAQ page, Unsplash <a href=\"https://community.unsplash.com/help-section/what-is-the-unsplash-license-and-where-can-i-find-it\">explains why</a> the restriction was put in place:</p>\n<blockquote><p>The fuel that drives Unsplash is the exceptional images that are generously contributed by people from all over the world. Without them, none of this would work. Unsplash would be nothing. We owe everyone who’s contributed a photo not only a thank you but support and empowerment for the gifts they’ve given us.</p>\n<p>Out of respect for our contributors and our ability to uphold our value of empowering creativity, we added this sentence to the Unsplash License.</p>\n<p>We don’t support the mass duplication of Unsplash photos with the purpose of replicating a similar or competing service because it leads to confusion which negatively impacts both the spirit of open creative use and the celebration of Unsplash contributors.</p></blockquote>\n<p>Mass compiling of photos from Unsplash to distribute on other sites has created legal issues in the past. &#8220;Sites that mass duplicate and compile Unsplash photos point support and legal issues back to Unsplash, while continuing to redistribute photos that may be removed on Unsplash,&#8221; the company said.</p>\n<p>The reasons cited by Unsplash for putting the restriction in place are some of the same reasons WordPress plugin developers <a href=\"https://wptavern.com/the-gpl-license-doesnt-provide-the-freedom-to-infringe-registered-trademarks\">register trademarks</a>. The GPL allows the following freedoms.</p>\n<ol start=\"0\">\n<li>The freedom to run the program, for any purpose.</li>\n<li>The freedom to study how the program works, and change it so it does your computing as you wish.</li>\n<li>The freedom to redistribute copies so you can help your neighbor.</li>\n<li>The freedom to distribute copies of your modified versions, giving the community a chance to benefit from your changes.</li>\n</ol>\n<p>Over the years, there have been many instances in the WordPress community where businesses have taken advantage of these freedoms merely to profit from the work of others.</p>\n<p>The reselling of commercial plugins causes confusion in the market and resellers typically point support and other inquiries back to the plugin&#8217;s developers.</p>\n<p>Trademarks give commercial plugin authors measures to protect their brand without violating the GPL. A good example is the <a href=\"http://www.gravityforms.com/trademark/\">GravityForms Trademark page</a> which clearly outlines how its brand can be used and displayed.</p>\n<p>For now, it appears that most people who use Unsplash will be unaffected by the licensing change. However, as long as there is one license that governs the use of images and it has at least one restriction, its compatibility with the GPL will remain in doubt.</p>\n<p><strong>Correction June 14th</strong> Luke Chesser, co-founder of Unsplash, did not say that individual photos are still CC0-licensed but rather, have no restrictions.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jun 2017 21:27:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:131:\"WPTavern: Major Update Coming to WP Super Cache: New REST API, User-Friendly Settings Page, and Improvements to Legacy File Storage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71718\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:139:\"https://wptavern.com/major-update-coming-to-wp-super-cache-new-rest-api-user-friendly-settings-page-and-improvements-to-legacy-file-storage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2550:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-super-cache.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://wordpress.org/plugins/wp-super-cache/\" target=\"_blank\">WP Super Cache</a>, a WordPress caching plugin maintained by Donncha Ó Caoimh and Automattic, is looking for users to help test the plugin <a href=\"https://odd.blog/2017/06/07/take-a-sneak-peek-at-wp-super-cache/\" target=\"_blank\">ahead of the next major update</a>. Ó Caoimh said the upcoming release is in a &#8220;stable and usable&#8221; state, but with the unusually large number of bug fixes and new features, it could use some testing in different environments.</p>\n<p>WP Super Cache is set to introduce a REST API, which will be useful for situations where administrators are not using wp-admin to manage their sites. The plugin is also <a href=\"https://github.com/Automattic/wp-super-cache/pull/177\" target=\"_blank\">changing the location for storing legacy cache files</a> to the supercache directory.</p>\n<p>&#8220;This makes it easier to manage these files,&#8221; Ó Caoimh said. &#8220;The plugin doesn’t have to search through potentially hundreds of cache files for those that need to be deleted if a page updates or someone leaves a comment. Now all those files will be in the same directory structure the anonymous “supercache” files will be. I’m really excited about this feature as it makes caching for logged-in users/users who comment and caching of pages with parameters so much faster now.&#8221;</p>\n<p>Ó Caoimh is also updating the settings page to make it easier for new users to understand the options. Currently it asks the user to select from mod_rewrite, PHP, or Legacy page caching with little explanation for why a user might opt for a certain delivery method. The new settings page simplifies the language used to describe the caching types.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/wp-super-cache-new-settings.png?ssl=1\"><img /></a></p>\n<p>The upcoming release will also <a href=\"https://github.com/Automattic/wp-super-cache/pulls?q=is%3Apr+is%3Aclosed\" target=\"_blank\">fix nearly 100 bugs</a>. As WP Super Cache is one of the most popular WordPress caching solutions and is active on more than a million sites, any problems with a major release will have a far-reaching impact. The latest changes to the plugin are <a href=\"https://github.com/Automattic/wp-super-cache\" target=\"_blank\">available on GitHub</a> for anyone who wants to help test.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jun 2017 20:04:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: Harare, Zimbabwe to Host Its 2nd WordCamp November 4, 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71314\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://wptavern.com/harare-zimbabwe-to-host-its-2nd-wordcamp-november-4-2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3375:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/12/harare.jpg?ssl=1\"><img /></a>photo credit: <a href=\"https://www.lonelyplanet.com/zimbabwe/harare\">Lonely Planet</a>\n<p>Harare, Zimbabwe will be <a href=\"https://2017.harare.wordcamp.org/2017/01/18/welcome-to-wordcamp-harare/\" target=\"_blank\">hosting its second WordCamp</a> on November 4, 2017, at <a href=\"http://www.hellenicacademy.ac.zw/\" target=\"_blank\">Hellenic Academy</a>. The city was one of three selected to be part of the <a href=\"https://wptavern.com/wordcamp-incubator-program-to-launch-in-indonesia-zimbabwe-and-columbia\" target=\"_blank\">WordCamp Incubator Program</a> in 2016. Harare&#8217;s first WordCamp was successful in connecting the local WordPress community and inspiring local leaders to carry on with organizing future events.</p>\n<p>Last year the <a href=\"https://www.meetup.com/Harare-WordPress-Meetup/\" target=\"_blank\">Harare WordPress Meetup</a> had 82 members and the group has nearly doubled in size with 142 members today.  Members meet every month and communicate outside of meetings via an active WhatsApp group. The current venue they use was donated by <a href=\"http://motorepublik.co/\" target=\"_blank\">Moto Republik</a>, thanks to one of the members Munya Bloggo, who works there.</p>\n<p>&#8220;It was always the goal of the WordCamp Incubator program to organize an easily-reproducible event that we could organize independently in the years to come,&#8221; 2017 lead organizer <a href=\"https://franksweb.org/\" target=\"_blank\">Thabo Tswana</a> said. &#8220;We expected it of ourselves. Some attendees and organizers actually approached me about the next WordCamp during WordCamp Harare 2016.&#8221;</p>\n<p>Tswana said the turnout at last year&#8217;s event was larger than he expected, because very few attendees booked tickets online. The majority ended up buying tickets at the door on the day of the event, a fairly uncommon scenario for most WordCamps that makes it somewhat difficult to estimate total attendees.</p>\n<p>&#8220;One of the biggest impacts that WordCamp had was introducing us to the WordPress Community,&#8221; Tswana said. &#8220;There are so many WordPress users in Zimbabwe (bloggers, designers, developers) but hardly anyone knew about the WordPress Community or how to contribute to WordPress. We now have a growing meetup group and the local community is starting to become more aware of what WordPress has to offer.&#8221;</p>\n<p>The local community consists primarily of developers and advanced WordPress users and Tswana said he would like see more of them getting involved with contributing. As the majority of meetup members are new to the larger WordPress community, they are still learning about the many ways users can contribute back to the project.</p>\n<p>Two Harare WordPress Meetup members, Kudakwashe Zafevere and Rima Trew, arranged for Hellenic Academy to donate a venue for WordCamp Harare 2017. The facilities are well-suited to hosting a tech event with wifi available.</p>\n<p>&#8220;This year, some local companies and organizations expressed interest in helping us out,&#8221; Tswana said. &#8220;We definitely expect more attendees due to the buzz that was created by last year&#8217;s WordCamp. To sum it all up, more people and organizations are getting involved this year.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jun 2017 02:33:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"WPTavern: WordPress 4.8 “Evans” Released Featuring Nearby WordPress Events, New Media Widgets, and Link Boundaries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71534\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://wptavern.com/wordpress-4-8-evans-released-featuring-nearby-wordpress-events-new-media-widgets-and-link-boundaries\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7169:\"<p><a href=\"https://wordpress.org/news/2017/06/evans/\">WordPress 4.8 &#8220;Evans&#8221;</a> is available for download and is the first major release of the year under the <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\">new release cycle</a>. WordPress 4.8 is named after <a href=\"https://en.wikipedia.org/wiki/Bill_Evans\">William John &#8220;Bill&#8221; Evans</a>, an American jazz pianist.</p>\n<h2>New Image, Video, and Audio Widgets</h2>\n<p>WordPress 4.8 includes <a href=\"https://make.wordpress.org/core/2017/05/26/media-widgets-for-images-video-and-audio/\">three new widgets</a>. All three widgets make it easier to display images, video, or audio  without using HTML. The Text widget now has support for TinyMCE providing rich-text functionality. Similar to the post editor, users have a choice between using a Visual or Text editor with limited formatting options.</p>\n<img />Image, Video, and Enhanced Text Widget\n<p>Because the Text widget uses TinyMCE, it inherits its nuances when it comes to pasting and displaying code. In a <a href=\"https://make.wordpress.org/core/2017/05/23/addition-of-tinymce-to-the-text-widget/\">dev note</a> that explains how TinyMCE was added to the Text Widget, Weston Ruter offers the following notice.</p>\n<blockquote><p>When pasting HTML into the &#8216;Text&#8217; (HTML) tab of the Text widget, any extraneous line breaks should be removed or else unwanted paragraphs and line beaks may result. This is particularly important when you paste in <code>script</code> or <code>style</code> tags (as in the case of 3rd-party JavaScript embeds), since auto-inserted paragraphs will cause script errors; this will be fixed in <span class=\"p2_hovercardify\"><a href=\"https://core.trac.wordpress.org/ticket/2833\">#2833</a></span>.</p>\n<p>This behavior aligns with longstanding behavior in the post editor, so it is not new, although it does differ from how the Text widget has previously behaved. As noted above, for previously existing Text widgets that had the auto-add paragraphs&#8217; checkbox unchecked (and thus the <code>filter</code> instance prop set to <code>false</code>), the previous behavior of not doing <code>wpautop</code> will be maintained: only once the widgets are modified will any extraneous line breaks need to be removed.</p></blockquote>\n<h2>Link Boundaries</h2>\n<p>Adding and editing links in the visual editor is more intuitive thanks to link boundaries. Link boundaries provide a visual representation of where a link begins and ends. This helps prevent adding unnecessary text to the beginning or end of a link.</p>\n<p></p>\n<p></p>\n<h2>See Nearby WordPress Events in the Dashboard</h2>\n<p>One of the pillars of WordPress&#8217; ecosystem is its community of meetups and WordCamps. <a href=\"https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\">In 2016</a>, more than 62,566 people attended a local meetup in 58 countries. About a third of those were new members.</p>\n<p>WordPress 4.8 draws attention to these events by <a href=\"https://make.wordpress.org/community/2017/03/23/showing-upcoming-local-events-in-wp-admin/\">enhancing the News Dashboard widget</a>. The widget will try to automatically guess your location and display meetups and WordCamps that are nearby.</p>\n<img />News Widget Shows Upcoming Meetups and WordCamps\n<p>If the location is incorrect, clicking the Pencil button opens a box where you can type in your city. The bottom of the widget includes links to the <a href=\"https://make.wordpress.org/community/meetups-landing-page\">WordPress Meetup landing page</a>, <a href=\"https://central.wordcamp.org/schedule/\">WordCamp Central Schedule</a>, and the <a href=\"https://wordpress.org/news/\">WordPress.org news blog</a>.</p>\n<h2>Responsive Customizer Sidebar</h2>\n<p>In previous versions of WordPress, the Customizer Sidebar had a maximum width of 300 pixels. In WordPress 4.8, the <a href=\"https://wptavern.com/wordpress-4-8-increases-maximum-width-of-the-customizer-sidebar-to-600-pixels\">Customizer Sidebar is responsive</a> and its width will automatically increase based on the size of the screen up to a maximum of 600 pixels.</p>\n<img />Customizer Sidebar 345 Pixels Wide\n<h2>More Accessible Admin Pages</h2>\n<p>The headers on admin screens are now <a href=\"https://wptavern.com/wordpress-4-8-improves-accessibility-on-admin-screens\">separate elements</a> making it easier for assistive technologies to help people navigate pages.</p>\n<h2>Support Dropped for Internet Explorer Versions 8, 9, and 10</h2>\n<p>WordPress 4.8 <a href=\"https://make.wordpress.org/core/2017/04/23/target-browser-coverage/\">drops support</a> for Internet Explorer versions 8, 9, and 10 as these versions no longer receive security updates and are used by a small percentage of people. WordPress 4.8 will work in these browsers but some features related to TinyMCE will be limited. New features will no longer be tested against these older versions of IE.</p>\n<h2>Noteworthy Changes</h2>\n<ul>\n<li><a href=\"https://make.wordpress.org/core/2017/05/20/editor-api-changes-in-4-8/\">Changes to the Editor API</a></li>\n<li><a href=\"https://make.wordpress.org/core/2017/05/22/removal-of-core-embedding-support-for-wmv-and-wma-file-formats/\">Embeds of WMV and WMA files are no longer supported</a></li>\n<li><a href=\"https://make.wordpress.org/core/2017/05/22/multisite-focused-changes-in-4-8/\">New Capabilities and others enhancements for WordPress Multisite</a></li>\n<li><a href=\"https://make.wordpress.org/core/2017/05/26/tag-cloud-widget-changes-in-4-8/\">Accessibility improvements to the Tag Cloud widget</a></li>\n<li><a href=\"https://make.wordpress.org/core/2017/05/26/media-widgets-for-images-video-and-audio/\">The addition of a Media Widgets API</a></li>\n<li>TinyMCE was updated from version <strong>4.5.6</strong> to version <strong>4.6.2</strong></li>\n<li>Twemoji was updated from version <strong>2.2.2</strong> to version <strong>2.3.0</strong></li>\n<li>zxcvbn was updated from version <strong>1.0</strong> to version <strong>4.4.1</strong></li>\n</ul>\n<p>This release was led by <a href=\"https://matt.blog/\">Matt Mullenweg</a> and <a href=\"https://profiles.wordpress.org/jbpaul17\">Jeff Paul</a>. 346 people contributed to WordPress 4.8 and 106 of them were first time contributors.</p>\n<p>If you think you&#8217;ve discovered a bug in WordPress 4.8, read <a href=\"https://wordpress.org/support/topic/read-this-first-wordpress-4-8-master-list/\">this support thread</a> first to see if it&#8217;s a common issue that&#8217;s already been reported. If not, describe your issue in as much detail as possible and publish it to the <a href=\"https://wordpress.org/support/forum/how-to-and-troubleshooting/\">Troubleshooting section</a> on the support forums.</p>\n<p>As you upgrade your sites today, enjoy <a href=\"https://en.wikipedia.org/wiki/Time_Remembered_(album)\">Time Remembered</a> by Bill Evans, released in 1983.</p>\n<div class=\"embed-wrap\"></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jun 2017 19:29:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: Worona Releases Free WordCamp Europe Paris Guide App\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71494\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"https://wptavern.com/worona-releases-free-wordcamp-europe-paris-guide-app\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4240:\"<p><a href=\"https://www.worona.org/\" target=\"_blank\">Worona</a>, a Madrid-based WordPress startup that builds mobile apps for free, has created an app for WordCamp Europe attendees. The <a href=\"https://blog.worona.org/wceu-paris-guide/\" target=\"_blank\">WCEU Paris Guide app</a> includes location and transportation information, schedules for the event, suggestions on where to eat (restaurants, bistros, a selection of the best cheap eats), a list of top attractions and museums, and nightlife recommendations.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/wceu-paris-guide.png?ssl=1\"><img /></a></p>\n<p>Worona has released an <a href=\"https://play.google.com/store/apps/details?id=org.worona.paris.app\" target=\"_blank\">Android app</a> and an <a href=\"https://itunes.apple.com/WebObjects/MZStore.woa/wa/viewSoftware?id=1238819389&mt=8\" target=\"_blank\">iOS app</a> for attendees to download. Currently the app needs to be connected to the internet, but the company is working on supporting an offline mode in the next version, which is rolling out soon.</p>\n<p>&#8220;We used our online platform to turn a WordPress blog (<a href=\"https://paris.worona.org\" target=\"_blank\">paris.worona.org</a>) into a native app,&#8221; Reyes Martínez, Worona&#8217;s marketing and communications specialist, said. &#8220;We use React and fetch the content using the WP-API. The apps are created with <a href=\"https://cordova.apache.org/\" target=\"_blank\">Cordova</a>.&#8221;</p>\n<p>Worona is a relatively new WordPress startup in Europe, having released its first prototype in late 2014. The company offers its mobile app building platform to users for free via its <a href=\"https://wordpress.org/plugins/worona/\" target=\"_blank\">plugin on WordPress.org</a>. The platform turns WordPress sites into native mobile apps that users can publish to the app stores. Worona can also manage the process of publishing the app for a one-time 290€ fee.</p>\n<p>In 2016, Worona had more than 12,000 users from 150 different countries. After launching its new platform four months ago, more than 11,500 users have signed up.</p>\n<p>Martínez said that Worona differs from existing WordPress app builders in that it is free, user-friendly, completely open source, and extensible.</p>\n<p>&#8220;We studied the WordPress ecosystem and the mobile distribution trends during the last three years and realized that other existing solutions, such as AppPresser, are just focused on one or two mobile channels, but not in all of them,&#8221; Martínez said. &#8220;This can be a problem for publishers, as they have to configure the different channels (apps, web apps, AMP, Facebook Instant Articles) one by one and take care of being consistent with all of them. After launching our own beta in 2015 and testing similar solutions, we decided to develop an all-in-one platform with the vision of becoming the leading solution for mobile distribution.&#8221;</p>\n<p>Worona is also aiming to create an ecosystem of extensions and themes for the platform, allowing third-party developers to create new solutions.</p>\n<p>&#8220;The strategy of creating a marketplace of extensions has been successfully accomplished by the WordPress ecosystem before (but not by any of our direct competitors),&#8221; Martínez said. &#8220;WooCommerce, for example, gives you access to a variety of extensions aiming to solve any problems related to your e-commerce. Because it is open-source, these features can be created by any developer or user. The bigger the community, the higher the range of solutions.&#8221;</p>\n<p>Worona is currently a team of five, including two co-founders, a marketing specialist, and two full-stack developers. Most of the team will be at WordCamp Europe. They hope the <a href=\"https://blog.worona.org/wceu-paris-guide/\" target=\"_blank\">WCEU Paris Guide app</a> will be useful for attendees and also provide a good introduction to their product. If you have any feedback that would make the app more useful, make sure to <a href=\"https://blog.worona.org/wceu-paris-guide/\" target=\"_blank\">comment on the announcement</a> and Worona may be able to incorporate user suggestions before the event.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jun 2017 17:32:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Dev Blog: WordPress 4.8 “Evans”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4770\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://wordpress.org/news/2017/06/evans/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:31595:\"<h2>An Update with You in Mind</h2>\n<p><img class=\"aligncenter size-large wp-image-4816\" src=\"https://i0.wp.com/wordpress.org/news/files/2017/06/release-featured-image.png?resize=632%2C316&ssl=1\" alt=\"\" /></p>\n<h3>Gear up for a more intuitive WordPress!</h3>\n<p>Version 4.8 of WordPress, named &#8220;Evans&#8221; in honor of jazz pianist and composer William John &#8220;Bill&#8221; Evans, is available for download or update in your WordPress dashboard. New features in 4.8 add more ways for you to express yourself and represent your brand.</p>\n<p>Though some updates seem minor, they’ve been built by hundreds of contributors with <em>you</em> in mind. Get ready for new features you’ll welcome like an old friend: link improvements, <em>three</em> new media widgets covering images, audio, and video, an updated text widget that supports visual editing, and an upgraded news section in your dashboard which brings in nearby and upcoming WordPress events.</p>\n<hr />\n<h2>Exciting Widget Updates</h2>\n<p><img class=\"size-large wp-image-4776 aligncenter\" src=\"https://i1.wp.com/wordpress.org/news/files/2017/06/widgets-with-all-four.png?resize=632%2C436&ssl=1\" alt=\"\" /></p>\n<h3>Image Widget</h3>\n<p>Adding an image to a widget is now a simple task that is achievable for any WordPress user without needing to know code. Simply insert your image right within the widget settings. Try adding something like a headshot or a photo of your latest weekend adventure — and see it appear automatically.</p>\n<h3>Video Widget</h3>\n<p>A welcome video is a great way to humanize the branding of your website. You can now add any video from the Media Library to a sidebar on your site with the new Video widget. Use this to showcase a welcome video to introduce visitors to your site or promote your latest and greatest content.</p>\n<h3>Audio Widget</h3>\n<p>Are you a podcaster, musician, or avid blogger? Adding a widget with your audio file has never been easier. Upload your audio file to the Media Library, go to the widget settings, select your file, and you’re ready for listeners. This would be a easy way to add a more personal welcome message, too!</p>\n<h3>Rich Text Widget</h3>\n<p>This feature deserves a parade down the center of town! Rich-text editing capabilities are now native for Text widgets. Add a widget anywhere and format away. Create lists, add emphasis, and quickly and easily insert links. Have fun with your newfound formatting powers, and watch what you can accomplish in a short amount of time.</p>\n<hr />\n<h2>Link Boundaries</h2>\n<div id=\"v-8BDWH3QG-1\" class=\"video-player\"><div><img alt=\"Link Boundaries\" src=\"https://videos.files.wordpress.com/8BDWH3QG/3-link-boundaries_dvd.original.jpg?resize=632%2C342\" /></div><p>Link Boundaries</p></div>\n<p>Have you ever tried updating a link, or the text around a link, and found you can&#8217;t seem to edit it correctly? When you edit the text after the link, your new text also ends up linked. Or you edit the text in the link, but your text ends up outside of it. This can be frustrating! With link boundaries, a great new feature, the process is streamlined and your links will work well. You’ll be happier. We promise.</p>\n<hr />\n<h2>Nearby WordPress Events</h2>\n<p><img class=\"aligncenter wp-image-4779 size-large\" src=\"https://i2.wp.com/wordpress.org/news/files/2017/06/events-widget.png?resize=632%2C465&ssl=1\" alt=\"\" /></p>\n<p>Did you know that WordPress has a thriving offline community with groups meeting regularly in more than 400 cities around the world? WordPress now draws your attention to the events that help you continue improving your WordPress skills, meet friends, and, of course, publish!</p>\n<p>This is quickly becoming one of our favorite features. While you are in the dashboard (because you’re running updates and writing posts, right?) all upcoming WordCamps and official WordPress Meetups — local to you — will be displayed.</p>\n<p>Being part of the community can help you improve your WordPress skills and network with people you wouldn&#8217;t otherwise meet. Now you can easily find your local events just by logging in to your dashboard and looking at the new Events and News dashboard widget.</p>\n<hr />\n<h2>Even More Developer Happiness <img src=\"https://s.w.org/images/core/emoji/2.3/72x72/1f60a.png\" alt=\"😊\" class=\"wp-smiley\" /></h2>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/17/cleaner-headings-in-the-admin-screens/\">More Accessible Admin Panel Headings</a></h3>\n<p>New CSS rules mean extraneous content (like “Add New” links) no longer need to be included in admin-area headings. These panel headings improve the experience for people using assistive technologies.</p>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/22/removal-of-core-embedding-support-for-wmv-and-wma-file-formats/\">Removal of Core Support for WMV and WMA Files</a></h3>\n<p>As fewer and fewer browsers support Silverlight, file formats which require the presence of the Silverlight plugin are being removed from core support. Files will still display as a download link, but will no longer be embedded automatically.</p>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/22/multisite-focused-changes-in-4-8/\">Multisite Updates</a></h3>\n<p>New capabilities have been introduced to 4.8 with an eye towards removing calls to<br />\n<code>is_super_admin()</code>. Additionally, new hooks and tweaks to more granularly control site and user counts per network have been added.</p>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/23/addition-of-tinymce-to-the-text-widget/\">Text-Editor JavaScript API</a></h3>\n<p>With the addition of TinyMCE to the text widget in 4.8 comes a new JavaScript API for instantiating the editor after page load. This can be used to add an editor instance to any text area, and customize it with buttons and functions. Great for plugin authors!</p>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/26/media-widgets-for-images-video-and-audio/\">Media Widgets API</a></h3>\n<p>The introduction of a new base media widget REST API schema to 4.8 opens up possibilities for even more media widgets (like galleries or playlists) in the future. The three new media widgets are powered by a shared base class that covers most of the interactions with the media modal. That class also makes it easier to create new media widgets and paves the way for more to come.</p>\n<h3><a href=\"https://make.wordpress.org/core/2017/05/16/customizer-sidebar-width-is-now-variable/\">Customizer Width Variable</a></h3>\n<p>Rejoice! New responsive breakpoints have been added to the customizer sidebar to make it wider on high-resolution screens. Customizer controls should use percentage-based widths instead of pixels.</p>\n<hr />\n<h2>The Squad</h2>\n<p>This release was led by <a href=\"https://matt.blog\">Matt</a> and <a href=\"https://profiles.wordpress.org/jbpaul17\">Jeff Paul</a>, with the help of the following fabulous folks. There are 346 contributors with props in this release, with 106 of them contributing for the first time. Pull up some Bill Evans on your music service of choice, and check out some of their profiles:</p>\n<a href=\"https://profiles.wordpress.org/1naveengiri\">1naveengiri</a>, <a href=\"https://profiles.wordpress.org/4nickpick\">4nickpick</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/abhishek\">abhishek</a>, <a href=\"https://profiles.wordpress.org/abhishekfdd\">Abhishek Kumar</a>, <a href=\"https://profiles.wordpress.org/abrain\">abrain</a>, <a href=\"https://profiles.wordpress.org/kawauso\">Adam Harley (Kawauso)</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/adamsoucie\">Adam Soucie</a>, <a href=\"https://profiles.wordpress.org/afzalmultani\">Afzal Multani</a>, <a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>, <a href=\"https://profiles.wordpress.org/ajoah\">ajoah</a>, <a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/apmarshall\">Alex Floyd Marshall</a>, <a href=\"https://profiles.wordpress.org/alexkingorg\">Alex King</a>, <a href=\"https://profiles.wordpress.org/tellyworth\">Alex Shiels</a>, <a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>, <a href=\"https://profiles.wordpress.org/andreamiddleton\">Andrea Middleton</a>, <a href=\"https://profiles.wordpress.org/nacin\">Andrew Nacin</a>, <a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/rockwell15\">Andrew Rockwell</a>, <a href=\"https://profiles.wordpress.org/kelderic\">Andy Mercer</a>, <a href=\"https://profiles.wordpress.org/ankit-k-gupta\">Ankit K Gupta</a>, <a href=\"https://profiles.wordpress.org/arena94\">arena94</a>, <a href=\"https://profiles.wordpress.org/arshidkv12\">Arshid</a>