\"https://profiles.wordpress.org/utkarshpatel\">Utkarsh</a>, <a href=\"https://profiles.wordpress.org/vaishuagola27\">vaishu.agola27</a>, <a href=\"https://profiles.wordpress.org/vijustin\">vijustin</a>, <a href=\"https://profiles.wordpress.org/vortfu\">vortfu</a>, <a href=\"https://profiles.wordpress.org/westonruter\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/wpfo\">wpfo</a>, <a href=\"https://profiles.wordpress.org/xrmx\">xrmx</a>, <a href=\"https://profiles.wordpress.org/ze3kr\">ze3kr</a>, and <a href=\"https://profiles.wordpress.org/h3llas\">Zeljko Ascic</a>.\n<p>&nbsp;</p>\n<p>Finally, thanks to all the community translators who worked on WordPress 4.8. Their efforts bring WordPress 4.8 fully translated to 38 languages at release time with more on the way.</p>\n<p>Do you want to report on WordPress 4.8? <a href=\"https://s.w.org/images/core/4.8/wp-4-8_press-kit.zip\">We&#8217;ve compiled a press kit</a> featuring information about the release features, and some media assets to help you along.</p>\n<p>If you want to follow along or help out, check out <a href=\"https://make.wordpress.org/\">Make WordPress</a> and our <a href=\"https://make.wordpress.org/core/\">core development blog</a>. Thanks for choosing WordPress — we hope you enjoy!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jun 2017 14:49:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WPTavern: Holler Box: A Smart Notification Plugin for WordPress Websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71490\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://wptavern.com/holler-box-a-smart-notification-plugin-for-wordpress-websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4373:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/holler-box.png?ssl=1\"><img /></a></p>\n<p>Scott Bolinger, co-founder of <a href=\"http://apppresser.com/\" target=\"_blank\">AppPresser</a>, has launched a new sales and conversion tool for WordPress websites called <a href=\"http://hollerwp.com/\" target=\"_blank\">Holler Box</a>. The plugin offers a lightweight, elegant popup message for capturing email addresses, displaying a (fake) live chat, or announcing a sale or event.</p>\n<p>Bolinger designed it to be non-intrusive &#8211; it&#8217;s not the kind of modal dialog that obscures content with an animated box in the middle of the page. Holler Box appears at the bottom right-hand of the page by default.</p>\n<p>After finding other WordPress popup plugins to be too complex for his needs, Bolinger decided to create his own solution for displaying a quick notification on his websites.</p>\n<p>&#8220;I’m a developer, and even adding a simple banner or popup to my site is not easy,&#8221; Bolinger said. I have to write the code, test locally, push to staging, test there, then push to production and do a final test. When I want to remove the message, I have to reverse the process. I’m busy, and that takes time.&#8221;</p>\n<p>Bolinger made it so that creating a new Holler Box is as easy as writing a new blog post. The content editing screen includes a meta box with options for customizing the display.</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/holler-box-meta-box.png?ssl=1\"><img /></a></p>\n<p>The &#8220;Advanced Settings&#8221; meta box allows users to set pages where the notification should be displayed, limit to logged-in only or logged-out visitors, set the display for new or returning visitors, and customize the delay based on time or scrolling. It also gives options for when the Holler Box should disappear and how often it should be shown to each visitor.</p>\n<p>Holler Box is capable of a wide range of uses. A few examples include the following:</p>\n<ul>\n<li><strong>(Fake) Live Chat with Opt-in</strong>\n<p>Show a live chat box to collect customer questions and emails, without having to actually deal with the hassle of live chat. As soon as your visitor types a question, an email opt-in pops up so you can follow up with them at a convenient time.</li>\n<li><strong>Polls and Forms</strong>\n<p>Embed anything into your Holler Box, including a feedback form or poll.</li>\n<li><strong>Interactivity</strong>\n<p>Add a link, video, contact form, or simple opt-in form that integrates with major email providers like MailChimp and Convertkit.</li>\n</ul>\n<p>Below is an example of how the MailChimp email opt-in form works:</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/holler-box.gif?ssl=1\"><img /></a></p>\n<p>Holler Box also tracks impressions and conversions (link clicks and message opens) so that users can see how well their notifications are performing and optimize them as needed.</p>\n<p>The <a href=\"https://wordpress.org/plugins/holler-box/\" target=\"_blank\">free version on WordPress.org</a> has an impressive number of customization options, but Bolinger also plans to release a Pro version that will include additional features, such as an option for a header banner, more advanced display filters, automatic message deactivation, advanced email opt-in features, more conversion data, and support.</p>\n<p>&#8220;Holler Box aims to be more stylish and easier to use than existing options,&#8221; Bolinger said. &#8220;I use it when I need to make an announcement without spending a lot of time in a complex tool.&#8221; He said he could see the plugin working well side-by-side with well-established popup plugin competitors like OptinMonster.</p>\n<p>Bolinger said Holler Box is not affiliated with AppPresser, but he plans to use it as a sales tool on all of his sites. The plugin&#8217;s unique feature set is something he found missing in WordPress&#8217; marketplace for sales/conversion tools.</p>\n<p>&#8220;I think Holler Box will increase sales and conversions without being as disruptive as other popups,&#8221; Bolinger said. &#8220;The sale notification popup and faux live chat feature are really unique. It’s how I want to communicate with my audience &#8211; hopefully other people feel the same.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jun 2017 01:37:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: WPWeekly Episode 276 – Interview with Jon Brown, a Traveling Digital Nomad\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=71482&preview=true&preview_id=71482\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wptavern.com/wpweekly-episode-276-interview-with-jon-brown-a-traveling-digital-nomad\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2848:\"<p>In this episode, <a href=\"http://jjj.me/\">John James Jacoby</a> and I are joined by <a href=\"https://www.wanderingjon.com/\">Jon Brown</a>. Brown is a <a href=\"https://9seeds.com/author/jbrown/\">developer and author</a> for <a href=\"https://9seeds.com/\">9seeds</a>, a WordPress development agency. Brown describes what it&#8217;s like to work remotely and offers tips on how to stay productive while traveling. He tells us what items he can&#8217;t travel without. We also get his take on recent developments and debates going on in the WordPress community.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/open-sourcing-mental-illness-surpases-50k-fundraising-goal\">Open Sourcing Mental Illness Surpasses $50K Fundraising Goal</a><br />\n<a href=\"https://wptavern.com/vue-js-creator-evan-you-weighs-in-on-wordpress-javascript-framework-discussion\">Vue.js Creator Evan You Weighs in on WordPress JavaScript Framework Discussion</a><br />\n<a href=\"https://wptavern.com/wordcamp-europe-2017-livestream-tickets-now-available\">WordCamp Europe 2017 Livestream Tickets Now Available</a><br />\n<a href=\"https://wptavern.com/wpforms-acquires-wp-mail-smtp-plugin\">WPForms Acquires WP Mail SMTP Plugin</a><br />\n<a href=\"https://wptavern.com/versionpress-launches-versionpress-com-to-fund-open-source-project\">VersionPress Launches VersionPress.com to Fund Open Source Project</a></p>\n<h2>Picks of the Week:</h2>\n<p><a href=\"https://generatewp.com/\">GenerateWP</a> is a collection of tools that generates code for Shortcodes, Post Types, Meta Boxes, Taxonomies, Term Meta, and Post Statuses.</p>\n<p><a href=\"https://wordpress.org/plugins/holler-box/\">Holler Box</a> enables users to create customizable marketing messages to display to site visitors. Use Holler Box to convert website visitors, upsell customers, and get messages out to the right people at the right time.</p>\n<p><a href=\"https://wpperformanceprofiler.interconnectit.com/\">WP Performance Profiler</a> is a plugin by Interconnect.it that helps developers optimize the performance of WordPress sites running on PHP 5.3 to 5.6.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, June 14th 3:00 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\" rel=\"noopener\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #276:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jun 2017 01:10:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"Post Status: Teaching what you learn with Joe Casabona — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=37463\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://poststatus.com/teaching-learn-joe-casabona-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1627:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by the creator and editor of Post Status, Brian Krogsgard, and this week&#8217;s guest host, Joe Casabona.</p>\n<p>Brian and Joe discuss the way they have learned WordPress over the years, and how they’ve gone about sharing and teaching what they’ve learned. They focus mostly on front-end parts of WordPress development.</p>\n<p><a href=\"https://audio.simplecast.com/72351.mp3\">https://audio.simplecast.com/72351.mp3</a><br />\n<a href=\"https://audio.simplecast.com/72351.mp3\">Direct Download</a></p>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://wpinonemonth.com/\">WP in one month</a></li>\n<li><a href=\"https://casabona.org/\">Casabona.org</a></li>\n<li><a href=\"http://howibuilt.it/\">How I Built It</a></li>\n<li><a href=\"http://wesbos.com/\">WesBos.com</a></li>\n</ul>\n<h3>Sponsor: Yoast</h3>\n<p>Yoast SEO Premium gives you 24/7 support from a great support team and extra features such as a redirect manager, recommended internal links, tutorial videos and integration with Google Webmaster Tools! Check out <a href=\"https://yoast.com/\">Yoast SEO Premium</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jun 2017 17:33:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"Donncha: Take a sneak peek at WP Super Cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://odd.blog/?p=89500269\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://odd.blog/2017/06/07/take-a-sneak-peek-at-wp-super-cache/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4302:\"<p>WP Super Cache is a full page caching plugin for WordPress that makes your site faster, and helps deal with unexpected surges in traffic.</p>\n<p>Over the last few months we&#8217;ve been busy <a href=\"https://github.com/Automattic/wp-super-cache/\">working on the plugin</a> to add new features and fix bugs and we can almost call it ready. It&#8217;s stable and usable and runs on this site but we would love more people to test it out before we release a new version.</p>\n<p>Here&#8217;s just some of the new features and bug fixes we&#8217;ve been working on:</p>\n<ul>\n<li> The plugin was based on WP-Cache which stored cache files in a single directory, and those (legacy caching) files were for the most part stored the same way all this time but now they&#8217;re being placed in the supercache directories (<a href=\"https://github.com/Automattic/wp-super-cache/pull/177\">#177</a>). This makes it easier to manage these files. The plugin doesn&#8217;t have to search through potentially hundreds of cache files for those that need to be deleted if a page updates or someone leaves a comment. Now all those files will be in the same directory structure the anonymous &#8220;supercache&#8221; files will be. I&#8217;m really excited about this feature as it makes caching for logged in users/users who comment and caching of pages with parameters so much faster now.</li>\n<li> We&#8217;re adding a <a href=\"https://developer.wordpress.org/rest-api/\">REST API</a> to the plugin because in the future not everyone is going to use wp-admin to take care of their sites. Take a look in the <a href=\"https://github.com/Automattic/wp-super-cache/tree/master/rest\">rest directory</a> for the code we&#8217;re working on.</li>\n<li> Debug logs now have a username and password to protect them from prying eyes.</li>\n<li> And many <a href=\"https://github.com/Automattic/wp-super-cache/pulls?q=is%3Apr+is%3Aclosed\">bugs fixed</a> over the last few months.</li>\n</ul>\n<p>Since &#8220;legacy caching&#8221; or &#8220;WP-Cache caching&#8221; is now more maintainable and faster we <a href=\"https://github.com/Automattic/wp-super-cache/issues/224\">want to change the language</a> describing how the plugin caches and delivers pages. </p>\n<p><a href=\"https://odd.blog/files/2017/06/Screen-Shot-2017-06-07-at-17.35.25.png\"><img /></a></p>\n<p>Currently the plugin asks you to choose between mod_rewrite, PHP and &#8220;Legacy page caching&#8221; which isn&#8217;t really useful. Most users won&#8217;t recognise those terms. It&#8217;s also not accurate as &#8220;legacy page caching&#8221; is active all the time as long as caching is enabled.<br />\nInstead we should have &#8220;Standard Caching&#8221; and &#8220;Super Caching&#8221;. Super Caching will then have simple and expert delivery methods.</p>\n<p>Simple delivery is through PHP, while expert delivery uses mod_rewrite rules which means the .htaccess file has to be updated and hopefully the warning below it will discourage casual users from testing it.</p>\n<p>Due to the huge number of changes in the plugin we really need people to give it a try and check if everything works ok. The <a href=\"https://github.com/Automattic/wp-super-cache/pull/255\">changes to the settings page</a> will hopefully make it easier for new users to get to grips with it too.</p>\n<p>You can find the newest code <a href=\"https://github.com/Automattic/wp-super-cache\">on Github</a>. The changes to the settings page are in <a href=\"https://github.com/Automattic/wp-super-cache/pull/255\">#255</a> if you want to comment on them. </p>\n<p>Thanks in advance! 🙂</p>\n\n<p><strong>Related Posts</strong><ul><li> <a href=\"https://odd.blog/2011/10/19/preload-categories-and-custom-post-content/\" rel=\"bookmark\" title=\"Permanent Link: Preload categories and custom post content\">Preload categories and custom post content</a></li><li> <a href=\"https://odd.blog/2008/10/24/wp-super-cache-084-the-garbage-collector/\" rel=\"bookmark\" title=\"Permanent Link: WP Super Cache 0.8.4, the garbage collector\">WP Super Cache 0.8.4, the garbage collector</a></li><li> <a href=\"https://odd.blog/2009/01/09/wp-super-cache-087/\" rel=\"bookmark\" title=\"Permanent Link: WP Super Cache 0.8.7\">WP Super Cache 0.8.7</a></li></ul></p>\n<p><a href=\"https://odd.blog/\" rel=\"external nofollow\">Source</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jun 2017 17:24:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Donncha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"HeroPress: Trust The Dots\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=1890\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://heropress.com/essays/trust-the-dots/?utm_source=rss&utm_medium=rss&utm_campaign=trust-the-dots\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12678:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/06/060717-min-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: WordPress is such an amazing melting pot that involves people from everywhere, no matter how old they are, where they are from, or what languages they speak.\" /><p>I was born twice: first, as a baby boy in the sunny morning of Monday June 14, 1993 in Taiz, Yemen; and then again, in the fall of 2008. It was my first time to study at a public high school, grade 10, class 12. It was completely different than the private school I used to study at. It was big and crowded, with a minimum of 80 students in each class!</p>\n<p>At that time, I was trying to improve my personality and explore new opportunities. I wanted to live my life fully, not as the teenager that I was. A way to organize my thoughts and connect with new people was needed. I did not have a clue what to do until the moment I got the chance to use the internet and began to read online blogs of many interesting bloggers. The idea of blogging was fascinating to me. “Why not starting one?” I thought to myself.</p>\n<h3>Finding WordPress</h3>\n<p>As days passed, I met four enthusiastic and ambitious schoolmates who became my friends till now.  Mohammed, one of them, was a relatively quiet and open minded person. My mates and I got to know him through MSN Messenger, and, surprisingly, he was studying in the next class! He was very absorbed in Web Development and was working on a custom CMS platform and some other web applications for his father’s clinic. I asked him about blogging software he would recommend. He strongly recommended Joomla and also suggested Drupal, WordPress and others. I tried them all.</p>\n<blockquote><p>WordPress was so easy to use and out-of-the-box, although I had failed a few times while I was trying to install it locally. Once I had logged-in to the dashboard, honestly, I thrilled to pieces!</p></blockquote>\n<p>After some time, my friends and I decided to start a simple blog about Graphics Design using WordPress. It was my beginning to learn the basics of Web Development (HTML, CSS, Javascript and PHP). Fortunately, Mohammed had a book that he lent me, and some PDFs, that I copied. We were constantly discussing and learning from each other during break times or in the afternoons. They were enjoyable and enlightening moments.</p>\n<p>I used to receive some positive messages as the developer of the blog we started and appreciative replies to my answers for some questions in <a href=\"http://ar-wp.com\">Arab WordPress</a> community, a forum to share knowledge among Arab WordPress users. This encouraged me to start a small freelancing business with WordPress. It seemed a great idea to expand expertise, earn some money, and follow my passion!</p>\n<h3>Fitting It All In</h3>\n<p>Being a freelancer and a high-school student at the same time was not that easy as one would think! Sometimes I was working until 3:00 a.m. to finish a client project, and then woke up at 6:30 a.m. rushing to school. Most often, classes were so dry that led me to write PHP codes in every copy-book of mine! If you would like to try this at your school, remember to move yourself to the end of your class or be ready for any of your teachers’ mean reactions to keep you attentive! On several afternoons, I used to take naps to restore my energy and be ready to work at night.</p>\n<blockquote><p>Very rarely, I would have to stay out at internet cafés until 2:00 a.m. to upload/download things I needed because we had no Internet connection at home.</p></blockquote>\n<p>For sure, this made my parents quite angry and obviously worried. Most importantly, I had neither a cell phone because of some strict rules in my family nor a national ID card because of the legal age requirement in Yemen. I was attempting to use my school ID card to receive money transactions, and guess what? I was lucky enough to manage it twice. But then I was asked to present a national ID. “ When will I turn 18?” I just had to overcome that obstacle, asking trustworthy friends to help.</p>\n<p>My clients were mostly from the Arab World, Europe, and USA. I had the chance to contact with many nice and outstanding people who not only boosted my experience but also showed me the way into some new opportunities and more success.</p>\n<h3>Support At Home</h3>\n<p>At the beginning, most of my family members thought I was playing, except my MOTHER. I remember the moment I told her about my fairly new business. She said, &#8220;Regardless of what it is, just do what you love and believe in!&#8221; However, I faced hard times trying to convince her I did not smoke as she smelled cigarette on my clothes whenever I got back home from those cafés! On the other hand, my father was the kind of man who stood backstage. He used to tell his friends how happy and proud he was of me. That was all what I needed from him.</p>\n<h3>Giving Back</h3>\n<p>On August 2012, I sent a message to Rasheed Bydousi, Arab WordPress community founder and translation editor of Arabic language, to suggest some ideas and ask to be a volunteer. He was very supportive and truly wise. We started discussing and working on some ideas for more than <a href=\"http://www.ar-wp.com/forums/topic/2119/\">4 months</a>. In parallel with studying, working, and being a volunteer, I increased my efforts in translating, patching (helping in development), and reporting bugs for WordPress projects.</p>\n<blockquote><p>It was very important for me to give back to the community I had taken a lot from.</p></blockquote>\n<p>I felt the need of holding a WordPress meeting in my hometown, Taiz, because of the lack of specialized people who would like to collaborate and share knowledge. In 2013, I invited local developers to a small meeting in a local coffeeshop called “AL-Rassef”.</p>\n<p><img class=\"aligncenter wp-image-1894 size-full\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/06/wp-meeting-alraseef-coffeshop.jpg\" alt=\"WordPress Meeting in Taiz, Yemen\" width=\"960\" height=\"720\" /></p>\n<p>Afterward, I presented a lecture about WordPress at Taiz University, in the same lecture hall I used to be a student in by that time. It was a warm beginning but I couldn&#8217;t continue due to my work and the deterioration of the political and security situation.</p>\n<h3>Disruption</h3>\n<p>Since 2011, my country has been facing major political changes and instability. On April 2015, the Yemeni crisis has reached its climax and war started in my city, Taiz, and it is still going on! Some of my relatives had decided to move out of Taiz but my father chose to stay, hoping that war will stop quickly. We lived for months without public electricity or Internet. When the fight crawled to our area, we lived for weeks in the ground floor of our house, no way to go out, tanks firing from 300 meters away, airstrikes on nearby areas, and snipers shooting whoever dared to walk on streets. Many friends and innocent people were killed and some members of my family were hurt. We couldn&#8217;t sleep for days, fearing that at any moment they will knock our house door.</p>\n<p>I thought that was the end for me and all of my dreams. I was pretending to be cool and calm so my younger brother and two sisters feel better. I was telling jokes, reading books or watching movies when we got some power from my uncle generator. &#8220;Life of Pi&#8221; was one of the movies we had watched and everyone enjoyed it! I refused to hold a gun, &#8220;How could it help?! That&#8217;s not my role in life!&#8221; I was thinking.</p>\n<blockquote><p>I was struggling to believe in tomorrow, no matter how it looked miserable and sad.</p></blockquote>\n<p>In one of the mornings, after a nearby airstrike, we got a chance to escape. I tried to hold every detail of our house, neighborhood and street. &#8220;Thank you for all great memories. I will definitely return,&#8221; I told my house, feeling torn apart back then! I only took my laptop, tablet, and few clothes, they were all what I needed to start over.</p>\n<h3>Starting Over</h3>\n<blockquote><p>“You can’t connect the dots looking forward; you can only connect them looking backwards. So you have to trust that the dots will somehow connect in your future. You have to trust in something — your gut, destiny, life, karma, whatever. This approach has never let me down, and it has made all the difference in my life.”<br />\n— Steve Jobs</p></blockquote>\n<p>After some time of catching my breath, I realized that I had to connect the dots, keep on following my dreams and aim higher. On May 2016, I moved to Sana&#8217;a, the capital city of Yemen, leaving the pain and frustration behind. I got to know some enthusiastic developers and we decided to establish a community called <a href=\"https://www.facebook.com/ydevclub/\">Yemeni Developers Club</a> for people who are interested in computer programming and have the passion for it. We hold a meeting on the first Saturday of every month to share ideas, answer questions, and help one another to innovate, learn, and grow. We are planning to have, in the near future, special meetings to discuss WordPress related topics and learn how to obtain the maximum benefit from it.</p>\n<img class=\"wp-image-1895 size-full\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/06/taiz_and_sanaa_poster.jpg\" alt=\"\" width=\"768\" height=\"420\" />Photos for Ta&#8217;izz and Sana&#8217;a cites, photographed by Mona Athubhani.\n<h3>Amazing Melting Pot</h3>\n<div class=\"_h8t\">\n<div id=\"js_jl2\" class=\"_5wd9 direction_rtl\">\n<div class=\"_5wde _n4o\">\n<div class=\"_5w1r _3_om _5wdf\">\n<div class=\"_4gx_\">\n<div class=\"_d97\"><span class=\"_5yl5\">I am sure that WordPress helps thousands of developers, including me, be more independent, involves them to be parts of it, and offers opportunities to serve people from around the world.</span></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<blockquote><p>WordPress is such an amazing melting pot that contains people from everywhere, no matter how old they are, where they are from, or what languages they speak.</p></blockquote>\n<h3>Become a Hero</h3>\n<p>Being a WordPress hero is not about programming skills or contributions size, it is all about the challenges we face and overcome. It is even more about supporting the new users to be the next heroes.</p>\n<hr />\n<h3>Thank You</h3>\n<p>Thanks to all my friends who contributed to make this essay better. Many thanks to <strong>Topher DeRosia</strong> for inviting me to write here and SPECIAL THANKS to <span id=\"cch_f100e4e57d51432\" class=\"_mh6 _wsc\"><span class=\"_3oh-\"><a href=\"https://about.me/mona_athubhani\"><strong>Mona Athubhani</strong></a> without whom I would not have completed this essay.</span></span></p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Trust The Dots\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Trust%20The%20Dots&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-the-dots%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Trust The Dots\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-the-dots%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Ftrust-the-dots%2F&title=Trust+The+Dots\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Trust The Dots\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/trust-the-dots/&media=https://heropress.com/wp-content/uploads/2017/06/060717-min-150x150.jpg&description=Trust The Dots\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Trust The Dots\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/trust-the-dots/\" title=\"Trust The Dots\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/trust-the-dots/\">Trust The Dots</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jun 2017 00:00:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Nashwan Doaqan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: VersionPress Launches VersionPress.com to Fund Open Source Project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71410\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://wptavern.com/versionpress-launches-versionpress-com-to-fund-open-source-project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3005:\"<p>The founders of <a href=\"http://versionpress.net/\">VersionPress</a> have launched <a href=\"https://preview.versionpress.com/\">VersionPress.com</a>, a <a href=\"https://blog.versionpress.net/2017/06/announcing-versionpress-com/\">WordPress managed hosting</a> service. VersionPress.com is the best of what VersionPress offers paired with features such as, staging sites and backups, on an Amazon Web Services infrastructure.</p>\n<p><img />VersionPress is essentially an undo button for WordPress or full version-control. At the click of a button, users can undo an action and restore a site&#8217;s database to a previous point in history without having to export and import MySQL.</p>\n<p>Borek Bernard, co-founder of VersionPress, says the move is the result of trying to overcome two major challenges: WordPress plugins and Hosts. WordPress plugins can alter a site&#8217;s database. Building <a href=\"https://github.com/versionpress/versionpress/blob/master/docs/Plugin-Support.md\">in support</a> for the 40K+ plugins that exist in the repository has been a huge undertaking for the team.</p>\n<p>In order to use VersionPress, a webhost needs to have <a href=\"https://git-scm.com/\">Git</a> installed and allow proc_open which it uses to interact with Git. Most hosts do not allow proc_open for security reasons or have older versions of Git installed, generating incompatibilities. &#8220;Over time, it became clear we needed our own environment to run VersionPress in,&#8221; Bernard said.</p>\n<p>All sites hosted on the platform run PHP 7 or Nginx, HTTP/2, and at least two Docker instances that auto-scale based on load. VersionPress.com includes the ability to set up staging and production sites using VersionPress&#8217; capabilities to merge changes between the two. Similar to <a href=\"https://getflywheel.com/why-flywheel/client-billing-transfer/\">Flywheel</a>, billing can be assigned to a developer, agency, or client account. &#8220;The platform is geared towards WordPress developers and agencies but will help anyone who wants a fast, reliable WordPress site,&#8221; Bernard said.</p>\n<p>The model they&#8217;re using is similar to WordPress.com and self-hosted WordPress. &#8220;A hosted service will provide resources to fund the development of the open source project and its long-term stability,&#8221; he said. &#8220;So it became a no-brainer at some point.&#8221; General availability for VersionPress.com won&#8217;t open until July but those who <a href=\"https://preview.versionpress.com/#preorder\">pre-order</a> will receive a substantial discount.</p>\n<p>Bernard re-iterated that VersionPress will always be a free, open source project and that VersionPress.com is a major step towards bringing full version control of WordPress to the masses.</p>\n<p>The managed WordPress hosting space is well established and perhaps a bit crowded. It will be interesting to see how VersionPress.com compares to and fits in with the competition.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jun 2017 21:45:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Matt: Remote Work Can’t Be Stopped\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=47433\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://ma.tt/2017/06/remote-work-cant-be-stopped/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:489:\"<p>Christopher Mims writes for the Wall Street Journal <a href=\"https://www.wsj.com/articles/why-remote-work-cant-be-stopped-1496577602?mg=prod/accounts-wsj\">Why Remote Work Can&#8217;t Be Stopped</a>, also riffing off the <a href=\"https://ma.tt/2017/05/ibm-goes-non-remote/\">IBM shift I wrote about a few weeks ago</a>. I was exciting to see an <a href=\"https://automattic.com/\">Automattician</a> Julia featured at the top and a few other colleagues having their voice in the article.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jun 2017 21:14:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WPTavern: WPForms Acquires WP Mail SMTP Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71426\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://wptavern.com/wpforms-acquires-wp-mail-smtp-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4349:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/wpforms.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://wpforms.com/\" target=\"_blank\">WPForms</a>, founded by Syed Balkhi, has <a href=\"https://wpforms.com/welcoming-wp-mail-smtp-to-the-wpforms-family/\" target=\"_blank\">acquired the free WP Mail SMTP plugin</a> from WordPress plugin developer <a href=\"https://www.callum-macdonald.com/\" target=\"_blank\">Callum MacDonald</a>. <a href=\"https://wordpress.org/plugins/wp-mail-smtp/\" target=\"_blank\">WP Mail SMTP</a> has more than 600,000 active installs and WPForms will allow it to continue to operate as an independent plugin on WordPress.org. Balkhi said the plugin will become the company&#8217;s go-to recommendation on WPForms as well as WPBeginner.</p>\n<p>Email deliverability is a common problem for all types of WordPress websites, but it is the most frequent support issue for those using WPForms.</p>\n<p>&#8220;The number is only growing as Gmail, Yahoo, and others implement aggressive filters to reduce spam,&#8221; Balkhi said. &#8220;These spam filters look to see whether an email is originating from the location it claims to be originating from. This causes the emails sent from your WordPress site to either go in the spam folder or sometimes not be delivered at all! Having a proper SMTP solution significantly increases email deliverability. I believe that once we implement the new UX and workflow, this will significantly reduce our support load since this is the #1 issue our users deal with.&#8221;</p>\n<p>After a few months of email exchanges, Balkhi and Callum MacDonald reached an agreement for WPForms to purchase WP Mail SMTP. Balkhi would not disclose the exact financial details of the acquisition but said it was &#8220;a five-figure-deal because the plugin itself did not generate any revenue.&#8221;</p>\n<p>MacDonald had considered monetizing the plugin in the past but saw too many hurdles as he became less active in the WordPress space over the past few years.</p>\n<p>&#8220;There are a few recent developments around SMTP that mean the plugin could use an update,&#8221; MacDonald said. &#8220;I didn&#8217;t have the time, so it made sense to move on at this point. I went over [monetizing] it several times. My conclusion is that it&#8217;s a lot harder than it looks. If I was still active in the WordPress space, it would make more sense, but I&#8217;m not, so monetizing was going to be a long road and hard work. It made more sense to sell.&#8221;</p>\n<p>Balkhi said he approached MacDonald because email deliverability was a problem that he was looking to solve for WPForms users as well as the larger WPBeginner and WordPress community.</p>\n<p>&#8220;We didn&#8217;t want to build an add-on for WPForms because the problem isn&#8217;t unique to just us,&#8221; Balkhi said. &#8220;It affects every form plugin and basically every WordPress website that sends an email of any kind (forgot password, user registration, etc).&#8221;</p>\n<p>Last year Balkhi and his team acquired <a href=\"https://wptavern.com/syed-balkhi-acquires-google-analytics-by-yoast-renames-to-monsterinsights\" target=\"_blank\">Yoast&#8217;s Google Analytics and renamed it to MonsterInsights</a>. Over the past year the plugin has continued its growth from 10 million downloads at the time of acquisition to more than 16 million today.</p>\n<p>Balkhi reports that the MonsterInsights acquisition has been a success but the product was a very different type of acquisition from the one announced today. He said he has no plans to build an email deliverability service but rather wants to invest in a solution that will help his customers and others in the WordPress community.</p>\n<p>WP Mail SMTP plugin users can expect improvements to the plugin and a more &#8220;beginner-friendly&#8221; redesign, which Balkhi anticipates to release at the end of Q3 or Q4 of 2017.</p>\n<p>&#8220;In terms of growing our WPForms&#8217; user base through WP Mail SMTP, that&#8217;s not our primary goal,&#8221; Balkhi said. &#8220;Our top priority is to solve the email deliverability issue that our existing users and the larger WordPress community faces.&#8221; Balkhi said he hopes to leverage the 600,000+ user base to negotiate better deals with established email deliverability services.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jun 2017 20:12:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: Cory Miller and Dr. Sherry Walling Launch ZenTribes an Entrepreneur Peer Group\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71006\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wptavern.com/cory-miller-and-dr-sherry-walling-launch-zentribes-an-entrepreneur-peer-group\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3202:\"<p>Being an entrepreneur can be stressful, emotional, and lonely, especially during a rough part of life. Cory Miller, founder of <a href=\"https://ithemes.com/\">iThemes</a>, has been at the forefront of <a href=\"https://wordpress.tv/2016/12/10/cory-miller-managing-your-iceberg/\">advocating</a> that entrepreneurs don&#8217;t have to go through the struggles of running a business alone.</p>\n<p>Two years after founding iThemes, Miller found himself going through a tough divorce at the same time his company started taking off.</p>\n<p>&#8220;Not many people in my life at that time could come close to relating to what I was going through as a human combined with being an entrepreneur,&#8221; Miller said.</p>\n<p>&#8220;I was suffering in solitude. And I was craving authentic relationships with like-minded people on a similar path who knew what living the entrepreneurial life — with its sometimes drastic ups and downs — meant and who were walking it every day, like me, and wanted to walk together with others too.&#8221;</p>\n<p>Miller eventually found himself in an <a href=\"http://corymiller.com/find-belonging-support-entrepreneurial-peer-group/\">entrepreneur peer group</a> in Oklahoma City, OK, where entrepreneurs meet once a month for three hours to discuss the trials and tribulations of running a business.</p>\n<p>Miller says the group is partially responsible for his good health and happiness as a business owner, father, husband, and human being.</p>\n<p>In an effort to create similar opportunities for other business owners, Miller has partnered with <a href=\"http://www.sherrywalling.com/\">Dr. Sherry Walling</a>, who has a PhD in Psychology, to launch <a href=\"http://zenfounder.com/zentribes/\">ZenTribes</a>.</p>\n<p>ZenTribes is a group of 6-9 like-minded entrepreneurs that get together once a month online to share stories, encouragement, and express support for one another. Walling and Miller are both members of the group and will be sharing their expertise with members.</p>\n<p>Meetings will take place every Wednesday from 1-2:30 PM Central Standard Time for eight weeks using <a href=\"https://zoom.us/\">Zoom</a>. The first meeting is on July 12th. The last meeting is on August 30th.</p>\n<p>The first 15 minutes of meetings will focus on a key topic with an hour set aside for discussions and sharing experiences related to that topic. The last 15 minutes are dedicated to sharing resources and giving attendees suggested homework.</p>\n<p>Some of the topics that will be discussed include:</p>\n<ul>\n<li>Burnout</li>\n<li>Depression</li>\n<li>Conflict</li>\n<li>Failure and loss</li>\n<li>Loneliness and friendship</li>\n</ul>\n<p>ZenTribes is <a href=\"http://zenfounder.com/zentribes/apply/\">accepting applications</a> for the first group of people until 1 PM CST June 15th. The cost to be a member of the group is $799. For more information about this initiative, <a href=\"http://zenfounder.com/episodes/episode-120-announcing-zentribes/\">listen to episode 120</a> of the ZenFounder podcast. In it, Miller and Sherry describe the program, why they created it, and how entrepreneurial groups can benefit business owners.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jun 2017 17:35:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Safe Avocado-ing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=47427\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"https://ma.tt/2017/06/safe-avocado-ing/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:460:\"<p>I&#8217;m glad <a href=\"https://www.nytimes.com/2017/05/01/dining/avocado-injuries-cutting-safety.html?_r=2\">the New York Times is covering how to safely cut an avocado</a>, because I&#8217;ve messed that up 100% of the time I&#8217;ve tried to handle an avocado in the past month. It makes you almost want to forgive them for that <a href=\"https://www.eater.com/2017/3/14/14905200/pea-guacamole-controversy-melissa-clark\">green pea guacamole thing</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jun 2017 04:07:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: WordCamp Europe 2017 Livestream Tickets Now Available\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71286\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wptavern.com/wordcamp-europe-2017-livestream-tickets-now-available\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1075:\"<p>WordCamp Europe will be livestreaming all sessions again this year to make the event accessible to those who are unable to travel to Paris. Live stream tickets are free, but viewers must sign up on the <a href=\"https://2017.europe.wordcamp.org/tickets/\" target=\"_blank\">tickets page</a>.</p>\n<p>Organizers have also set up a page on the event&#8217;s website for people to advertise for <a href=\"https://2017.europe.wordcamp.org/2017/06/02/got-a-wceu-ticket-to-sale-let-others-know/\" target=\"_blank\">buying or selling tickets</a>. Many who have already purchased regular tickets have had a last-minute change of plans, problems with obtaining a visa, or have an extra ticket due to being selected as a speaker or a volunteer. More than two dozen tickets have already been posted for sale.</p>\n<p>Regular ticket sales concluded at the end of May, but there are 2,915 livestreaming <a href=\"https://2017.europe.wordcamp.org/tickets/\" target=\"_blank\">tickets remaining</a>, along with 272 micro-sponsorship slots at € 150.00 apiece.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jun 2017 20:07:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: Vue.js Creator Evan You Weighs in on WordPress JavaScript Framework Discussion\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71279\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://wptavern.com/vue-js-creator-evan-you-weighs-in-on-wordpress-javascript-framework-discussion\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8193:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2017/06/evan-you.png?ssl=1\"><img /></a>photo credit: <a href=\"https://www.youtube.com/watch?v=EiTORdpGqns\">JSConf China</a>\n<p>Last week WordPress core contributors <a href=\"https://wptavern.com/wordpress-core-javascript-framework-debate-heats-up-contributors-narrow-discussion-to-react-vs-vue\" target=\"_blank\">narrowed their considerations for a new JavaScript framework to React and Vue</a>. As the core team has more collective knowledge of working with React, they have reached out to developers with different experiences of using other frameworks in a  WordPress context.</p>\n<p>One of the chief concerns contributors have regarding Vue is the longevity of the project. I asked Vue creator <a href=\"http://evanyou.me/\" target=\"_blank\">Evan You</a> if he could weigh in on the topic to give WordPress contributors a better understanding of the project, specifically regarding his efforts to cultivate additional maintainers to help share the load of maintainership.</p>\n<p>&#8220;I think it&#8217;s important to look at the track record &#8211; Vue has been around for almost 4 years, and all the work has been done in public on GitHub so anyone can go and check the maintenance history,&#8221; You said. &#8220;While it has been largely developed by me, the current maintenance is a lot more community-driven. We have active core team members triaging most of the issues and a larger and larger percentage of the issues fixed by community PRs. So &#8211; yes, I had already been working on cultivating additional maintainers and will continue to do so.&#8221;</p>\n<p>You currently receives <a href=\"https://www.patreon.com/evanyou\" target=\"_blank\">$10K/month from recurring Patreon donations</a> that fund his full-time efforts working on Vue. Prior to this he also worked at Google and Meteor. During his time at Google, some of the projects You worked on used Angular, which he said he found to be too heavy for his use cases at the time. He built Vue.js to be a more lightweight implementation of the concepts that he liked about Angular.</p>\n<p>You also recently said he has learned quite a bit from the React community, which has influenced some of his technical decisions in Vue 2.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">I learned a lot from the React community &#8211; on both code and people. I hope everyone can be like <a href=\"https://twitter.com/dan_abramov\">@dan_abramov</a>. Peace.</p>\n<p>&mdash; Evan You (@youyuxi) <a href=\"https://twitter.com/youyuxi/status/869020366705799168\">May 29, 2017</a></p></blockquote>\n<p></p>\n<p>&#8220;First, Vue 2 uses the same Virtual DOM based rendering model underneath, which was first pioneered by React,&#8221; You said. &#8220;Introducing a Virtual DOM allowed Vue to expose the power of vdom composition while maintaining the approachability.</p>\n<p>&#8220;The React community is also very active when there are new problem domains being explored &#8211; e.g. state management and CSS management. There are many competing solutions and a lot of inspirations when I was implementing official solutions for Vue.&#8221;</p>\n<h3>Evan You Addresses WordPress Core Contributors&#8217; Misconceptions about Vue.js</h3>\n<p>You said he has been following WordPress contributors&#8217; discussions on React vs Vue but would not offer an opinion on which is a better choice for the project.</p>\n<p>&#8220;My answer would obviously be biased, and honestly I&#8217;m not in the shoes of the WP core team so I don&#8217;t have enough perspective to make a choice,&#8221; You said. &#8220;However, I can provide feedback on some of the issues being discussed in hope of helping them make a better-informed decision.&#8221;</p>\n<p>You left a <a href=\"https://make.wordpress.org/core/2017/05/31/javascript-chat-summary-for-may-30th/#comment-32642\" target=\"_blank\">comment</a> on the most recent Javascript meeting notes with clarifications on a few misunderstandings about Vue.js. You addressed the point regarding &#8220;embracing JavaScript the language,&#8221; as some contributors think Vue&#8217;s templating language obscures the underlying JavaScript.</p>\n<p>&#8220;I think &#8217;embracing JavaScript the language&#8217; is another primitive of React we don’t see in Vue,&#8221; Andrew Duthie <a href=\"https://wordpress.slack.com/archives/C02RQBWTW/p1496150274570299\" target=\"_blank\">said</a> during the last meeting.</p>\n<p>You&#8217;s reply compares Vue&#8217;s use of templates as &#8220;syntax sugar for view representation on top of HTML&#8221; to what he believes to be a similar usage in the case of JSX as view representation on top of JavaScript:</p>\n<blockquote><p>The increasing richness of UI does NOT necessitate putting everything in JavaScript. On the other hand, just because Vue uses templates by default doesn’t mean it allows people to get by without learning JavaScript properly.</p>\n<p>Vue’s templates are compiled into JavaScript render functions under the hood and they are actually closer to JavaScript than to traditional string templating. It’s just a layer of syntax sugar on top of the underlying Virtual DOM representation. Think of JSX as syntax sugar for view representation on top of JS; Vue templates are syntax sugar for view representation on top of HTML.</p>\n<p>JSX/Raw JS does provide more flexibility when you need to apply direct manipulation of Virtual DOM nodes, this is why Vue also supports render functions. But this is not putting two opposing paradigms under the same tent – it’s simply allowing the user to skip the syntax sugar layer for more control.</p></blockquote>\n<p>You said the idea behind templating on top of render functions is to provide &#8220;better approachability,&#8221; a concern shared by many other proponents of WordPress adopting Vue.</p>\n<p>&#8220;Users who are more comfortable with HTML and have simpler use cases could use the template, while users who are already familiar of JSX/render functions can leverage the full power of JS,&#8221; You said. &#8220;This would fit pretty nicely for the use of WP core: community users who care about approachability have an easier time getting started, while the core team have access to JSX/render functions for advanced use cases.&#8221;</p>\n<p>You also addressed the concern of longevity by offering more information on Vue&#8217;s development processes. He confirmed that the current codebase is largely developed by him alone, but maintenance is spread across a core team with members all over the world.</p>\n<p>&#8220;Other contributors have lower commit counts because their contributions are all submitted in the form of PRs and we use the &#8216;Squash and commit&#8217; feature on GitHub so each PR results in only one commit for the contributor,&#8221; You said. &#8220;We’ve merged close to 500 PRs in the core repo alone, and many more across the organization. Other repos under the vuejs organization, e.g. vuex, vue-router, vuejs.org are also largely maintained by dedicated team members.&#8221;</p>\n<p>You also offered clarification on questions of stability and future compatibility, as WordPress contributors presented concerns regarding breaking changes in the templating language in Vue 2.0.</p>\n<p>&#8220;This begs for some clarification: Vue versioning strictly follows semver,&#8221; You said. &#8220;The only time there had been breaking API changes post 1.0 was the 2.0 bump. The template syntax is part of the API so it’s not going to [break], and in between major version bumps we commit to 100% API backwards compatibility. We take stability very seriously, so do our community and in-production users, including GitLab, Vice, and some of the biggest internet companies in China.&#8221;</p>\n<p>As many WordPress core contributors have been developing on top of React for years, You&#8217;s input offers a more detailed, in-depth look at Vue that contributors have been asking for during various rounds of feedback. The discussion will continue over the next several weeks and contributors plan to include the topic at WordCamp Europe&#8217;s contributor summit.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jun 2017 18:04:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: Open Sourcing Mental Illness Surpasses $50K Fundraising Goal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71138\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wptavern.com/open-sourcing-mental-illness-surpases-50k-fundraising-goal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3035:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/mental-health-in-tech-2016.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://osmihelp.org/\" target=\"_blank\">Open Sourcing Mental Illness</a> (OSMI), a non-profit organization that raises mental health awareness in the tech community, has <a href=\"https://osmihelp.org/blog/fundraising-2017-recap\" target=\"_blank\">surpassed its $50K fundraising goal</a> for 2017. Ed Finkler, who founded OSMI in 2013, left his position as CTO of <a href=\"https://www.graphstory.com/\" target=\"_blank\">Graph Story</a> to work full-time on speaking, educating, and providing resources to support mental wellness in the tech and open source communities. As of today, the campaign has raised more than $58,000.</p>\n<p>In addition to donations from individuals, OSMI has added several corporate sponsors, including CakeDC, Github, Digital Ocean, and Laravel. CakeDC has designated $1,000/month for 12 months to support Finkler&#8217;s salary. Finkler works together with a board of directors and a team of volunteers who also speak at conferences about mental health in tech. Several WordPress companies have also been involved in raising support for OSMI, including <a href=\"https://www.youcaring.com/opensourcingmentalillness-704978\" target=\"_blank\">WebDevStudios</a> and <a href=\"https://wptavern.com/wp-elevation-is-focusing-all-content-on-mental-health-for-month-of-may\" target=\"_blank\">WP Elevation</a>.</p>\n<p>OSMI conducts an annual Mental Health in Tech survey as part of ongoing research. Last year&#8217;s survey received more than 1,500 responses and the results underscore the great need for removing the stigma surrounding mental illness in the tech industry. A few examples Finkler highlighted include:</p>\n<ul>\n<li>Respondents believe it&#8217;s 6 times more likely that discussing a mental health issue with their employer would have a negative consequence, vs a physical health issue.</li>\n<li>Respondents are 3.5 times less likely to bring up a mental health issue in an interview than a physical health issue.</li>\n<li>87% believe being identified as a person with a mental health issue would hurt their career.</li>\n<li>Only 30% of respondents&#8217; employers provide information about mental health and how to seek help.</li>\n</ul>\n<p>OSMI offers all of the resources it creates for free. The funds raised in the campaign will help to create more tools, documents, videos, and other educational resources. Finkler is working towards engaging with more HR departments and educating more executive teams. He also plans to use the funds to do more research and employ additional experts to reach more people.</p>\n<p>For more information about OSMI&#8217;s efforts to improve mental health in the tech industry, check out Jeff Chandler&#8217;s <a href=\"https://wptavern.com/wpweekly-episode-273-mental-health-awareness-with-bridget-willard-and-ed-finkler\" target=\"_blank\">recent interview with Finkler on the WP Weekly podcast</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 03 Jun 2017 03:59:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"WPTavern: In Case You Missed It – Issue 21\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=71142&preview=true&preview_id=71142\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://wptavern.com/in-case-you-missed-it-issue-21\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6022:\"<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?ssl=1\" rel=\"attachment wp-att-50955\"><img /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>There’s a lot of great WordPress content published in the community but not all of it is featured on the Tavern. This post is an assortment of items related to WordPress that caught my eye but didn’t make it into a full post.</p>\n<h2>Bob Dunn and Patrick Rauland Host Lift Off Summit</h2>\n<p><a href=\"https://bobwp.com\">Bob Dunn</a> and <a href=\"https://www.speakinginbytes.com/\">Patrick Rauland</a> have partnered up for <a href=\"https://www.liftoffsummit.com/\">Lift Off Summit</a>. Between June 19-23, visitors will be able to watch 3-4 videos per day focused on getting more traffic, increasing social interactions, and keeping customers to their online stores. The virtual conference is free to watch.</p>\n<h2>The Evolution of WordPress Magazine Themes</h2>\n<p>Alex Denning takes a look back at the <a href=\"http://www.wpzoom.com/case-studies/magazine-themes-whats-next/\">evolution of WordPress magazine themes</a> over the last 10 years and offers insights into what might be next for the style.</p>\n<p>WordPress magazine themes were a huge deal between 2009-2011. Brian Gardner was able to create a profitable business with a single magazine style theme called Revolution, one of the first themes to display content in ways different from the typical single column blog layout.</p>\n<p>Magazine themes are a great chapter of WordPress&#8217; history. Their popularity is why WordPress has featured images and automatic thumbnail generation in core.</p>\n<h2>Highlights From Season Four of ManageWP&#8217;s Ask Me Anything</h2>\n<p>ManageWP <a href=\"https://managewp.com/ama-season-4-highlights\">published highlights</a> from season four of Ask Me Anything, a weekly event where members of the WordPress community voluntarily answer any questions submitted.</p>\n<h2>WordPress 4.8 Field Guide</h2>\n<p>Everything you need to know to prepare for WordPress 4.8, tentatively scheduled for release on June 8th, is in <a href=\"https://make.wordpress.org/core/2017/05/26/wordpress-4-8-field-guide/\">the field guide</a>.</p>\n<h2>Take the WPCampus WordPress in Higher Education Survey</h2>\n<p>WPCampus is once again asking for those who work with WordPress in educational settings to fill out the <a href=\"https://www.surveymonkey.com/r/wpcampus17\">following survey</a>. This year, three randomly selected participants will receive a free ticket to attend WPCampus in Buffalo, NY, July 14-15.</p>\n<p>The data will be used to create a series of reports on how WordPress is used in public schools and higher education. <a href=\"https://wptavern.com/wpcampus-survey-results-indicate-misconceptions-of-wordpress-are-slowing-its-growth-in-higher-education\">Last year&#8217;s survey</a> indicated that misconceptions surrounding WordPress security and scalability are slowing its growth in higher education.</p>\n<h2>A Plugin for Monitoring Directory Sizes</h2>\n<p>David Bisset shared a dashboard widget that displays the sizes of directories.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">WordPress dashboard widget that displays directory sizes, in case you need to keep an eye on that for some reason. <a href=\"https://t.co/eWu6cxtze7\">https://t.co/eWu6cxtze7</a> <a href=\"https://t.co/bPOgXVkwvL\">pic.twitter.com/bPOgXVkwvL</a></p>\n<p>&mdash; David Bisset (@dimensionmedia) <a href=\"https://twitter.com/dimensionmedia/status/870081713036181504\">June 1, 2017</a></p></blockquote>\n<p></p>\n<h2>Stop Signup Spam Integrates with GiveWP</h2>\n<p><a href=\"https://wordpress.org/plugins/stop-signup-spam/\">Stop Signup Spam</a>, a plugin we <a href=\"https://wptavern.com/new-wordpress-plugin-blocks-spam-user-registrations-using-stop-forum-spam-database\">featured last month</a> now integrates with GiveWP.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">My \"Stop Signup Spam\" plugin now integrates with <a href=\"https://twitter.com/GiveWP\">@GiveWP</a>, thanks to a contribution from <a href=\"https://twitter.com/learnwithmattc\">@learnwithmattc</a>! <a href=\"https://t.co/hmHBxxKEki\">https://t.co/hmHBxxKEki</a></p>\n<p>&mdash; Leland Fiegel (@lelandf) <a href=\"https://twitter.com/lelandf/status/869976727912579073\">May 31, 2017</a></p></blockquote>\n<p></p>\n<h2>LED WordPress Badge</h2>\n<p>George Stephanis unveiled his wifi-enabled light up WordPress badge on Twitter. He ordered the parts and soldered them together himself. You&#8217;ll get to see it in person if you&#8217;re attending <a href=\"https://2017.kyoto.wordcamp.org/\">WordCamp Kyoto</a>.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">IT IS ALIIIIIIIVE! I\'ll be debuting my shiny new (wifi-enabled, esp-8266 powered) WordPress badge in ONE MONTH at <a href=\"https://twitter.com/wckyoto2017\">@wckyoto2017</a>! <a href=\"https://t.co/P7WZmQUf9z\">pic.twitter.com/P7WZmQUf9z</a></p>\n<p>&mdash; george ﬆephanis (@daljo628) <a href=\"https://twitter.com/daljo628/status/869653149245747201\">May 30, 2017</a></p></blockquote>\n<p></p>\n<h2>Wabster!</h2>\n<p>In what is a traditional part of this series, I end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project. This week&#8217;s edition features a variation of the Wapuu design. <a href=\"https://wapu.us/wapuu/wabster/\">Wabster</a>, created by Alison Knott, is the <a href=\"https://2017.halifax.wordcamp.org/2017/04/05/welcome-lobster-wapuu-wordcamp-halifaxs-official-mascot/\">mascot of WordCamp Halifax</a>.</p>\n<p><img /></p>\n<p>That&#8217;s it for issue twenty-one. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Jun 2017 20:23:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: Chassis Desktop Application for Local WordPress Development Now in Beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71126\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wptavern.com/chassis-desktop-application-for-local-wordpress-development-now-in-beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2112:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/chassis-desktop.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://hmn.md/\" target=\"_blank\">Human Made</a> has released its first public beta of <a href=\"http://beta.chassis.io/\" target=\"_blank\">Chassis Desktop</a>, an application for local WordPress development. <a href=\"https://github.com/Chassis/Chassis/\" target=\"_blank\">Chassis</a> is a Vagrant-based virtual server and a community project that Human Made has commercially supported since 2012. The new desktop app is in early beta at version 0.2.0 with version 1.0.0 coming soon.</p>\n<p>Chassis Desktop was designed with a user-friendly interface suitable for beginners and experts alike. It was built by Bronson Quick and Ryan McCue using <a href=\"http://electron.atom.io/\" target=\"_blank\">Electron</a> and contains code from the <a href=\"https://github.com/facebookincubator/create-react-app\" target=\"_blank\">create-react-app</a> project.</p>\n<p>On first launch the app makes sure that Vagrant and VirtualBox are installed and then guides the user to create a new box. Setting up a new Chassis install or adding Chassis to an existing install is fast and easy with the simple UI. The app also includes keyboard navigation and a built-in terminal for quick access to more control over your box.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2017/06/add-new-box.png?ssl=1\"><img /></a></p>\n<p>Over the years Chassis contributors have created an ecosystem of <a href=\"http://beta.chassis.io/extensions/\" target=\"_blank\">extensions</a> for things like MailHog, Photon, Memcache, debugging, and other software. These add-ons allow users to tailor their systems to their needs.</p>\n<p>Chassis Desktop aims to make it easy for users to manager their Chassis development environments without having to touch the command line. As it is currently in pre-release status, early adopters may discover some bugs. Beta testers are encouraged to <a href=\"https://github.com/Chassis/Desktop/issues\" target=\"_blank\">log any issues on GitHub</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 02 Jun 2017 03:24:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Dev Blog: WordPress 4.8 Release Candidate 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4765\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wordpress.org/news/2017/06/wordpress-4-8-release-candidate-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1160:\"<p>The second release candidate for WordPress 4.8 is now available.</p>\n<p>To test WordPress 4.8, you can use the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin or you can <a href=\"https://wordpress.org/wordpress-4.8-RC2.zip\">download the release candidate here</a> (zip).</p>\n<p>We&#8217;ve made <a href=\"https://core.trac.wordpress.org/log/trunk/?action=stop_on_copy&mode=stop_on_copy&rev=40866&stop_rev=40847\">a handful of changes</a> since releasing RC 1 last week. For more details about what&#8217;s new in version 4.8, check out the <a href=\"https://wordpress.org/news/2017/05/wordpress-4-8-beta-1/\">Beta 1</a>, <a href=\"https://wordpress.org/news/2017/05/wordpress-4-8-beta-2/\">Beta 2</a>, and <a href=\"https://wordpress.org/news/2017/05/wordpress-4-8-release-candidate/\">RC1</a> blog posts.</p>\n<p><strong>Think you&#8217;ve found a bug?</strong> Please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta support forum</a>. If any known issues come up, you&#8217;ll be able to <a href=\"https://core.trac.wordpress.org/report/5\">find them here</a>.</p>\n<p>Happy testing!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Jun 2017 22:13:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Mel Choyce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Inpsyde Open Sources Wonolog, a Monolog-based Logging Package for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71109\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://wptavern.com/inpsyde-open-sources-wonolog-a-monolog-based-logging-package-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1721:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/06/wonolog.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://inpsyde.com\" target=\"_blank\">Inpsyde</a>, a WordPress agency and WordPress.com VIP partner based in Germany, has open sourced <a href=\"https://inpsyde.com/en/wonolog-wordpress-logging-library/\" target=\"_blank\">Wonolog</a>, a package that integrates Monolog for sophisticated WordPress data logging. <a href=\"https://seldaek.github.io/monolog/\" target=\"_blank\">Monolog</a> is the most widely used PHP logging library with more than 57 million downloads to date.</p>\n<p>Wonolog automatically creates logs that target specific WordPress requests and can be customized with action and filter hooks. Here are a few examples of WordPress data it can log:</p>\n<ul>\n<li>Log any failed logins</li>\n<li>Keep track of all WordPress cron requests</li>\n<li>Intercept the WordPress-specific exit function, wp_die(), and log any (direct or indirect) usage</li>\n<li>PHP core notices, warnings and (fatal) errors, uncaught exceptions (as well as PHP 7+ Throwable)</li>\n<li>WordPress core errors such as database errors, HTTP API errors, wp_mail() errors, and 404 errors</li>\n</ul>\n<p>Wonolog is available as a Composer package and its creators recommend installing at the website level. Inpsyde has been using it successfully in production with different projects for several months. Wonolog requires PHP 5.6 or higher and WordPress 4.6+. A <a href=\"https://inpsyde.github.io/Wonolog/\" target=\"_blank\">documentation site</a> is available to help new users get started and the project can be found on <a href=\"https://github.com/inpsyde/Wonolog\" target=\"_blank\">GitHub</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Jun 2017 20:54:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: WPWeekly Episode 275 – The JavaScript Framework Rabbit Hole\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=71102&preview=true&preview_id=71102\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wptavern.com/wpweekly-episode-275-the-javascript-framework-rabbit-hole\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2549:\"<p>In this episode, <a href=\"http://jjj.me/\">John James Jacoby</a> and I celebrate WordPress&#8217; 14th birthday. We discuss the removal of HHVM from WordPress&#8217; testing infrastructure and how it was likely the reason PHP 7 gained so many performance improvements.</p>\n<p>For a majority of the show, Jacoby and I spoke in-depth on which JavaScript framework WordPress core should choose. We discuss what&#8217;s at stake, who might be impacted, and why the discussion and eventual decision is important for WordPress&#8217; future. To round out the show, we share our picks of the week and let you know about <a href=\"https://central.wordcamp.org/\">upcoming WordCamps</a>.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://ma.tt/2017/05/wordpress-14/\">WordPress Turns 14</a><br />\n<a href=\"https://wptavern.com/wordpress-removes-hhvm-from-testing-infrastructure\">WordPress Removes HHVM from Testing Infrastructure</a><br />\n<a href=\"https://wptavern.com/wordpress-core-javascript-framework-debate-heats-up-contributors-narrow-discussion-to-react-vs-vue\">WordPress Core JavaScript Framework Debate Heats Up, Contributors Narrow Discussion to React vs. Vue</a></p>\n<h2>Picks of the Week:</h2>\n<p><a href=\"https://wapu.us/\">Wapu.us</a>, created by James Tryon, is a place to discover and learn about Wapuu, the unofficial mascot of the WordPress project.</p>\n<p><a href=\"https://github.com/humanmade/Cavalcade\">Cavalcade</a> is a scalable job system, designed as a drop-in replacement for WordPress’ built-in pseudo-cron system <a href=\"https://engineering.hmn.md/projects/cavalcade/\">created by Human Made</a>.</p>\n<p><a href=\"https://givewp.com/\">Give</a> is a free WordPress donation management plugin by <a href=\"https://wordimpress.com/\">WordImpress.</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, June 7th 3:00 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\" rel=\"noopener noreferrer\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\" rel=\"noopener noreferrer\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\" rel=\"noopener noreferrer\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #275:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Jun 2017 01:09:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: WP-CLI 1.2.0 Released, Project Unveils New Logo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71086\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wptavern.com/wp-cli-1-2-0-released-project-unveils-new-logo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3398:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/05/wp-cli-logo.png?ssl=1\"><img /></a></p>\n<p><a href=\"https://make.wordpress.org/cli/2017/05/31/version-1-2-0-released/\" target=\"_blank\">WP-CLI 1.2.0</a> was released today with a major overhaul that removes bundled commands from core in favor of maintaining them in distinct packages. This is the second release since the project was <a href=\"https://wptavern.com/wp-cli-gets-official-wordpress-org-support\" target=\"_blank\">brought under the official WordPress umbrella</a> and the first major release since <a href=\"https://wptavern.com/wp-cli-names-alain-schlesser-new-co-maintainer\" target=\"_blank\">hiring Alain Schlesser as a part-time co-maintainer</a>.</p>\n<p>Splitting WP-CLI&#8217;s internal commands into separate packages moves the project closer to the goal of having official maintainers for the commands in the future. This new structure for the framework and its commands provides several benefits, as outlined by co-maintainer Daniel Bachhuber in the release post:</p>\n<ul>\n<li>While developing, the tests are only run for the specific component you’re working on, making the feedback loop much shorter.</li>\n<li>Individual command packages can be controlled and set up independently, opening up the opportunity for better collaboration.</li>\n<li>Hotfixes and intermediary releases can be published for individual commands, that can then be updated through the built-in package manager.</li>\n<li>Tests run really fast now.</li>\n<li>When you submit a pull request, you don’t have to wait two hours for the tests to run.</li>\n</ul>\n<p>This release also includes three new commands, along with dozens of command improvements and framework enhancements.</p>\n<ul>\n<li><code>wp config get</code> lists constants and globals defined in wp-config.php</li>\n<li><code>wp config path</code> gets the path to wp-config.php</li>\n<li><code>wp db size</code> gets the size of the database and its tables</li>\n</ul>\n<p>Version 1.2.0 had 43 contributors, a 95% increase in contributors from the previous release. One of the next priorities for maintainers is to improve the contribution workflow. Bachhuber said there are no plans at the moment to bring on additional paid co-maintainers, but they plan to start onboarding more volunteer committers. These are developers who are involved with the project on a regular basis but not necessarily daily or weekly. They have also created a <a href=\"https://make.wordpress.org/cli/good-first-issues/\" target=\"_blank\">Good First Issues page</a> for new contributors and have started working on a <a href=\"https://make.wordpress.org/cli/dash/\" target=\"_blank\">customized dashboard for committers</a>.</p>\n<h3>WP-CLI Has a New Logo</h3>\n<p>Bachhuber introduced the project&#8217;s new logo today, designed by Chris Wallace and his team at <a href=\"https://liftux.com/\" target=\"_blank\">Lift UX</a>. Having an official logo opens up the possibility for WP-CLI swag. Bachhuber said he worked with contributors to create a logo, because &#8220;people can develop stronger emotional affinity to brands with logos (myself included).&#8221; He is also interested in getting stickers created, particularly ones that glow in the dark, but has not yet found a producer. Bachhuber said he is hoping to have some preliminary WP-CLI swag for WordCamp Europe.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 01 Jun 2017 00:17:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: Pods 2.7 Beta Introduces Flexible Relationships, Rewrites Fields in JavaScript\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71009\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://wptavern.com/pods-2-7-beta-introduces-flexible-relationships-rewrites-fields-in-javascript\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2272:\"<p>Pods Framework has released two new versions. <a href=\"http://pods.io/2017/05/30/pods-2-6-9-maintenance-release/\">Pods 2.6.9</a> is a maintenance release that includes bug fixes for Pods Templates, Auto Templates, and Pods Shortcodes. Meanwhile, <a href=\"http://pods.io/2017/05/30/pods-2-7-beta/\">Pods 2.7 beta 1</a> introduces a new feature called Flexible Relationships.</p>\n<p>Flexible Relationships uses WordPress&#8217; media modal that allows users to add or edit records from within the parent record of a relationship. This feature will work on existing relationships once users upgrade to 2.7. Watch the following video to see Flexible Relationships in action.</p>\n<div class=\"embed-wrap\"></div>\n<p>In addition to providing Flexible Relationships, the fields were rewritten in JavaScript by Phil Lewis, Contributing Developer to Pods Framework.</p>\n<p>&#8220;Phil Lewis of our team rewrote our file upload and relationship fields in what we&#8217;re calling Dynamic Field Views which will allow us to convert all of our field types to be JavaScript powered,&#8221; <a href=\"https://scottkclark.com/\">Scott Kingsley Clark</a>, lead developer of <a href=\"http://pods.io/\">Pods Framework</a> said.</p>\n<p>&#8220;The JavaScripts frameworks behind it are Marionette + Backbone. We wrote it with React in mind so we can convert it over whenever React.js is included in core and things settle there&#8221;</p>\n<p>The development team is asking for as many users as possible to test Flexible Relationships on a staging or testing site so issues can be addressed before its release, tentatively scheduled for the middle of July. Those interested in testing can download the <a href=\"https://github.com/pods-framework/pods/archive/release/2.7.zip\">beta from Pods&#8217; GitHub repository</a>.</p>\n<p>Testers are encouraged to download the <a href=\"https://github.com/afragen/github-updater\">GitHub Updater</a> plugin, created by Andy Fragen, as it makes it easier to download updates from GitHub. If you participate in the testing process, be sure to add &#8216;2.7&#8217; to any feature, enhancement requests, or bugs that you find when <a href=\"https://github.com/pods-framework/pods/issues/new\">creating a new issue</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 May 2017 20:37:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"WPTavern: GitHub Introduces Temporary Interaction Limits to Promote Healthier Discussions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=71072\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://wptavern.com/github-introduces-temporary-interaction-limits-to-promote-healthier-discussions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5118:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/github-octocat.jpg?ssl=1\"><img /></a></p>\n<p>GitHub is continuing to make good on its promise to <a href=\"https://wptavern.com/github-responds-to-letter-from-open-source-project-maintainers\" target=\"_blank\">improve the platform for open source maintainers and communities</a> with its new <a href=\"https://github.com/blog/2370-temporary-interaction-limits\" target=\"_blank\">temporary interaction limits</a>. The feature was introduced this week as a way for project maintainers to manage participation in heated discussions.</p>\n<p>Public repositories, especially those for projects with millions of users, can occasionally have issues or pull requests that become overrun with comments from anyone who has an opinion. Repository owners can now set a 24-hour &#8220;cool down period&#8221; to limit interaction (commenting, creating pull requests, and opening issues) to existing users, prior contributors, and/or repository collaborators.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2017/05/temporary-interaction-limits.png?ssl=1\"><img /></a></p>\n<p>Temporary Interaction Limits can help mitigate the effects of &#8220;brigading,&#8221; <a href=\"https://news.ycombinator.com/item?id=14447705\" target=\"_blank\">as one Hacker News commenter called it</a> &#8211; when someone directs a large number of people to an issue from Twitter, Reddit, or other social channels in an attempt to influence the outcome of a discussion. Limiting the discussion to prior contributors or collaborators can help keep input focused around the ideas of those who are already invested in the project.</p>\n<p>Reactions to the new feature have been mostly positive, although some users don&#8217;t anticipate using it much since <a href=\"https://github.com/blog/2119-add-reactions-to-pull-requests-issues-and-comments\" target=\"_blank\">GitHub added emoji reactions to conversations</a> last year. In addition to keeping threads from becoming unreadable with numerous +1&#8217;s, emoji reactions as an option for expression should help limit interactions from those prone to &#8220;drive-by&#8221; commenting.</p>\n<p>A curated repository of &#8220;<a href=\"https://github.com/nikolas/github-drama\" target=\"_blank\">GitHub Drama</a>,&#8221; which includes projects like Bower, Docker, Django, and NodeJS, lists many instances wherein temporarily limiting interaction may have changed the overall tone of the discourse. However, some users questioned the feature&#8217;s usefulness in responses on Twitter and some see it as a way of purposely cutting outside voices out of the conversation.</p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">So many of us are curious: when would we use this? Locking down an entire repo to calm a single conversation is drastic overkill…</p>\n<p>&mdash; Nick Craver (@Nick_Craver) <a href=\"https://twitter.com/Nick_Craver/status/869661854917939202\">May 30, 2017</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">Nothing settles a technical discussion faster than the in-group forcibly silencing the out-group</p>\n<p>&mdash; Lee Clemens (@LeeClemens) <a href=\"https://twitter.com/LeeClemens/status/869670471561875456\">May 30, 2017</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\">\n<p lang=\"en\" dir=\"ltr\">I don\'t know about the value of this feature regarding open source collaboration, but I\'d love to have this capability in my email system</p>\n<p>&mdash; Brian Mitchell (@DrBrianMitchell) <a href=\"https://twitter.com/DrBrianMitchell/status/869726709007998977\">May 31, 2017</a></p></blockquote>\n<p></p>\n<p>In order for temporary interaction limiting to be useful to projects where locking down the whole repository would be too drastic of a measure, GitHub would need to extend it to include the ability to lock down individual issues and pull requests. Some users have also requested a convenient way for repository members to warn an individual without spamming the entire thread or to put specific users in a cool down period.</p>\n<p>&#8220;If it&#8217;s a legit heated discussion and you limit it, then you&#8217;re just [going] to come back in 24 hours to very long, impossible-to-follow responses,&#8221; Kris Siegel, Senior Engineer at PlayStation, <a href=\"https://news.ycombinator.com/item?id=14448871\" target=\"_blank\">commented</a> on the related Hacker News thread. &#8220;At least this has been my experience when people have left things to cool down them come back and need to respond to everything.&#8221;</p>\n<p>GitHub is aiming to promote healthier discussions with the new interaction limiting feature, but every project&#8217;s community is unique and maintainers may not be able to predict user reactions to locking down an entire repository. If the feature is turned on when a new user is attempting to create their first pull request, it may hinder future contribution.  Open source project maintainers should carefully consider the effects of silencing non-contributors when using the feature.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 May 2017 20:35:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"HeroPress: Building A WordPress Career in India\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=1874\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"https://heropress.com/essays/building-wordpress-career-india/?utm_source=rss&utm_medium=rss&utm_campaign=building-wordpress-career-india\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10728:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/05/053117-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: Give your children the room to grow.\" /><p>6 years back, I’d have never thought I would be where I am right now. At that time, I was a 12-year-old wondering how softwares were made. Despite the fact that I was born in a middle-class Indian family, my parents never forced me to opt for something I wasn’t interested in. Unlike other middle-class Indian children, the bar of expectations wasn’t set that high and I think it turned out to be for the best.</p>\n<p>My parents always supported me and constantly motivated me to learn whatever I liked. Eventually, from wondering about how software was made, I started wondering same about websites. For some reason, I felt more interested in websites than software. For starters, I felt coding in HTML was easier than working with C/C++</p>\n<p>Now that I’ve bored you already, let’s get to know each other too. I am <a href=\"http://technobooz.com\" target=\"_blank\" rel=\"noopener noreferrer\">Suyogya Shukla</a>, a WordPress developer from Kanpur, India. I work with <a href=\"https://themeisle.com\" target=\"_blank\" rel=\"noopener noreferrer\">ThemeIsle</a> as a Support Ninja where I make sure our users are always happy with our products. Let’s go ahead now.</p>\n<h3>The Journey</h3>\n<p>At the age of 12; still in class 6th, I started to learn about web coding. I started with HTML and learned how to make a really basic webpage. After understanding the basic concepts I wanted to start making a website already. I went ahead and googled &#8211; “How to make a free website” and the webs.com&#8217;s listing lead the page. I immediately clicked on it and started playing around, until I realized that it was WYSIWYG editor and it wasn’t possible for me to customize it a lot (Not that I knew how to!)</p>\n<p>At this time I had no idea about domain names and hosting. I researched some more and was introduced to the process of putting your website online, but it cost money! I decided to make a small website locally and then show it to my dad hoping he’d be impressed and provide me with the money I needed to put it online. While learning HTML, I came across this cool language called  “CSS” which would apparently make a website look and work better.</p>\n<p>Next thing you know, I was all over w3schools.com and YouTube watching videos about CSS, playing with the examples and much more. It took me a good 2 weeks to understand the basic concepts. I could finally change fonts, play with colors and do a lot more! While I liked how I had more control when I coded my own website, I still missed the easy content management webs.com and other WYSIWYG tools offered. This had me thinking again. What free software can I use to have the same level of control over my website but is just as easy to use when it comes to content management? This, in turn, initiated another research and I was finally introduced to this awesome software which went by the name of “WordPress”!</p>\n<p>Over the years I would work on a lot of WordPress based websites and continue to learn more about it every day. I worked for various small design agencies, as a freelancer and a lot more until one fine day in 2016 when I saw a “hiring” notice on <a href=\"https://themeisle.com\" target=\"_blank\" rel=\"noopener noreferrer\">ThemeIsle&#8217;s</a> website and decided to give it a shot. After an initial trial period of some 2 weeks, I was hired. I worked part-time (three hours/day, to be exact) for a year because I had school. Two months back, I started working full time. I work with the support and development team (more involved in support as of now, but I eventually want to get into full-time development) where I continue to learn new things every day.</p>\n<h3>It’s a Real Career Option!</h3>\n<p>For everyone who thinks WordPress is just a blogging tool, you’re wrong! Sure, it’s a blogging tool but it is used for so much more. It’s a real career option with a lot of room for growth. Given you are passionate about WordPress and the technologies used in it, you’d be able to find a job easily.</p>\n<blockquote><p>The best thing about the WordPress ecosystem is the people. They’re just so nice!</p></blockquote>\n<p>WordPress ecosystem is indeed competitive like any other but in the best way possible. Even if you’re another company wanting to know how some other company manages things or what technologies they use, they won’t hesitate to tell you about it. Almost all of the WordPress enthusiasts go to WordCamps where they meet new people and share knowledge.</p>\n<p>Another good thing about choosing WordPress as a career? The flexibility. A large part of the people who work on WordPress, do it remotely. The company WordPress.com, Automattic, is a completely distributed team with people working from different parts of the world. Want even more reasons to choose WordPress? The earning potential. Companies in the WordPress ecosystem are known to pay generously and the best part? You get to work with the folks who are just as passionate about WordPress as you are.</p>\n<h3>Engineering isn’t the only way to go</h3>\n<p>This is for all the Indian parents who are pushing their children to join coachings for IIT and other examinations right now, without their children wanting to &#8211; DON’T. Engineering isn’t the only way one can get a job. Sure, there’s nothing wrong with it but forcing your children to do it because you think there’s no other way? That isn’t right.</p>\n<p>Introduce your children to WordPress, introduce them to the world of web programming and see if they like it. Why not promote them to do something they like than to burden them with the weight of engineering when they don’t like it?</p>\n<blockquote><p>For all I know if my parents had forced me into engineering I would’ve missed out on everything. Give your children the room to grow.</p></blockquote>\n<p>Make them learn new things, introduce them to WordPress and all other cool things ( not just tech related! ) and leave it up to them to choose a career path <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" /></p>\n<h3>Working Remotely Is Fun</h3>\n<p>Let’s talk about working remotely now. It’s fun. You don’t have to wear a suit or any kind of uniform. You get to work in your PJs. Does it get any better than that? Oh wait, it does. You get to choose your working hours. You can decide to work 3hrs in morning and 3hrs at night or you can work 6hours at a stretch. Fellow night crawler? You can work at night. Apart from that, it gives you a lot of freedom. You can work from wherever you want. You can go to a beach and work. You can work while traveling, basically, you can decide to work from anywhere, anytime! It’s all up to you.</p>\n<p>Flexible working hours allow me to concentrate on learning new things on a personal level and maintain a healthy Work/ Life balance. But over time, you might get bored working from home. ( Not sure about you but it did happen with me! )</p>\n<blockquote><p>My two cents? Take some time out and go vacationing.</p></blockquote>\n<p>Join a co-working space and see if that helps. All in all, I love having the freedom to work from anywhere and the best part still remains that I can work while wearing my PJs.</p>\n<h3>What’s Next?</h3>\n<p>Let me put it this way; I love WordPress. I have been doing some UI/UX work for a while now and I liked it. I am planning to learn more about it while learning more about WordPress development in parallel. For now, I am starting a small WordPress studio, <a href=\"http://madewithwp.com\" target=\"_blank\" rel=\"noopener noreferrer\">Made With WP</a>, with my friends (and colleagues) &#8211; Hardeep and Rohit. <a href=\"https://heropress.com/essays/be-your-own-teacher/\">You might remember Hardeep talking about it in his essay</a>. It’s the same project. I am working on my first WordPress theme and hope to see it in the theme directory soon. I am pretty good with HTML, CSS and comfortable with JS and PHP and I plan to learn more about them.</p>\n<p>Apart from that, I am the co-organizer of <a href=\"https://2017.kanpur.wordcamp.org\" target=\"_blank\" rel=\"noopener noreferrer\">WordCamp Kanpur</a>. I have been to two WordCamps so far and run an active meetup in my hometown, Kanpur. I gave my 12th exams this year and I plan to study more about new things as much as I can. Also, I am 18 years old as I write this.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Building A WordPress Career in India\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Building%20A%20WordPress%20Career%20in%20India&via=heropress&url=https%3A%2F%2Fheropress.com%2Fessays%2Fbuilding-wordpress-career-india%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Building A WordPress Career in India\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=https%3A%2F%2Fheropress.com%2Fessays%2Fbuilding-wordpress-career-india%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=https%3A%2F%2Fheropress.com%2Fessays%2Fbuilding-wordpress-career-india%2F&title=Building+A+WordPress+Career+in+India\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Building A WordPress Career in India\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=https://heropress.com/essays/building-wordpress-career-india/&media=https://heropress.com/wp-content/uploads/2017/05/053117-150x150.jpg&description=Building A WordPress Career in India\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Building A WordPress Career in India\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"https://heropress.com/essays/building-wordpress-career-india/\" title=\"Building A WordPress Career in India\"></a></div><p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/building-wordpress-career-india/\">Building A WordPress Career in India</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 May 2017 12:00:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Suyogya Shukla\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Fri, 23 Jun 2017 01:53:35 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Fri, 23 Jun 2017 01:45:09 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20130911090210\";}', 'no');
