(1, 1498161212, 'new', 'knownfile', 2, 'dc0aa917f3f3ee9a7acdefbfbe8e1857', 'cdfc04e75bc71614ba1145afe96c9286', 'Modified plugin file: wp-content/plugins/sg-cachepress/languages/sg-cachepress-bg_BG.mo', 'This file belongs to plugin \"SG Optimizer\" version \"3.3.1\" and has been modified from the file that is distributed by WordPress.org for this version. Please use the link to see how the file has changed. If you have modified this file yourself, you can safely ignore this warning. If you see a lot of changed files in a plugin that have been made by the author, then try uninstalling and reinstalling the plugin to force an upgrade. Doing this is a workaround for plugin authors who don\'t manage their code correctly. [See our FAQ on www.wordfence.com for more info]', 'a:9:{s:4:\"file\";s:65:\"wp-content/plugins/sg-cachepress/languages/sg-cachepress-bg_BG.mo\";s:5:\"cType\";s:6:\"plugin\";s:7:\"canDiff\";b:1;s:6:\"canFix\";b:1;s:9:\"canDelete\";b:0;s:5:\"cName\";s:12:\"SG Optimizer\";s:8:\"cVersion\";s:5:\"3.3.1\";s:4:\"cKey\";s:31:\"sg-cachepress/sg-cachepress.php\";s:10:\"haveIssues\";s:7:\"plugins\";}'),
(2, 1498161212, 'new', 'knownfile', 2, '9941db4cd9f419fefac5ae253260384b', '01645c374c1f1f4e871935dec3b86ce7', 'Modified plugin file: wp-content/plugins/sg-cachepress/languages/sg-cachepress-bg_BG.po', 'This file belongs to plugin \"SG Optimizer\" version \"3.3.1\" and has been modified from the file that is distributed by WordPress.org for this version. Please use the link to see how the file has changed. If you have modified this file yourself, you can safely ignore this warning. If you see a lot of changed files in a plugin that have been made by the author, then try uninstalling and reinstalling the plugin to force an upgrade. Doing this is a workaround for plugin authors who don\'t manage their code correctly. [See our FAQ on www.wordfence.com for more info]', 'a:9:{s:4:\"file\";s:65:\"wp-content/plugins/sg-cachepress/languages/sg-cachepress-bg_BG.po\";s:5:\"cType\";s:6:\"plugin\";s:7:\"canDiff\";b:1;s:6:\"canFix\";b:1;s:9:\"canDelete\";b:0;s:5:\"cName\";s:12:\"SG Optimizer\";s:8:\"cVersion\";s:5:\"3.3.1\";s:4:\"cKey\";s:31:\"sg-cachepress/sg-cachepress.php\";s:10:\"haveIssues\";s:7:\"plugins\";}');
